(00085, 367, 'Receita: Espada comum nivel 1 a 10', '<b>Tipo:</b> Forja<br><br>\r\n<b>Espaço 1:</b> Ferro, quantidade: 5<br>\r\n<b>Espaço 2:</b> Tronco de madeira verde, quantidade: 5\r\n<br><br>\r\n<b>Resultado:</b> 1 espada comum de nível aleatório (do nível 1 ao 10)<br><br>\r\nConsidere a numeração dos espaços começando da esquerda para direita, de cima para baixo', 1, 1, 0, 0, 1000),
(00086, 367, 'Receita: Pistola comum nivel 1 a 10', '<b>Tipo:</b> Forja<br><br>\r\n<b>Espaço 1:</b> Tronco de madeira verde, quantidade: 5<br>\r\n<b>Espaço 2:</b> Ferro, quantidade: 5\r\n<br><br>\r\n<b>Resultado:</b> 1 Pistola comum de nível aleatório (do nível 1 ao 10)<br><br>\r\nConsidere a numeração dos espaços começando da esquerda para direita, de cima para baixo', 1, 1, 0, 0, 1000),
(00087, 367, 'Receita: Arma comum nivel 1 a 10', '<b>Tipo:</b> Forja<br><br>\r\n<b>Espaço 1:</b> Ferro, quantidade: 5<br>\r\n<b>Espaço 5:</b> Tronco de madeira verde, quantidade: 5\r\n<br><br>\r\n<b>Resultado:</b> 1 Arma comun de nível aletório (do nível 1 ao 10)<br><br>\r\nConsidere a numeração dos espaços começando da esquerda para direita, de cima para baixo', 1, 1, 0, 0, 1000),
