INSERT INTO `tb_missoes` (`cod_missao`, `respectiva`, `faccao`, `nome`, `descricao`, `descricao_2`, `descricao_3`, `recompensa_xp`, `recompensa_berries`, `requisito_lvl`, `requisito_missao`, `duracao`, `img`) VALUES
(000001, 000000, 3, 'Boas vindas', 'Após a morte do reis dos piratas, pessoas do mundo inteiro se jogaram nos oceanos em busca do seu tesouro, o One Piece.', 'Após a morte do reis dos piratas, pessoas do mundo inteiro se jogaram nos oceanos em busca do seu tesouro, o One Piece.<br> Se você quiser embarcar nessa aventura vai precisar conseguir um barco e uma tripulação.<br> Você pode conseguir dinheiro para comprar um barco fazendo missões nessa ilha.', 'Após a morte do reis dos piratas, pessoas do mundo inteiro se jogaram nos oceanos em busca do seu tesouro, o One Piece.<br> Se você quiser embarcar nessa aventura vai precisar conseguir um barco e uma tripulação.<br> Você pode conseguir dinheiro para comprar um barco fazendo missões nessa ilha.', 100, 100000, 1, 000000, 60, 1),
(000002, 000000, 3, 'Intruções iniciais', 'Cada tripulante evolui independente dos outros, fique atento as informações de cada um para não ser pego de surpresa.', 'Assim como em qualquer RPG, o HP corresponde a vida do personagem. Os pontos de Energia sãos gastos para usar habilidades em combate e a EXP(experiência) permite a evolução do personagem.', 'Assim como em qualquer RPG, o HP corresponde a vida do personagem. Os pontos de Energia sãos gastos para usar habilidades em combate e a EXP(experiência) permite a evolução do personagem.', 100, 100000, 1, 000001, 60, 2),
(000003, 000000, 3, 'Atributos', 'Sugoi Game tem 8 atributos para serem distribuidos.', '<b>Ataque</b>: Cada ponto aumenta o dano causado pelo personagem em 10.<br>\n<b>Defesa</b>: Cada ponto diminui o dano sofrido pelo personagem em 10.<br>\n<b>Precisão</b>: Cada ponto diminui a chance do inimigo se esquivar ou bloquear seu ataque em 1%.<br>\n<b>Agilidade</b>: Cada ponto aumenta sua chance de se esquivar do ataque inimigo em 1%.<br>\n<b>Resistência</b>: Cada ponto aumenta sua chance de bloquear o ataque inimgo em 1% e a quantidade de dano absorvido em 1%.<br>\n<b>Percepção</b>: Cada ponto reduz a chance do inimigo te acertar um ataque crítico em 1% e o dano causado por ataques críticos em 1%.<br>\n<b>Dextreza</b>: Cada ponto aumenta sua chance de acertar um ataque crítico em 1% e o dano causado por ataques críticos em 1%.<br>\n<b>Vitalidade</b>: Cada ponto aumenta seu HP máximo em 50 pontos e a Energia máxima em 7 pontos<br>', 'Esquiva, Bloqueio e Crítico tem um limite de 50% de chance, ou seja, não adianta ter 100 pontos a mais que seu inimigo, a chance máxima é de 50%.', 100, 100000, 1, 000002, 60, 3),
(000004, 000000, 3, 'Ilhas', 'Quando você está em uma ilha você pode comprar ou vender itens, aprender habilidades, aprender profissões ou recrutar tripulantes.', 'Sugoi Game tem 3 classes e várias profissões que podem ser aprendidas na Academia e na Escola de profissões.<br>\nO hospital é útil para recuperar HP e Energia de personagens que perderam a batalha.', 'Escolha com cuidado suas classes e profissões, lembrando que você terá muitos personagens para criar, então variar as classes e profissões dos tripulantes pode ser uma boa ideia.', 100, 100000, 1, 000003, 60, 4),
(000005, 000000, 3, 'Evoluindo tripulantes e comprando o navio.', 'Quando a Experiência atinge a quantidade máxima você pode evoluir seu personagem', 'Acessando a Visão Geral dos tripulantes e clicando no tripulante com a quantidade máxima de EXP você verá um botão que evolui o personagem.<br>\nQuando um personagem evolui ele recebe 100 pontos no seu HP máximo, 15 pontos na quantidade máxima de energia e mais 5 pontos de atributos para serem distribuídos, além de restaurar o HP e a energia do personagem.', 'Agora que você juntou muitos Berries chegou a hora de comprar seu primeiro barco e recrutar os primeiros tripulantes.<br>\nVisite o estaleiro da ilha para ver as ofertas de barco, e depois inicie uma campanha a procura de tripulantes.<br>', 100, 100000, 1, 000004, 60, 5),
(000006, 000000, 3, 'Oceano', 'O mapa do mundo de One Piece é bem extenso, cuidado para não se perder.', 'A tela do oceano possui duas sessões importantes:<br>\nA sessão da esquerda mostra seu campo de visão, clicando em algum quadro você pode ver se existe algum inimigo ou ilha nessa coordenada que aparecerão na sessão da direita.<br>\nAo selecionar um quadro ao redor do seu navio você pode clicar no botão "Adicionar Rota" e criar uma rota de navegação.<br>\nApós criar a rota, basta clicar em "Navegar" para começar o trajeto.', 'Enquanto você estiver em uma ilha ou ao redor dela, você não poderá ser atacado ou atacar algum inimigo.<br>\nEstas são as zonas neutras do jogo.', 200, 100000, 2, 000005, 90, 6),
(000007, 000000, 3, 'Reis dos Mares', 'Cuidado enquanto navega!', 'Quando você conclui uma parte da rota você pode ser atacado por um rei dos mares.<br>\nAo ser atacado você irá entrar em combate.<br>\nO combate é simples:<br>\nNa sua vez você escolhe uma ação: atacar ou mover.<br>\nSe você escolher mover, clique no personagem que você quer mover e em seguida clique no quadro para onde você quer leva-lo.<br>\ncada jogador pode fazer até 5 movimentos na sua vez.<br><br>\nSe você escolher atacar, clique em seguida no personagem que irá atacar.<br>\nIrá abrir uma tela onde você deverá escolher a habilidade que o personagem selecionado irá usar.<br>\nEm seguida, de acordo com o alcance da habilidade, você selecionará o quadro de efeito da habilidade.<br>\nHabilidades que tem área de efeito maiores que 1, necessitam que você escolha todos os quadros onde a habilidade será usada.<br>\n<br>\nQuando você atacar, seu turno terminará e será a vez do adversário jogar.', 'O jogador que derrotar todos os personagens do adversário vence.<br>', 200, 100000, 2, 000006, 90, 7),
(000008, 000000, 3, 'Habilidades', 'Existem 3 categorias e 3 tipos de habilidades no jogo.', 'Categorias:<br>\r\n<b>Classe: </b>Habilidades aprendidas na academia por espadachins, lutadores ou atiradores.<br>\r\n<b>Profissão: </b>Habilidades liberadas por determinadas profissões.<br>\r\n<b>Akuma: </b>Habilidades liberadas quando o personagem come uma Akuma no mi.<br>\r\n<br>\r\nTipos:<br>\r\n<b>Ataqes: </b>Habilidades que causam dano.<br>\r\n<b>Buff: </b>Habilidades que causam aumento ou redução de um atributo por um certo período em combate.<br>\r\n<b>Passiva: </b>Habilidade que aumenta um determinado atributo.', 'Durante uma batalha você só pode usar um buff ou ataque no seu turno', 200, 100000, 2, 000007, 90, 8),
(000009, 000000, 3, 'Aprendendo habilidades', 'Você precisa dar um nome para suas habilidades.', 'Qualquer habilidade que seu personagem for aprender precisa de um nome, uma descrição e um ícone.<br>\r\nÉ hora de usar a criatividade!', 'Os bônus das habilidades são fixos.', 200, 100000, 2, 000008, 90, 9),
(000010, 000000, 3, 'Reputação, Fama e Ameaça', 'O Ranking do jogo não é calculado apenas por nível.', '<b>Reputação: </b>Classifica a tripulação inteira, quando você derrota um jogador sua reputação aumenta, quando você é derrotado por um jogador, sua reputação diminui.<br>\r\n<b>Fama e Ameaça: </b>Fama para os marinheiros e ameaça para piratas.<br>\r\nQuando um personagem seu derrota um personagem inimigo a ameaça/fama dele aumenta. A ameaça/fama determina o preço pela recompensa/gratificação do personagem.<br>\r\nAo derrotar um jogador, você ganha a recompensa/gratificação por toda tripulação daquele jogador, ao ser derrotado a recompensa/gratificação de todos os seus personagens é zerada.<br>\r\nOBS: Piratas não ganham recompensa por derrotar outros piratas', 'Para atacar outros jogadores no oceano você tem que cumprir 4 requisitos: <br />\r\n1º- Ter o capitão no nível 10\r\n2º- Piratas atacam a todos enquanto marinheiros só atacam piratas; <br />\r\n3º-Nem você nem seu alvo podem estar ao redor de ilhas, em volta de ilha é zona neutra, não da para atacar lá;<br />\r\n4º-Cada jogador tem a sua REPUTAÇÃ?O, você precisa de uma diferença de no máximo 10 000 de reputação pra poder atacar, ou seja, se você tiver 17 000 de reputação, você só pode atacar ou ser atacado por jogadores com no mínimo 7 000 de rep e no máximo 27 000 de rep,<br />\r\n', 300, 100000, 3, 000009, 120, 10),
(000011, 000000, 3, 'PVP', 'Existem 3 tipos de batalha pvp: Ataque, Saque e Disputa amigável', 'Ataques são disputas atrás de reputação.<br>\r\nSaques são batalhas onde o vencedor rouba o perdedor.<br><br>\r\nUma batalha por saque lhe dá ou tira 50% menos reputação em relação a um ataque normal, em compensação, o vencedor rouba 10% do ouro do perdedor.<br><br>\r\nDisputas amigáveis não dão recompensa alguma.', 'Boa sorte em suas aventuras!', 300, 100000, 3, 000010, 120, 11),
(000012, 000013, 1, 'Reis dos Mares', 'Você caminha pela cidade em busca de aventura e encontra um velho sentado. Ao se aproximar algo nele chama sua atenção, você percebe que ele tinha uma perna-de-pau...', 'Você se aproxima e pergunta como ele perdeu a perna, e ele conta, com um sorriso orgulhoso, uma divertida história sobre como ele sobreviveu depois de encontrar com um rei dos mares, “Lord of the Coast”.', 'Depois da história você diz para o velho que está muito ansioso para encontrar o rei dos mares, o velho dá uma risada e diz que você não duraria um minuto e fugiria correndo com medo.', 100, 100000, 3, 000000, 180, 0),
(000013, 000012, 0, 'Pegos de surpresa.', 'Vila Fuusha, uma pequena vila muito tranquila com terra muito fértil. Dizem que há um rei dos mares que mora ao redor da ilha.', 'Parecia ser mais um dia comum na vila, até que você ouve um barulho de canhões e pessoas gritando. Você muito curioso corre para ver o que estava acontecendo.', 'Você corre para ver o que era e vê um navio da Marinha perseguindo um navio pirata.', 100, 100000, 3, 000000, 180, 0),
(000014, 000017, 1, 'Tentando ser aventurar', 'Caminhando pelo cais da ilha, você vê alguns pescadores preparando um navio e nota que está quase pronto. Essa pode ser a sua chance de se encontrar com o Rei dos mares “Lord of The Coast”.', 'Você caminha até o capitão do navio e pede para fazer parte da tripulação, que retruca dizendo:<br>\r\n-Já tenho muitos tripulantes, e você não poderia fazer nada por mim!<br>\r\n--Eu poderia te defender do Lord of the coast!!!<br>\r\n-Há!Ha!Ha! Muito poucos enfrentaram esse rei dos mares e sobreviveram pra contar a história!! E os que sobreviveram esse rei dos mares levou uma parte do deles com ele, aquele velho e até mesmo o Shanks, não me deixam mentir.<br>\r\n--Ouvi falar que o Luffy o venceu com um só golpe.<br>\r\n-Já chega, suma daqui!!!', 'É, você não conseguiu a permissão para entrar no navio. Só resta uma opção... entrar escondido.', 100, 100000, 3, 000012, 180, 0),
(000015, 000018, 1, 'Invadindo', 'Agora é só achar um meio de entrar no navio, bom tem um barril vazio bem ali, isso te dá alguma ideia?', 'Você entra no barril e espera até que alguém o leve até o navio, só que te descobrem facilmente e te expulsam do navio. Você  tenta simplesmente ajudar a tripulação a carregar o navio fingindo ser parte da tripulação mas não da certo. Bom, continue tentando!', 'Depois de muitas tentativas bobas você consegue embarcar no navio, cara, você até se disfarçou de capitão do navio e todos riram de você, na verdade foi só esperar a hora do almoço da tripulação, foi bem fácil! É hora de navegar!', 100, 100000, 3, 000014, 240, 0),
(000016, 000019, 1, 'Entrando para uma tripulação', 'É a pescaria foi boa, mas parece que você não teve sorte, o Rei dos mares não apareceu! Que pena, talvez na próxima.', 'Já avistando a cais da ilha, você já está sem esperanças de achar o Rei dos mares, até que de repente, o navio bate em alguma coisa. O capitão grita para os tripulantes assumirem seus postos, porque o Lord of the coast estava ali. Você sai de seu esconderijo e corre ansioso para ver a aparência de um Rei dos mares.<br>\r\nO capitão percebe sua presença e grita para você abandonar o navio ou iria morrer. Então o rei dos mares ataca o navio quebrando um de seus mastros e parte do casco. O capitão ordena a seus subordinados que preparem os canhões, então a Serpente gigante se prepara atacar novamente, mas dessa vez ela foi direto no capitão que fica paralisado, você percebe o que iria acontecer e a acerta em cheio com o canhão antes dela acertá-lo. Enquanto o Rei dos mares se recupera o capitão pede a todos que abandonem o navio, mas você ainda queria lutar, então alguns tripulantes te agarram e tiram você à força.', 'Você consegue ver de longe a Serpente gigante destruindo o navio, e comendo todos os peixes. O capitão chega perto de você e te elogia pela coragem e que você é bem vindo para fazer parte de sua tripulação. Você diz que já tem sua própria tripulação e só se juntou a ele porque queria um pouco de diversão, então o capitão sorri e diz espera vê-lo novamente algum dia.', 100, 100000, 3, 000015, 240, 0),
(000017, 000014, 0, 'Eles fugiram', 'O navio pirata era mais lento e quando o navio da marinha o alcança os dois navios trocam tiros, mas o navio pirata estava mais avariado.', 'O navio pirata é destruído e os sobreviventes nadam direto para a sua ilha. Os Marinheiros sem demora vão atrás desses piratas.<br>\r\n\r\nOs piratas pegam alguns moradores de reféns outros se escondem nas casas. Você não vê a hora dessa confusão acabar.', 'Os marinheiros finalmente chegam na ilha e já começam a botar ordem no local', 100, 100000, 3, 000013, 180, 0),
(000018, 000015, 0, 'Eu quero ajudar', 'Os piratas decidem negociar com os marinheiros para libertar os reféns. O Vice-almirante Monkey D. Garp, um dos marinheiros mais respeitados, chega.', 'Garp faz um sinal com as mãos, e todos os marinheiros se agrupam de forma estratégica. Você fica encantado com a figura de Garp. Você decide ajudar e vai para perto de onde os piratas estavam, você arremessa uma pedra no Capitão dos piratas, e enquanto isso todos os marinheiros avançam e capturam os piratas. O capitão dos piratas corre em sua direção e te segura apontando uma faca para o seu pescoço. ', 'Garp sem pensar muito imediatamente o golpeia e salva sua vida. Fim da batalha, você está louco para conhecer Garp.', 100, 100000, 3, 000017, 240, 0),
(000019, 000016, 0, 'Irei me tornar um marinheiro', 'Enquanto os marinheiros levam os piratas para o navio, você vai em direção a Garp, que olha pra você e caminha em sua direção.', 'Garp te elogia pela coragem e diz que se você não tivesse ajudado seria muito mais difícil prender aqueles piratas. Ele te dá uma pequena medalha e você pergunta o que tem que fazer para se tornar um marinheiro como ele. Garp abre um sorriso diz pra você treinar muito e ir para Shells Town, lá tem uma base da marinha. Finalizando Garp diz que espera ver você novamente.', 'Bom! Garp já te mostrou o caminho a seguir, treine bastante e se tornará um Marinheiro muito forte!! ', 100, 100000, 3, 000018, 240, 0),
(000020, 000024, 1, 'Lvneel Kingdom', 'A ilha de Lvneel é cheia de construções antigas, um lugar onde diversos piratas estrangeiros desembarcam', 'Além das moradias,nota-se tambem,que há varios marinheiros andando pelas ruas da cidade com armas de fogo,armaduras e espadas.', 'Os piratas devem ter o cuidado de não serem pegos ao mesmo tempo que abastecem seu navio ou exploram a cidade.', 100, 100000, 3, 000000, 180, 0),
(000021, 000025, 1, 'Os becos da cidade', 'Correndo pelos becos mais vazios da cidade, você descobre que o rei desta ilha tem uma grande quantidade de tesouros, e começa a pensar em uma maneira de rouba-lo.', 'De repente um velho senhor o assusta no meio da correria e pergunta se você é um pirata. Sabendo da resposta, o senhor fala de um bar para piratas dentro de um porão.', 'Animado com a notícia, você vai até esse lugar para beber e conversar.', 100, 100000, 3, 000020, 180, 0),
(000022, 000026, 1, 'Curiosidades', 'Como todo pirata faria, você e seu pequeno bando festejaram, beberam e conversaram com os outros.', 'Assim, perguntando para um velho a estória da ilha, você fica sabendo que Noland nasceu e foi executado nesta mesma cidade. E agora soube de onde veio a famosa estória do North Blue, a história de "Noland o mentiroso".', 'Depois de um longo papo, o capitão decide ir roubar um pouco de ouro do rei.', 100, 100000, 3, 000021, 240, 0),
(000023, 000027, 1, 'Hora de partir', 'se escondendo dos guardas, os piratas se infiltraram no castelo mas infelizmente encontraram um grupo de marinheiros.', 'Durante a batalha você percebe que se continuar vai perder muitos homens e que não daria para roubar o ouro também, portanto o melhor a se fazer é voltar para o navio.', 'Antes de embarcar, um dos subordinados que ficou no navio subornou um marinheiro para conseguir velas e uma bandeira da marinha, então você consegue escapar da ilha e dos marinheiros.', 100, 100000, 3, 000022, 240, 0),
(000024, 000020, 0, 'Chegando em Lvneel', 'Um dos marinheiros do navio grita:_Há uma ilha bem na nossa frente, comandante!', 'Purupurupuru...Purupurupuru...<br>\r\n-Aqui fala da base da marinha de Lvneel Kingdom, por favor vocês devem vir para a base se identificar, pois há muitos piratas que usam a bandeira da marinha nesse local para escapar da nossa vigilância.', 'Confirmado!<br>\r\nPreparar para descer na ilha.Estamos quase chegando.', 100, 100000, 3, 000000, 180, 0),
(000025, 000021, 0, 'A estranha plataforma', 'Depois da chegada à cidade os marinheiros da base verificam o navio para ter certeza que o navio pertencia realmente à marinha.', 'Os marinheiros que tinham acabado de se recrutar, estavam um pouco chateados com a situação e decidem sair para dar uma volta enquanto os veteranos checavam o navio. Chegaram em uma praça, observam uma plataforma provavelmente usada para execução.', 'Entretanto, havia uma coisa estranha naquela plataforma, já que não tinha a marca da marinha ou do governo mundial.', 100, 100000, 3, 000024, 180, 0),
(000026, 000022, 0, 'Sem permissão', 'Com essa dúvida, você prestou atenção em uma conversa entre um morador e o comandante e descobriu o motivo da torre.', 'Então, mesmo sem ordens você decidiu ir falar com o rei sobre essa questão de execução realizada pelo reino ao invés do governo.', 'Com seus pensamentos sobre justiça você partiu em direção do castelo sem se preocupar com nada!', 100, 100000, 3, 000025, 240, 0),
(000027, 000023, 0, 'Fomos roubados', 'Guiados por um guarda, os marinheiros notam uma pertubação no ar e logo adiante encontram piratas dentro do castelo.', 'Depois dos dois grupos ficarem encarando um ao outro, o comandante toma a iniciativa e pega sua arma para a luta. Ao meio de fogo cruzado, o capitão dos piratas grita para seus homens se retirarem.<br>Quando os marinheiros começam a caçar os piratas o den den muchi toca. O comandante tinha recebido ordens para voltar à base da marinha já que que seu navio estava sem bandeira e velas. Tinham sido roubadas!', 'Sem mais o que fazer, você toma seu posto na base da marinha e recebe novas ordens: Vamos para a próxima ilha', 100, 100000, 3, 000026, 240, 0),
(000028, 000032, 0, 'Por trás da bela imagem', 'O mundo agora sabe da morte do rei dos piratas e do seu tesouro, o que o mundo não sabe ainda, é que o que lhe é mostrado é o que os poderosos querem que ele veja.', 'Após a morte do Rei dos Piratas, começaram a se espalhar rumores de que ele tinha um filho.<br>\r\nPreocupados com isso, a marinha mandou matar todas crianças recém nascidas e mulheres grávidas da ilha natal do Rei dos Piratas.', 'Esta informação era conhecida apenas pelos habitantes de Baterilla, a ilha onde viveu o Rei dos Piratas, e de maneira alguma a marinha permitia que esta informação escapasse da ilha.', 100, 100000, 3, 000000, 180, 0),
(000029, 000033, 0, 'Enfrentando o poder', 'Aquilo parecia extremo para você.', '-Isso é um exagero! Essas crianças não tem culpa dos erros dele - disse você para o guarda que tentava entrar em uma casa.<br>\r\n-Eu apenas sigo ordens, se você não me deixar entrar terei que tomar providências.<br>\r\n-Eu não irei permitir que essas crianças sejam assassinadas dessa maneira!', 'O guarda fez um sinal, e então 3 homens vieram correndo em sua direção, você se esquivou dos guardas e conseguiu fugir, eles nem vieram atrás de você, tinham trabalho a cumprir', 100, 100000, 3, 000028, 180, 0),
(000030, 000034, 0, 'Decidindo sua vida', 'Os dias se passaram e o tumulto foi diminuindo.', 'Após a morte de várias crianças, as ações dos guardas foram diminuindo.<br>\r\nVocê não podia fazer nada e aquilo estava lhe incomodando muito.<br>\r\n-Eu vou encontrar um solução para isso! Vou entrar para marinha, alcançar uma alta patente e vou mudar a marinha de dentro para fora!\r\n', 'O mundo não pode ficar fugindo do que é errado e deixar que o façam, uma pessoa como eu poderia apagar toda maldade de dentro da marinha para fazer esse mundo melhor.', 100, 100000, 3, 000029, 240, 0),
(000031, 000035, 0, 'A partida', 'Indo ao quartel da marinha, você corajosamente se oferece para se alistar.', 'O general que estava no posto, vagarosamente lhe observa, cria coragem e pergunta:<br>\r\n-Mesmo vendo o que está acontecendo aqui você quer se alistar?<br>\r\n-Sim, a marinha é o que nos protege, se ela age errado ao meu ponto de vista, tentarei muda-la.<br>\r\n-E como você pretende muda-la? Obedecendo essas ordens?<br>\r\n-Hoje marinheiro, amanhã Almirante!<br>\r\nDepois disso o general se calou.', '-Então vamos providenciar seu preparo, vá até a próxima ilha, a cidade de Zozu, e leve essa recomendação.', 100, 100000, 3, 000030, 240, 0),
(000032, 000028, 1, 'Por trás da bela imagem', 'O mundo agora sabe da morte do rei dos piratas e do seu tesouro, o que o mundo não sabe ainda, é que o que lhe é mostrado é o que os poderosos querem que ele veja.', 'Após a morte do Rei dos Piratas, começaram a se espalhar rumores de que ele tinha um filho.<br>\r\nPreocupados com isso, a marinha mandou matar todas crianças recém nascidas e mulheres grávidas da ilha natal do Rei dos Piratas.', 'Esta informação era conhecida apenas pelos habitantes de Baterilla, a ilha onde viveu o Rei dos Piratas, e de maneira alguma a marinha permitia que esta informação escapasse da ilha.', 100, 100000, 3, 000000, 180, 0),
(000033, 000029, 1, 'Enfrentando o poder', 'Aquilo parecia extremo para você.', '-Isso é um exagero! Essas crianças não tem culpa dos erros dele - disse você para o guarda que tentava entrar em uma casa.<br>\r\n-Eu apenas sigo ordens, se você não me deixar entrar terei que tomar providências.<br>\r\n-Eu não irei permitir que essas crianças sejam assassinadas dessa maneira!', 'O guarda fez um sinal, e então 3 homens vieram correndo em sua direção, você se esquivou dos guardas e conseguiu fugir, eles nem vieram atrás de você, tinham trabalho a cumprir', 100, 100000, 3, 000032, 180, 0),
(000034, 000030, 1, 'Decidindo sua vida', 'Os dias se passaram e o tumulto foi diminuindo', 'Após a morte de várias crianças, as ações dos guardas foram diminuindo.<br>\r\nVocê não podia fazer nada e aquilo estava lhe incomodando muito.<br>\r\nSem encontrar uma solução para aquilo, você chega a uma conclusão:\r\n-Se eu não posso fazer nada aqui, irei em busca de justiça em outro lugar.\r\n', '-Irei me tornar um pirata, vou viver a margem dessa sociedade, vou seguir apenas as minhas regras e vou atras da justiça que eles não pregam!\r\n', 100, 100000, 3, 000033, 240, 0),
(000035, 000031, 1, 'A partida', 'Já com um pequeno bote que você tinha para buscar algumas mercadorias em outras ilhas, você abandona sua ilha.', 'Sem olhar para trás, com medo de ver alguma mulher chorando ou sangue sendo derramado, você sobe no bote com suas poucas coisas e parte.', 'Espero conseguir fazer alguma diferença para este mundo...', 100, 100000, 3, 000034, 240, 0),
(000036, 000040, 1, 'Um importante acontecimento', 'A marinha está realizando uma transmissão importante em uma praça no centro da ilha, todas as pessoas foram até lá para ver do que se trata', 'Chegando lá pode-se ouvir vários comentários: "Como isso é possível?", "não acredito!", "Enfim um problema a menos".<br>\r\nOlhando para o telão, uma transmissão de Loguetown, você pode ver o lento caminhar daquele proclamado "Rei dos piratas" indo em direção a torre de execuções.<br>\r\nNão dava para acreditar que um homem tão formidável do qual tinha se ouvido tamanhas histórias, havia sido capturado e estava a beira da morte.', 'Quando ele subiu na torre o silêncio ecoou na multidão, todos acompanhavam atentamente quando de repente ouviu-se um grito:<br>\r\n-E seu tesouro? Onde está?<br>\r\nAos poucos os comentários cochichados foram aumentando até se transformarem num zumbido alto e sem controle, até que o Rei dos Piratas ergueu sua cabeça, e o que todos pesavam que seria um grande exemplo a favor da marinha, se tornou um verdadeiro caos com a suas palavras:\r\n-Meu tesouro? Vocês o querem? Eu os deixo pegar! Vão atrás dele! Deixei tudo naquele lugar!', 100, 100000, 3, 000000, 180, 0),
(000037, 000041, 1, 'A decisão', 'Antes que ele tentasse dizer mais alguma coisa, os carrascos fizeram seu trabalho', 'E ali se foi o Rei dos Piratas com um sorriso no rosto.<br>\r\nEntão ao voltar para casa, aquelas palavras não saiam da sua cabeça. "Será que esse tesouro realmente existe?".<br>\r\nEntão você decide abandonar tudo e também seguir este sonho que mexeu com todos.', 'Vou me tornar um pirata!', 100, 100000, 3, 000036, 180, 0),
(000038, 000042, 1, 'Preparativos', 'É hora de iniciar os preparativos para sua nova aventura', 'Motivados por recentes acontecimentos, várias pessoas resolveram se juntar a você, foi realmente fácil conseguir um tripulação.<br>', 'Com a tripulação pronta, precisamos de um navio!', 100, 100000, 3, 000037, 240, 0),
(000039, 000043, 1, 'A primeira partida', 'O velho Ken, um senhor que morava próximo ao porto, lhe chamou para conversar', '-Faz tempo que não vejo pessoas tão empolgadas para morrer- disse o velho<br>\r\n-Nós não vamos morrer- você questionou -Retornaremos ricos e poderosos, seremos lembrados pelas futuras gerações, vamos viver intensamente e deixar de lado esta vida pacata<br>\r\nO senhor olhou para você e, por um momento, você pensou vê-lo derramando uma lágrima.<br>\r\n-Então não tenho mais o que falar, venha comigo.<br>\r\nVocês sairam da casa do velho Ken por uma porta aos fundos, caminharam um pouco e chagaram ao porto, lá estava a sua espera um velho navio, que apesar de velho parecia bem resistente.<br>\r\n-É seu! - Disse Ken olhando para você.<br>\r\n-Como assim?<br>\r\n-Esse navio já me permitiu viver inúmeras aventuras, mas agora, olhe para mim, o que um velho como eu é capaz de fazer alem de viver esta vida pacata aqui.<br>\r\n-Irei cuidar bem dele!<br>\r\n-Tenho certeza que irá.<br>\r\nSem mais delongas, sua tripulação subiu a bordo e se preparam para partida.', '-Não lhe preocupa que pessoas tão inexperientes estão ao seu lado capitão? - Disse o mais jovem membro ao pé da sua orelha.<br>\r\n-Relaxe meu jovem, viver intensamente não é o que nos trouxe até aqui?<br>\r\nEntão partiram, deixando tudo para trás, rumo a grande rota, rumo ao One Piece!', 100, 100000, 3, 000038, 240, 0),
(000040, 000036, 0, 'Um importante acontecimento', 'A marinha está realizando uma transmissão importante em uma praça no centro da ilha, todas as pessoas foram até lá para ver do que se trata', 'Chegando lá pode-se ouvir vários comentários: "Como isso é possível?", "não acredito!", "Enfim um problema a menos".<br>\r\nOlhando para o telão, uma transmissão de Loguetown, você pode ver o lento caminhar daquele proclamado "Rei dos piratas" indo em direção a torre de execuções.<br>\r\nSerá que agora poderemos respirar tranquilamente sem temer os piratas que assombram os oceanos?', 'Quando ele subiu na torre o silêncio ecoou na multidão, todos acompanhavam atentamente quando de repente ouviu-se um grito:<br>\r\n-E seu tesouro? Onde está?<br>\r\nAos poucos os comentários cochichados foram aumentando até se transformarem num zumbido alto e sem controle, até que o Rei dos Piratas ergueu sua cabeça, e o que todos pesavam que seria um grande exemplo a favor da marinha, se tornou um verdadeiro caos com a suas palavras:\r\n-Meu tesouro? Vocês o querem? Eu os deixo pegar! Vão atrás dele! Deixei tudo naquele lugar!', 100, 100000, 3, 000000, 180, 0),
(000041, 000037, 0, 'A decisão', 'Antes que ele tentasse dizer mais alguma coisa, os carrascos fizeram seu trabalho', 'E ali se foi o Rei dos Piratas com um sorriso no rosto.<br>\r\nDiante daquela situação você começou a pensar no caos que se iniciaria ali, o mundo precisa de proteção, é hora de sair dessa rotina chata e fazer grandes coisas!', 'Vou entrar para marinha!', 100, 100000, 3, 000040, 180, 0),
(000042, 000038, 0, 'Indo ao quarteu da marinha', 'Cheio de empolgação, você se dirige ao quarteu da marinha para se alistar.', 'O general que estava na portaria estava mexendo com alguns papéis sentado a mesa, ele levanta a cabeça, da uma olhada em você, abaixa a cabeça sem mais entusiasmo e volta a trabalhar, mas parecendo que por obrigação pergunta:<br>\r\n-O que você quer garoto?<br>\r\n-Eu quero me alistar!<br>\r\n-Se alistar? - o general, para o que estava fazendo e agora olha para você<br>\r\n-Sim, quero servir a marinha?<br>\r\n-O que te faz pensar que isso é um trabalho simples que qualquer um pode chegar assim e querer fazer?<br>\r\n-Eu sei que é um trabalho difícil, mas eu quero me esforçar, tenho tantos amigos e familiares que deixaram esta ilha para encontrar uma vida melhor em outros lugares, e agora com esse era de piratas não consigo ficar tranquilo ao saber que eles correm perigo, quero protege-los, quero proteger a todos dos piratas!<br>', 'O general olhou esperançoso para você, deve ter pensado algo como "essa geração ainda não está totalmente perdida" ou algo parecido.<br>', 100, 100000, 3, 000041, 240, 0),
(000043, 000039, 0, 'É hora de partir', 'O general começou a procurar por um cargo para você', '-Você acha que consegue ser um marinho? Suportar todas as crises dos oceanos? Lutar até a morte pela justiça?<br>\r\n-Sim!<br>\r\nÓtimo, vamos testar sua capacidade, irei encaminhar você até a ilha de Ohara para um treinamento, passe no treino e já poderá ser um marinheiro.<br>\r\n', 'Assim você deixa tudo para trás para ir em busca de um novo sonho!<br>\r\nVocê conseguiu um bote, o general disse que era parte do teste chegar sozinho até lá, mas provavelmente foi uma desculpa pois haviam poucos marinheiros na ilha e nenhum deles podia talvez lhe levar até a próxima ilha.<br>\r\n"O que será que me espera?"', 100, 100000, 3, 000042, 240, 0),
(000044, 000055, 0, 'Chegada a ilha', 'Você está na Shells Town, você deve ir se apresentar imediatamente a um posto da marinha local. Eu escutei que o Capitão Morgan é o responsável por esta base.', 'Chegando ao Posto da marinha o Capitão Morgan, sem lhe dar muita atenção, manda você ficar de olho no prisioneiro, um bandido capturado, que está amarrado em um poste ele pede também que você extraia alguma informação de onde fica o esconderijo de seu líder.', 'Você percebe que o capitão e um homem bem imponente e estava se esforçando muito para não mostrar que estava muito incomodado com essa situação.', 250, 100000, 4, 000000, 300, 0),
(000045, 000056, 0, 'O filho do capitão', 'Caminhando para o pátio onde estava o bandido, você encontra com Helmeppo, filho do Capitão Morgan, que olha pra você com cara de desprezo e diz:', '-Não fique vagando pelos corredores, arrume algo para fazer!<br>\r\n-Estou indo vigiar o prisioneiro.<br>\r\n-Fale com respeito quando se dirigir a mim, você sabe quem é meu pai? Disse Helmeppo com um sorriso no rosto.<br>', '-Não fique ai parado, me traga algo para beber!', 250, 100000, 4, 000044, 300, 0),
(000046, 000057, 0, 'A recompensa', 'Chegando perto do prisioneiro você percebe que ele está assustado, com medo que o Capitão Morgan apareça.', 'Ao conversar com os outros marinheiros que também estavam vigiando o prisioneiro, você descobre que esses bandidos estão agindo a muito tempo e estão desafiando a autoridade do Capitão Morgan, e que a vila toda está ficando muito assustada e duvidando da capacidade dos marinheiros e do Capitão Morgan em resolver essa situação, ele até está oferecendo uma boa recompensa para o marinheiro que trazer o líder dos bandidos.', 'O seu turno de vigiar este prisioneiro acabou. Você não vê a hora de capturar esse líder dos bandidos. ', 250, 100000, 4, 000045, 300, 0),
(000047, 000058, 0, 'Entrando em confusão', 'Você decide ir atrás dos bandidos, aquela recompensa vai te ajudar muito, sem falar da fama.', 'Você começa pelo bar onde dizem que os bandidos se encontram para beber. Você entra e não percebe nenhum suspeito, então decide perguntar para o dono do bar.<br>\r\n-Você sabe alguma coisa sobre o líder dos bandidos?<br>\r\n-Bandidos? Não sei do que você está falando.<br>\r\n-Eu ouvi falar que ele vem todos os dias beber aqui.<br>\r\nDe repente, alguém interrompe sua conversa.<br>\r\n-Quem quer saber? Alguém disse no meio de um grupo que estava no fundo do salão.<br>\r\n-Vocês são os bandidos? Onde é o esconderijo de seu líder? Eu tenho que prendê-lo.<br>\r\n-Há! Há!Há! Quanta vontade de morrer! Vamos fazer um trato se me vencer te  levo até ele, caso contrario...Bom, não vai faz diferença, vou te matar mesmo!!<br>\r\n-Isso não vai demorar um minuto!!<br>\r\n-Vou pintar meu rosto com seu sangue!!!!', 'A luta foi mais rápida do que você esperava, ele saiu correndo logo em seguida, já era de se esperar que ele nao ia lhe mostrar o esconderijo do seu chefe', 250, 100000, 4, 000046, 300, 0),
(000048, 000059, 0, 'Capturando o bandido', 'Você segue o bandido até seu esconderijo, que vai ao direto encontro de seu líder. Você não encontra nenhuma resistência no caminho. Ao ver o líder dos bandidos você nota que ele é bem forte.', '-É esse o cara que te fez de tapete? Há! Há! Há! Seu incompetente ele te seguiu até aqui! Mas não faz mal, eu queria mesmo mostrar a esses marinheiros  quem é o mais forte. Você vai servir de exemplo para todos que entrarem em meu caminho.<br>\r\n\r\nVocê diz:<br>\r\n\r\n--Tá, tá! Dá pra andar logo! Eu ainda tenho que pegar a recompensa por te prender!<br>\r\n\r\nO líder dos bandidos vem pra cima de você furioso, e você logo vê que esse não vai ser tão fácil quanto aquele capanga.<br>\r\n\r\nVocê leva alguns goles, mas logo percebe que ele não controla sua força você ataca com tudo o que tem e com muito custo você vence a luta. Leve-o para o Capitão Morgan<br>\r\n\r\n\r\n', 'O Capitão Morgan, não conversa muito com você logo lhe dá a recompensa e te libera do serviço. Você nota que ele já está um pouco menos tenso com a situação da cidade.  Ao andar pela vila você vê que a reputação da marinha aumentou entre os moradores da vila.', 250, 100000, 4, 000047, 300, 0),
(000049, 000060, 0, 'Atrás de mais trabalho', 'Após sua bem sucedida captura do bandido, você está a procura de mais trabalho', 'Você não pode deixar suas tarefas de lado para sair atrás de bandidos, você entrou para marinha a pouco tempo, o que da pra fazer é usar seu horário de almoço para isso.', 'Vamos então olhar os cartazes de procurados em busca de um alvo fácil!', 200, 100000, 5, 000048, 300, 0),
(000050, 000061, 0, 'Atrás de pistas', 'Existe uma recompensa baixa para um tal de Karnk Olho de vidro, acho que esse pode ser um bom alvo.<br>\r\nVou até o ultimo lugar onde ele apareceu buscar algumas informações', 'O último incidente com ele envolvido foi um assalto a um pequeno bar dali.<br>\r\nChegando ao bar você pergunta ao homem atrás do balcão sobre o incidente.<br>\r\nEle conta como o assalto ocorreu e por onde os bandidos fugiram.', 'Disse que eles seguiram uma trilha pela floresta em direção ao sul', 200, 100000, 5, 000049, 300, 0),
(000051, 000062, 0, 'A cabana abandonada', 'Seguindo pela floresta naquela direção indicada, você encontra uma cabana abandonada e resolve investigar', 'Era uma cabana de madeira e estava vazia por dentro, tinha algumas tábuas jogadas pelo canto da sala principal, você segue em direção a sala dos fundos quando de repente escuta um barullho.', 'Mais que depressa, você recua dois passos, o suficiente para escapar de uma rede que iria cair bem em cima de você', 200, 100000, 5, 000050, 300, 0),
(000052, 000063, 0, 'Esperando na cabana', 'Isso é sinal de que a cabana não é totalmente abandonada', 'Você então se escondeu e resolveu esperar até que algo acontecesse', '-Só espero que aconteça algo antes que termine meu horário de almoço...', 200, 100000, 5, 000051, 300, 0),
(000053, 000064, 0, 'Capturando o bandido', 'E de fato aconteceu!', 'O procurado Karnk chegou sozinho até a cabana e enquanto verificava o que aconteceu com a rede que ele havia colocado, você chegou por trás dele e acertou-lhe um golpe certeiro com sua espada.', 'O mais difícil foi carregar aquele cara enorme para base da marinha.<br>\r\n-Não devia ter derrubado ele, se ele fosse andando seria mais fácil...', 200, 100000, 5, 000052, 300, 0),
(000054, 000065, 0, 'Promoção', 'Você chega a base da marinha com o bandido capturado, e o capitão vem lhe cumprimentar', 'Você está no lugar errado garoto, não consigo tomar conta de um garoto imprudente como você!<br>\r\nVou lhe transferir para Orange Town', 'Aquele era o jeito do capitão Morgan dizer:<br>\r\n-Meus parabéns! você foi promovido!', 200, 100000, 5, 000053, 300, 0),
(000055, 000044, 1, 'Chegada confusa', 'Muito bem, chegamos em Shells Town, agora vamos explorar a ilha e comprar suprimentos.', 'Andando pelas ruas você nota uma mulher muito bonita chorando e correndo em sua direção, ao se aproximar ela diz pra você tomar muito cuidado por que tem um lobo à solta. Você sorri e diz:<br>\r\n-Pra qual lado ele foi!!!<br>\r\nA mulher muito surpresa aponta uma direção e corre gritando:<br>\r\n-Se você quer morrer então vá para aquele lado! ', 'Sem demora, você corre na direção apontada e depois de avançar alguns metros, nota que uma confusão em uma lanchonete acabou de acontecer.', 250, 100000, 4, 000000, 300, 0),
(000056, 000045, 1, 'Mais confusão', 'Você vê uma menina com uma vassoura na mão e pergunta a ela onde estava o lobo.', '-Os marinheiros prenderam o Zoro eles o lev... Você a interrompe dizendo:<br>\r\n-Não, cadê o lobo?<br>\r\n-Ele fugiu correndo depois que Zoro acertou ele com uma cadeira.<br>\r\n-Você sabe pra onde ele foi?<br>\r\n-Não!!! Mas eles lavaram Zor...<br>\r\n-Tenho que achar ele!! Você sai correndo antes de escutar o que a menina tem a dizer.', 'Você sai da lanchonete muito decepcionado e muito obstinado a enfrentar o lobo.', 250, 100000, 4, 000055, 300, 0),
(000057, 000046, 1, 'Recuperar o colar', 'Ao sair da lanchonete você encontra com Ririka mãe de Rika, a menina que estava com a vassoura na mão, ela parece estar bem triste.', '-Você viu pra onde foi o lobo? Você pergunta.<br>\r\n-Você fala do Inugata?<br>\r\n-Quem? Não o lobo.<br>\r\n-Esse é o nome do lobo. Helmeppo é filho do Capitão Morgan e por isso ele abusa de seu poder. Ele solta aquele lobo na cidade e condena qualquer que entre em seu caminho. Rika quase foi pega pelo Inugata, Helmeppo ficou muito bravo e queria leva-la, mas ele a deixou ficar com a condição de eu entregar um colar de família que estava usando.  Agora aquele lobo está usando meu colar como coleira, mas eu não me importo, desde que Rika fique salva.<br>\r\n-Não se preocupe eu vou enfrentar<br> aquele lobo e recuperar seu colar. Você sabe para qual lado ele foi?<br>\r\n-A casa do lobo fica perto do posto da Marinha. Tome cuidado!<br>', 'Então você sai em direção ao posto da Marinha, e percebe que é um lugar bem grande e vai ser um pouco difícil encontra-lo. ', 250, 100000, 4, 000056, 300, 0),
(000058, 000047, 1, 'Enfrentando Inugata', 'Você vê o rastro do lobo e o segue até encontra-lo.', 'Ao se encontrar com o Inugata (o lobo), você vê que ele está usando o colar de zika como coleira. A única forma de recuperar o colar é lutando com o lobo.', 'Você ataca o lobo com todas as forças. <br>Depois de muitas mordidas e arranhões você vence Inugata e recupera o colar de zika, que fica muito feliz e diz que vai falar de você para a ilha toda.', 250, 100000, 4, 000057, 300, 0),
(000059, 000048, 1, 'Conseguindo tripulantes', 'Agora é hora de conseguir mais tripulantes', 'Depois do incidente com o lobo, a marinha começa te procurar pela ilha, mesmo assim, você não pode sair dessa ilha sozinho, você ouviu dizer que a próxima ilha, Orange Town é bastante agitada e sofre constantes confusões.', 'Então você começa a pensar em uma forma de achar tripulantes sem ser pego pela marinha', 250, 100000, 4, 000058, 300, 0),
(000060, 000049, 1, 'Indo aos bares', 'Você segue até um bar em um beco escuro da cidade.', 'Lá você escuta conversas e mais conversas, mas ninguém parece ser bom o suficiente para ser seu companheiro', 'Até que uma briga entre dois homens lhe chama atenção', 200, 100000, 5, 000059, 300, 0),
(000061, 000050, 1, 'Encontrei meus tripulantes', 'Enquanto assistia a luta deles você perguntou ao garoto que o servia o motivo da luta', '-Ha esses dois estão sempre discutindo, e sempre por um motivo idiota, um não aceita ouvir que o outro será o melhor espadachim do mundo algum dia, da pra acreditar? Querem se tornar os melhores do mundo...<br>\r\nVocê olha bem para o jeito deles lutarem, pensa sobe o desejo dos dois e resolve chama-los para sua tripulação', '-Brigando para ver quem é melhor em um bar numa vilinha como essa? Vocês vão se mostrar bons somente no dia em que vencerem uma luta em alto mar - você gritou de maneira que todos no bar ouviram', 200, 100000, 5, 000060, 300, 0),
(000062, 000051, 1, 'Juntem-se a mim!', 'O silêncio tomou conta do local, os dois pararam a luta e foram na sua direção', '-O que você quer dizer com isso? - Perguntou um deles<br>\r\n-É, o que você quer dizer? - enfatizou o outro<br>\r\n-Eu quero que vocês se juntem a minha tripulação!<br>\r\n-HAHA, nós não seguimos ordem de ninguém meu caro.<br>\r\n-É, de ninguém meu caro<br>\r\n-Não estou me estou oferecendo para dar ordens, estou me oferecendo para ajuda-los a realizar seus sonhos.<br>\r\nOs dois se olharam por um momento, enquanto todos no bar começaram a rir, você não parava de olhar firmemente para eles.<br>\r\n-Como você pode nos provar que será capaz de ajudar?<br>\r\n-É, como pode provar?<br>\r\n-Saquem suas espadas e eu os mostrarei!', 'Os dois riram e mais que depressa sacaram as espadas, e agora a luta havia se transformado em uma batalha 2 contra 1', 200, 100000, 5, 000061, 300, 0),
(000063, 000052, 1, 'Provando meu valor', 'A batalha se iniciou, você já recuou armando sua defesa subindo em uma mesa quando os dois vieram em sua direção', 'Dois cortes verticais vindos de cima parados por sua espada, um deles recuou e lhe tentou usar a ponta da espada, você jogou a espada do outro para cima e defendeu o ataque, a espada do outro voltou outra vez para baixo, com um passo para direita você gira sutilmente o corpo esquivando da espada e agora conseguindo segurar a mão do outro homem, a espada esquivada volta em um golpe horizontal certeiro, você se abaixa girando o corpo na direção em que a espada está mirando, se aproveita e puxa a calça do outro homem para cima jogando-o sobre a mesa.<br>\r\nDois passos para trás e arma novamente sua defesa.', 'Os homens se recuperam e vem novamente para o ataque.', 200, 100000, 5, 000062, 300, 0),
(000064, 000053, 1, 'Uma luta fantástica', 'Dessa vez eles tentam te cercar', 'Um golpe do que estada na direita desviado, e então vocês começar a girar no sentido horário, o da esquerda tenta acertar e você se esquiva, mais um ataque do da direita e nada, e em uma brecha de uma ataque do da direita você segura a mão dele aponta sua espada para o seu pescoço, e usa a mão dele para apontar a espada dele para o pescoço do outro homem, que enquanto você efetuava seu movimento apontou a espada dele no seu pescoço...', 'Um empate incrível!<br>\r\nDepois dessa vocês recolhem suas espadas e você pergunta a eles:<br>\r\n-Eu sirvo para vocês?', 200, 100000, 5, 000063, 300, 0),
(000065, 000054, 1, 'O que é um homem sem sonhos?', 'Os dois pensam por alguns minutos e respondem', '-Por mais que você seja bom, nós temos receio em sair daqui, vivemos bem aqui, e queremos viver por muito mais tempo.<br>\r\nEntão você questiona:<br>\r\n-O que é um homem sem um sonho? Vale a pena viver o resto de suas vidas apenas sonhando sem mover um passo para realizar seus desejos? Venham comigo! Juntos seremos poderosos e faremos história!', 'Os dois repensam a decisão e decidem ir com você!<br>\r\nVoltaram ao porto, acertaram os preparativos e partiram, rumo a realização de seus sonhos!', 200, 100000, 5, 000064, 300, 0),
(000066, 000077, 1, 'Chegando a ilha', 'Uma forte tempestade fez com que seu navio chegasse a esta ilha e ficasse preso na costa.', 'Todos no navio ficaram agitados, pois um dos seus companheiros caiu durante a tempestade e quebrou o braço e as costelas.', 'Rapidamente eles vão para a vila, mas com um pouco de medo de não encontrar ninguem que ajude piratas.', 250, 100000, 4, 000000, 300, 0),
(000067, 000078, 1, 'Estranha recepção', 'Ao chegarem na entrada da vila,notaram que muitas pessoas olhavam para eles.', 'Pensaram que seriam expulsos, entretanto todos os moradores: crianças adultos e velhos estavam os aplaudindo.', 'Sem entender o que estava acontecendo, mas ao mesmo tempo preocupado, pediu ajuda, falando o que tinha acontecido com seu tripulante.', 250, 100000, 4, 000066, 300, 0),
(000068, 000079, 1, 'Estranho alívio', 'Os moradores com as cabeças abaixadas, falaram que para os piratas que em toda ilha só tinha um cirurgião e que morava em um lugar onde ninguém sabia onde ficava.', '-Mesmo sem um médico, talvez nossas enfermeiras podem ajudar dependendo da gravidade do problema.\r\n<br>Um pouco mais aliviado, o você dize:<br>\r\n-Sim, talvez elas consigam, mas elas estão na vila, certo?', '-Sim, todas as mulheres dessa ilha são enfermeiras e estão ao seu dispor.', 250, 100000, 4, 000067, 300, 0),
(000069, 000080, 1, 'Explicações', 'Com mais calma por seu amigo estar se recuperando, você pergunta o porque de serem tão bem recebidos tão bem na vila.', 'Uma pessoa mais velha explica que:marinheiros vinham com frequência aqui na ilha e levavam as mulheres á força por serem eficientes como enfermeiras e bonitas, e assim se tornavam marinheiras. Portanto há muitos homens na ilha que foram gravemente feridos pela marinha.', 'Mas um pirata salvou todos nós do poder dos marinheiros, além de ter tratado dos gravemente feridos usando partes de animais com o seu poder, que provavelmente é uma das Akuma No Mi.', 250, 100000, 4, 000068, 300, 0),
(000070, 000081, 1, 'Indo a procura do médico', 'Impressionado com a história e sabendo que o cirurgião que vivia na ilha era o pai do pirata que salvou a ilha, ele vai sozinho á procura do médico.', 'Com uma expressão de felicidade no rosto por saber da fruta que dava poderes, o capitão dos piratas percebe um prédio velho nas serras e acredita na possibilidade de encontrar o cirurgião ali.', 'Você vai até lá, subindo por um terreno muito ingrime e escorregadio', 250, 100000, 4, 000069, 300, 0),
(000071, 000082, 1, 'O lindo mar de serras', 'Enquanto o você subia a serra, foi percebendo o quanto a vista de lá era bonita, parecia um mar verde de serras.<br>\r\nUm pouco distraido com a vista, você escuta barulho entre algumas arvores.', 'Depois de observar atentamente, você vê um estranho homem que andava quase sem nenhuma roupa.<br>\r\nAlém disso se comportava como um verdadeiro animal, um urso para ser mais específico.', 'Essa estranha criatura já estava um pouco assustada, e ficou mais ainda quando te viu.<br>\r\nEntão, ele começou a correr, fazendo com que você o seguisse, até chegar em uma costrução que parecia ser um laboratório.', 200, 100000, 5, 000070, 300, 0),
(000072, 000083, 1, 'Trafalgar''s Lab', 'Perto do prédio, você decide entrar para procurar a estranha criatura e ver o que tinha lá dentro.', 'Já dentro do local, você percebe que o lugar é um laboratório.<br>\r\nAndando pelas bancadas do laboratório, você vê um homem em pé na frente de vidraçarias e ao lado desse homem, estava o estranho que tinha encontrado na serra.', 'O senhor que estava de jaleco, olha para você e fala:\r\n<br>-Bem vindo ao Trafalgar''s Lab, senhor pirata.', 200, 100000, 5, 000071, 300, 0);
INSERT INTO `tb_missoes` (`cod_missao`, `respectiva`, `faccao`, `nome`, `descricao`, `descricao_2`, `descricao_3`, `recompensa_xp`, `recompensa_berries`, `requisito_lvl`, `requisito_missao`, `duracao`, `img`) VALUES
(000073, 000084, 1, 'Bepo, um urso ou um humano?!', 'Se apresentando para o pirata, o senhor fala para não ter medo do estranho indivíduo,que estava ao seu lado.', 'Assim, o homem começa uma série de explicações e fala que ele é o pai de Trafalgar Law e que ajudava o filho a fazer cirurgia e experimentos.\r\nEssa criatura que você pode vê,tem um nome, Bepo! Quando o meu filho era menor, esse homem,era seu melhor amigo.\r\nMas um grave acidente deixou o corpo de Bepo nesse estado que você pode ver,com queimaduras de terceiro grau e várias cicatrizes profundas.', 'Portanto o Law que já tinha comido uma Akuma No Mi, tinha acabado de aprender um de seus poderes.<br>\r\nQue era trocar a mente das pessoas ou até a de um urso com um homem,que é o caso de Bepo!', 200, 100000, 5, 000072, 300, 0),
(000074, 000085, 1, 'O prédio gigante. ', 'Depois de uma longa conversa os dois escutam um barulho dentro do laboratório.\r\nNesse mesmo minuto o médico nota que a porta que dava até sua sala de cirurgia estava aberta.', 'O pirata curioso,pergunta o que estava acontecendo.\r\nEntão o cirurgião explica,que o laboratório está ligado á uma sala de cirurgia,que fica no nível do esgoto da cidade.<br>\r\n-Eu e meu filho Law usavamos separadamente e nos comunicávamos por um tubo que começa aqui e termina na sala de cirurgia!<br>\r\nEntretanto tem uma coisa bem estranha,_eu não me lembro de ter deixado a porta que liga os lugares aberta.', 'O capitão pirata impressionado com o tamanho do lugar foi verificar o porque do barulho e da porta aberta.', 200, 100000, 5, 000073, 300, 0),
(000075, 000086, 1, 'Uma armadilha para gaivotas!', 'Quando o capitão chega perto da porta,ele realmente vê marinheiros tentando fugir pela escadaria.', 'Podia parecer estranho eles tentarem fugir, já que estavam em maior número,mas tinham pressa para descobrir se havia informações sobre o pirata Law na antiga sala que ele usava.<br>\r\nMas o capitão que não era nada bobo,ligou atraves de um den den muchi para um de seus subordinados.br>\r\nQuando o um tripulante dele atendeu o chamado, o capitão fala para levar todos para dentro do esgoto e lá eles iriam encontrar com marinheiros e uma sala para cirurgias.', 'Então o grupo de piratas parte para o local e o capitão tambem parte,se despedindo do pai de law. Pronto!Uma armadilha estava armada.', 200, 100000, 5, 000074, 300, 0),
(000076, 000087, 1, 'Vitória rápida.', 'Felizmente os piratas fazem sua emboscada com sucesso. Assim, começa a batalha', 'Mesmo com menor número de combatentes,os piratas estavam em vantagem por ter todos os equipamentos já preparados.<br>\r\nConsequêntemente,os marinheiros tiveram que recuar por estarem perdendo a batalha.\r\nPara não se complicarem,os piratas deixam os marinheiros escaparem.<br>\r\nLogo o capitão decide sair da ilha para continuar a viagem.', 'Assim, com o seu homem já recuperado, os piratas olham a ilha pela ultima vez, só lembrando da incrível estória que souberam.', 200, 100000, 5, 000075, 300, 0),
(000077, 000066, 0, 'Chegada em Burlywood', 'Usando um objeto de navegação um marinheiro avista a ilha e fala para o comandante.', 'Já descendo na praia com seus companheiros observam uma ilha com serras bem altas em torno de uma cidade.', 'Afim de conseguirem comida, eles vão para uma pequena vila.', 250, 100000, 4, 000000, 300, 0),
(000078, 000067, 0, 'Estranha recepção', 'Quando estavam indo para a vila ouviram aplausos, que os deixaram curiosos.', 'Acabando de chegar, o comandante perguntou para um cidadão, o por que dos aplausos. O individuo com uma cara feia para os marinheiros, falou o que estava ocorrendo. Piratas tinham tinham acabado de chegar na outra entrada da vila.', 'Dito isso, os marinheiros tentaram ir para o local, mas as pessoas da vila mandaram eles sairem da ilha apontando-lhes armas', 250, 100000, 4, 000077, 300, 0),
(000079, 000068, 0, 'Vamos descobrir a qualquer custo', 'Meio inconformados, os marinheiros decidem voltar para o navio.', 'Já dentro do navio, o comandante fala que vão voltar para ilha, pois tinha visto uma coisa muito estranha e queria ver o que era.', 'Antes de saírem, outra vez o imediato do navio fala que só precisam fazer um plano para entrar na vila sem que sejam percebidos.', 250, 100000, 4, 000078, 300, 0),
(000080, 000069, 0, 'Um estranho sujeito', 'Antes de saírem,um homem surge do nada, completamente sem roupas e fazendo movimentos iguais aos de um urso.', 'Esse estranho se aproximava do navio, e quanto mais perto ele chegava, mais dava para notar como seu corpo estava queimado e cheio de cicatrizes.', 'Tentando atacar os marinheiros de um jeito muito sinistro, como se fosse realmente um urso. Mas não demorou para se assustar com um tiro e ir embora. Depois disso, você manda todos os seus homens retornarem a ilha.', 250, 100000, 4, 000079, 300, 0),
(000081, 000070, 0, 'Surge a curiosidade', 'Andando pelo esgoto, os marinheiros tentam se infiltrar na vila.', 'Eles observam algumas pessoas através dos bueiros e começam a ver que alguns cidadãos não eram normais e tinham partes do corpo que eram de animais.', 'Estava decidido. O comandante mandou um de seus subordinados descobrir o que era aquilo tudo.', 250, 100000, 4, 000080, 300, 0),
(000082, 000071, 0, 'Chegando ao estranho laboratório', 'Continuando de baixo da terra, os marinheiros se deparam com um portão de ferro meio aberto.', 'Entrando naquele lugar que parecia muito suspeito, os marinheiros se surpreenderam olhando para todas aqueles aparelhos que são comuns apenas em salas de cirurgia!\r\nHaviam soluções em uma bancada, macas, sondas, bombas de oxigênio, anestésicos, entre outros materiais indispensáveis para uma sala de cirungia.', 'Outra coisa importante que também notaram foi uma longa escada que dava para um nivel acima do solo.', 200, 100000, 5, 000081, 300, 0),
(000083, 000072, 0, 'A verdade sobre a ilha', 'Os marinheiros ouvindo vozes que vinham das escadas, foram subindo os degraus para ver o que estava havendo.', 'Antes dos marinheiros chegarem onde queriam, você olha para trás e observa que seu subordinado voltava e trazia informações sobre a ilha.<br>\r\nEntão o marinheiro foi esclarecendo as dúvidas, e foi falando que essa ilha já tinha sido dominada cruelmente pela marinha, pois já que todas as\r\nmulheres da ilha eram enfermeiras, marinheiros pegavam as moças bonitas e mais eficientes para trabalhar pela marinha a força.', 'Além disso os homens da vila tinham lutado pelas mulheres e muitos acabaram perdendo as partes do corpo.<br>\r\nEntretanto um pirata chamado Trafalgar Law, salvou expulsou a marinha e usou partes de animais para ajudar os homens, já que ele é um cirurgião.', 200, 100000, 5, 000082, 300, 0),
(000084, 000073, 0, 'Bepo, um urso ou um humano?!', 'Chegando na parte de cima da ecadaria depois de uma hora subindo as escadas escutando as vozes que vinham de tubos, os marineiros observam que tinham entrado em um laboratório.', 'Depois de perceberem que havia dois homens conversando foram esconder perto de uma janela de modo que dava para ouvir o papo dos dois. Foi assim que viram pela janela as serras que eram deslumbrantes.\r\nEntão,o comandante comentou:\r\n<br>-Agora eu sei que o esgoto da vila, está ligado com esse prédio que fica em cima de toda a ilha.<br>\r\nNão demorou muito e a atenção dos marinheiros voltaram para as explicações do homem que estava com um jaleco e um pirata que acabara de chegar.', '-Parece, que toda aquela voz vinha desse cara, mas não era nada de importante. Contudo o que ele está falando para esse pirata agora é muito interessante.<br>\r\nEsse cara é pai do pirata Trafalgar Law,eles tambem já trabalharam juntos e aqela criatura que vimos na praia,na verdade é um corpo de humano e mente de um urso e um dos piratas do Law,Bepo, tem um corpo de urso e mente de um humano!<br>\r\nEntão o Law deve ter feito uma troca de corpo com seu poder da fruta,para ajudar um cara que teve seu corpo todo destruido?!', 200, 100000, 5, 000083, 300, 0),
(000085, 000074, 0, 'Comunicação atravessando a serra.', 'Com um clima muito tenso,todos os marinheiros ficaram impressionados com o poder da Akuma No Mi de Law.', 'Ouvindo toda aquela conversa,os marinheiros também descobrem que o Trafalgar Law usava aquela sala de cirurgia em que estiveram e tambem entenderam que o tubo de voz era para que pai e filho se comunicarem.', 'Quando viram que os dois tinham percebido algo de estranho na sala começaram a voltar para sala de cirurgia!', 200, 100000, 5, 000084, 300, 0),
(000086, 000075, 0, 'Caveiras e gaivotas!', 'Descendo a escada rapidamente e com muito fôlego, os marinheiros tentam chegar ao nível inferior.', 'Quando eles avistam a entrada da sala,o comandante nota uma presença muito estranha e quando abre a porta.<br>\r\nSe depara com um grupo de piratas pronto para atacarem.<br>\r\nAssim, você são pegos em uma armadinha criada pelo capitão dos piratas que estava descendo as escadas.', 'Então, começa uma batalha feroz entre caveiras e gaivotas!', 200, 100000, 5, 000085, 300, 0),
(000087, 000076, 0, 'A derrota amarga.', 'Como não estavam preparados para a batalha com equipamentos, mesmo em maior número, o comandante decide recuar.', 'Além disso não daria para eles encontrarem alguma pista sobre o Law.<br>\r\nEntão eles só tinham uma opção,que era sair daquele local para não sofrerem perdas inúteis.', 'Mesmo com o gosto da derrota, os marinheiros partindo da ilha,tinham conseguido algumas informações importantes.', 200, 100000, 5, 000086, 300, 0),
(000088, 000099, 1, 'Terra a vista!', 'Estamos chegando em Zozu Town', 'Vocês contornaram a ilha em busca de um lugar seguro para aportar pois haviam marinheiros por toda parte.<br>\r\n-Vamos descer ali! -Disse o navegador apontando para uma praia aparentemente deserta', 'Vocês levaram o navio até lá e desceram a âncora', 250, 100000, 4, 000000, 300, 0),
(000089, 000100, 1, 'Explorando a praia', 'Vocês desembarcaram na pequena praia e foram atrás de alguma vila para comprar suprimentos para viagem', 'Alguns minutos de exploração se passaram e vocês avistaram uma pequena floresta logo a frente.<br>\r\nVocês foram em direção a floresta, e a medida que caminhavam, um pequeno barulho vindo de lá começou a encomoda-los', 'O barulho parecia uma sirene.<br>\r\nVocês continuaram andando em direção a floresta', 250, 100000, 4, 000088, 300, 0),
(000090, 000101, 1, 'Chegando na Floresta', 'A medida que vocês caminhavam, o barulho só aumentava', 'Quando vocês estavam a uns 100 metros de distância da primeira árvore, uma rede enorme que estava escondida em baixo da areia capturou vocês, em seguida a sirene parou de soar.<br>\r\n', 'Passaram-se alguns minutos, e algumas pessoas com máscaras de gás e uma roupa de plástico amarela chegou até onde vocês estavam e usou algum tipo de anestésico em vocês, vocês desmaiaram sem saber o que estava acontecendo', 250, 100000, 4, 000089, 300, 0),
(000091, 000102, 1, 'Acordando em um laboratório', 'Quando sua tripulação acordou, vocês estavam em um laboratório científico', 'Vocês estavam amarrados em macas e não conseguiam se mexer.<br>\r\nAlguns minutos se passaram e algumas pessoas entraram no laboratório, elas se vestiam como cirurgiões e traziam pinças e seringas.<br>\r\n', 'Antes que você pudesse perguntar qualquer coisa, lhe aplicaram uma injecção e o colocaram para dormir.', 250, 100000, 4, 000090, 300, 0),
(000092, 000103, 1, 'Acordando pela segunda vez', 'Quando vocês acordaram, estavam em uma cela, e havia várias pessoas com vocês.', '-Onde estamos? - Você perguntou meio zonzo terminado de acordar.<br>\r\n-Porquê vocês não fugiram da sirene? - Perguntou um senhor que também estava preso.<br>\r\n-Era para fugir daquela sirene? -Você retrucou<br>\r\n-Viu! Eu disse que não era uma boa ideia! - disse um rapaz para aquele senhor.<br>\r\n-Mas era a única maneira! -o senhor respondeu ao garoto.<br>\r\n-Da pra alguém explicar o que está acontecendo aqui? - Você gritou interrompendo a conversa', 'Então o senhor começou a contar-lhe uma história.', 250, 100000, 4, 000091, 300, 0),
(000093, 000104, 1, 'A história dos aprisionados', 'Nós estávamos vivendo normalmente nossas vidas até que eles chegaram.', 'Nós não sabemos quem eles são, eles simplesmente chegaram na ilha e nos fizeram reféns, ao ver vocês se aproximarem pela janela, soamos essa sirene com o denden mushi daquele menino.<br>\r\nEle trouxe escondido daquelas pessoas.', '-Precisamos achar uma maneira de sair daqui! - Disse vocês com um olhar de indignação', 200, 100000, 5, 000092, 300, 0),
(000094, 000105, 1, 'Escapando da prisão', 'A melhor maneira: enganar o guarda, pegar a chave e fugir.', 'Foi o que seu espadachim sugeriu... Então o mesmo rapaz foi dizendo:<br>\r\n-Mas isso é lou...<br>\r\n-Decidido então! - Você logo interrompeu.<br>\r\nEntão chamaram o guarda, e quando ele estava próximo a sela, você esticou o braço por fora e fez com que a cabeça dele batesse na grade.', 'Sem deixar que ele caísse no chão, você pegou as chaves no bolso dele a abriu a sela.', 200, 100000, 5, 000093, 300, 0),
(000095, 000106, 1, 'Saída desespera', 'Vocês abriram a sela e saíram correndo', 'Rapidamente alguns outros guardas vieram para tentar impedi-los, mas eram todos muito fracos.<br>\r\nEm pouco tempo vocês derrotaram eles e conseguiram escapar.', 'Já no lado de fora daquele laboratório, vocês ajudam as pessoas a voltarem para suas casas', 200, 100000, 5, 000094, 300, 0),
(000096, 000107, 1, 'Chegando na vila', 'A vila estava toda destruída, todas as casas queimadas e o lugar inteiro devastado', '-E agora? O que vamos fazer? - disse aquele senhor<br>\r\n-Não temos saída, vamos para cidade agora.<br>\r\n', 'Então vocês os acompanharam até a cidade pela qual eles se referiam\r\n', 200, 100000, 5, 000095, 300, 0),
(000097, 000108, 1, 'Chegando a cidade', 'Lá eles se dispersaram e agradeceram pela ajuda.', '-Vocês ficarão bem? - Você perguntou.<br>\r\n-Sim, o rei daqui é muito bondoso, ele irá nos ajudar.<br>', 'Vocês se despediram deles e foram atrás dos suprimentos para viagem', 200, 100000, 5, 000096, 300, 0),
(000098, 000109, 1, 'Partindo', 'Vocês foram ao mercado', 'Encontraram lá tudo o que precisavam: comida, bebida e remédios e então voltaram para o navio.<br>\r\nPara sua surpresa, o navio estava intacto,\r\npensaram que como agiram rápido, não deu tempo para que eles pegassem o navio.', 'Após acertarem os preparativos, vocês zarparam. Rumo a próxima ilha!', 200, 100000, 5, 000097, 300, 0),
(000099, 000088, 0, 'A chegada', 'A luz do sol estava forte quando o Navio aportou no cais, tudo foi uma grande correria, os marinheiros começavam a descarregar as mercadorias em quanto você se prepara para deixar a embarcação.', 'Você começa a andar pela ilha observando tudo ao seu redor, o movimento do comercio, arruaceiros, estabelecimentos que lhe possa futuramente utilizar, como ferraria, hospedaria, restaurante...', 'Você arruma um pouco de comida para o cozinheiro e alguns remédios para seu médico.', 250, 100000, 4, 000000, 300, 0),
(000100, 000089, 0, 'O roubo', 'Um bandido sai correndo através da feira da cidade e você vê o dono de uma das barracas de fruta gritando – LADRÃÃÃO !!!', 'Você então sai a toda velocidade e começa a perseguir o bandido', 'Você então, o alcançou! <br>\r\nVocê segura sua blusa por trás e o vira em sua direção.', 250, 100000, 4, 000099, 300, 0),
(000101, 000090, 0, 'Arrumando confusão', 'Você está surpreso!<br>\r\nO tal “bandido” é na verdade um antigo amigo que você não vê a muito tempo', 'Seu amigo olha pra você com olhar semelhante.<br>\r\nEle então lhe diz para o encontrar a meia noite no subúrbio da cidade', 'Quando você começa a dizer algo ele toma impulso pra frente e sai correndo a toda velocidade, você não faz nada .', 250, 100000, 4, 000100, 300, 0),
(000102, 000091, 0, 'Encrenca em dobro', 'As pessoas da cidade se aproximam e lhe acusam de ser cúmplice do ladrão fugitivo', 'Você nega, diz ter tentado parar o ladrão, mas que ele havia fugido', 'As  pessoas continuam desconfiadas e vão se aproximando de você para prendêlo.\r\nVocê então sai correndo no meio da multidão', 250, 100000, 4, 000101, 300, 0),
(000103, 000092, 0, 'O encontro  da meia noite', 'Você fica sem ter pra onde ir, se para a pensar como é que você foi parar naquela situação toda, você está escondido nas redondezas da ilha', 'A noite cai, a cidade se encontra praticamente vazia, uma leve neblina começa a tomar conta de tudo ao seu redor.<br>\r\nÈ meia noite, você chega de encontro ao seu antigo amigo no local combinado', 'Seu amigo se aproxima de você pelas costas, lhe pede desculpas por te colocar em toda essa confusão<br>\r\nVocê quer explicações !!<br>\r\nComeça a perguntar o que na verdade está acontecendo.<br>\r\nSeu amigo lhe explica que o rei está sendo feito refém de uma gangue de piratas, mas ninguém sabe disso.<br>\r\nEles ordenam que torture e mate as pessoas, ninguém possui mais dinheiro para nada.\r\nTodos passam fome, esse foi o por que do roubo de uma maça na feira', 250, 100000, 4, 000102, 300, 0),
(000104, 000093, 0, 'Planos', '-Você precisa me ajudar !!<br>\r\n-Precisamos derrotar esses piratas e libertar o rei, porém não vou conseguir passar pelos guardas do castelo sozinho', 'Você fica relutando em aceitar o pedido, algo muito ruim parece estar para acontecer.', 'Você e seu amigo partem para o castelo cortando caminho pela floresta', 200, 100000, 5, 000103, 300, 0),
(000105, 000094, 0, 'A primeira vista', 'Vocês já conseguem ver o castelo, é noite de lua cheia, a noite é clara com o dia para vocês.', 'Possui dois guardas tomando conta da porta principal\r\nVocê pega uma pedra no chão para destrair os guardas.', 'Você joga a pedra com força para o lado oposto de onde você está.\r\nOs guardas seguem para ver o que é .', 200, 100000, 5, 000104, 300, 0),
(000106, 000095, 0, 'A escadaria principal', 'Vocês correm em direção a portaria do castelo e entram rapidamente, antes que os guardas os vejam.', 'O castelo é enorme por dentro, com quadros, estatuas e uma escadaria gigantesca a frente', '-Vamos, eu conheço o caminho para se chegar até ele !- diz seu amigo<br>\r\n“Vocês vão em direção a enorme escada', 200, 100000, 5, 000105, 300, 0),
(000107, 000096, 0, 'A cidadela das sombras', 'Ao chegar no topo do castelo, vocês vão em direção a sala do rei.<br>\r\nA sala está muito escura e com um ar estranho', 'É chegada a hora do seu desafio !<br>\r\nO rei está em pé frente ao seu trono, e mais ao lado o líder dos piratas sentado em uma cadeira.', 'Ao te ver o pirata executa um sinal com as mãos e quase instantaneamente surgem guardas e piratas para tentar prender vocês', 200, 100000, 5, 000106, 300, 0),
(000108, 000097, 0, 'Batalha final', 'Vocês conseguem escapar do primeiro ataque e então começam uma grande batalha', 'Apesar de serem muitos eles eram bem fracos, vocês conseguem derrotar todos eles, mas o líder escapa com o rei.', 'Apressadamente vocês saem do salão e encontram o rei sendo arrastado pelo pirata, seu amigo pula em direção a eles e acerta um chute bem na cara do pirata.', 200, 100000, 5, 000107, 300, 0),
(000109, 000098, 0, 'Recomeço', 'Guardas chegam na porta da sala do rei.<br>\r\nVocês são amarrados.', 'É então que o rei desperta<br>\r\nImediatamente ele manda os guardas soltarem vocês<br>\r\n-Esses dois jovens me salvaram, dê ouro e comida para eles.', 'A paz retorna ao reino, você a seu navio e seu amigo vira um membro da guarda real.', 200, 100000, 5, 000108, 300, 0),
(000110, 000121, 1, 'Primeira vista', 'Chegando a ilha vocês desembarcaram e foram explorar o lugar', 'A ilha era pequena e tinha uma árvore gigante no centro e poucas casas', 'Seus companheiros se dispersaram pela ilha a busca de informações, comida e bebida para viagem.', 250, 100000, 4, 000000, 300, 0),
(000111, 000122, 1, 'A árvore do conhecimento', 'Aquela árvore estava chamando muita atenção, você resolveu matar a curiosidade perguntando a um morador dali.', 'Você parou um senhor não muito velho que estava caminhando com sua filha.<br>\r\n-Aquela árvore é a árvore do conhecimento, ela foi plantada aqui a mais de 5 mil anos atrás e esse vilarejo se formou ao seu redor. No interior da árvore, os maiores arqueólogos do mundo montaram uma biblioteca e estudam diversas coisas.', '-Como pode ver, não temos muitos lugares na ilha, essa é uma ilha pequena, não tem lugares turísticos para os viajantes, esta ilha é famosa pelo conhecimento que os arqueólogos daqui possuem.', 250, 100000, 4, 000110, 300, 0),
(000112, 000123, 1, 'Continuando o diálogo', 'Agora que descobriu um pouco mais sobre a ilha, você precisa de mantimentos para continuar a viagem.', '-Muito obrigado pela informação meu senhor, será que por aqui eu encontraria um mercado? preciso de comida e bebida para viagem<br>\r\n-Tem um mercado logo ali, espero que encontre o que precisa.', 'Você se despediu daquele senhor e foi até o mercado que ele havia lhe mostrado', 250, 100000, 4, 000111, 300, 0),
(000113, 000124, 1, 'O pequeno mercado', 'Aquele mercado mais parecia um bar, havia algumas pessoas sentadas em mesas bebendo, e atrás do balcão um homem gordo com uma camisa branca amarelada de poeira atendia alguns fregueses', 'Quanto mais tempo você ficava naquela ilha, mais você gostava daquele lugar, as poucas pessoas que ali viviam pareciam felizes e tranquilas.<br>\r\nVocê chegou perto do balcão e enquanto esperava o homem terminar de atender o outro freguês observava a enorme estante que estava atrás dele, ela tinha diversos tipos de massas, algumas frutas e vários ingredientes, no chão um pouco mais a esquerda, encostado na parede, havia alguns barris que pareciam cheios de vinho.', 'Então o homem terminou de atender o outro freguês e veio em sua direñção:<br>\r\n-Em que posso ajudar?', 250, 100000, 4, 000112, 300, 0),
(000114, 000125, 1, 'Quero ver a biblioteca', '-Preciso de alguns mantimentos e bebidas', '-O senhor veio ao lugar certo, apesar de ser o único mercado daqui, temos ótimos preços.<br>\r\nApós o vendedor lhe entregar tudo o que você precisava, ele tentou puxar conversa, já que não havia mais nenhum freguês aguardando seu atendimento.<br>\r\n-Você está em viagem certo?<br>\r\n-Sim, queremos chegar em Kagero.<br>\r\n-Então você é mais um que quer entrar na grande Rota?<br>\r\n-Como sabe disso?<br>\r\n-Nesses tempos esse é o sonho de todos, fique tranquilo, mas, o caminho vai ser difícil, você tem um bom navegador?<br>\r\n-Minha tripulação é boa, acho que vamos sobreviver.<br>\r\n-Hm... Acho que você deveria passar na biblioteca daqui, pode ser que encontre algo que lhe ajude lá, nossos arqueólogos são os melhores do mundo, a ajuda deles pode ser vital para vocês. ', 'Depois daquela conversa você achou que não seria uma má ideia fazer algumas perguntas aos arqueólogos dali, e então se dirigiu a biblioteca.', 250, 100000, 4, 000113, 300, 0),
(000115, 000126, 1, 'A enorme biblioteca', 'Quanto mais perto daquela árvore, maior ela me parecia.', 'Na porta da biblioteca havia um senhor de cabelo grisalho usando uma vestimenta verde com um enfeite na cabeça que parecia duas enormes folhas, você se aproximou dele e disse:<br>\r\n-Bom dia meu senhor, esta é a grande biblioteca que todos falam?<br>\r\n-Sim meu jovem, a maior biblioteca do mundo! Aqui eu e os maiores arqueólogos fazemos pesquisas sobre os mistérios desse mundo.<br>\r\n-Muito interessante! Eu estou a caminho de Kagero, pretendo entrar na Grande Rota, o dono do mercado disse que talvez o senhor poderia me ajudar em algo.<br>\r\n-Grande Rota? Tem certeza? Dizem que todos que entram lá nunca retornam.<br>\r\n-Tenho certeza, minha tripulação tem certeza, estamos vivendo em busca de um sonho, não nos preocupamos em morrer por causa dele.<br><br>\r\nAdmirado com suas palavras, o velho senhor pediu que o acompanhasse para dentro da biblioteca', 'Aquele lugar era gigantesco, parecia muito maior visto de dentro.<br>\r\nNo centro havia um escada que ligava pelo menos 2 andares acima e um andar abaixo, e ao seu redor apenas livros e mais livros.<br>\r\nSeu olhar estava perdido em meio a tantos livros até que um detalhe lhe chamou atenção: uma garotinha sentada num canto estudando...', 200, 100000, 5, 000114, 300, 0),
(000116, 000127, 1, 'A estranha garotinha', 'Ela estava tão concentrada nos estudos que nem percebeu que você estava se aproximando', 'De repente uma mão surgiu em cima da mesa e virou a página do livro que ela estava lendo, você ficou muito assustado com aquilo e começou a se afastar dela.<br>\r\n-O que foi aquilo?-Você perguntou ao senhor que estava lhe mostrando a biblioteca.<br>\r\n-Não se assuste - ele respondeu - ela não vai lhe fazer mal, essa garota apenas comeu uma akuma no mi.<br>\r\n-Akuma no mi? o que é isso?<br>\r\n-É uma fruta misteriosa que da poderes especiais para quem a come, se você conseguir alguma, ela pode ser de grande ajuda já que você vai para a grande rota.<br>\r\n-Me lembrarei disso.', 'Então o senhor lhe mostrou alguns documentos e anotações sobre o clima e acontecimentos da Grade Rota.', 200, 100000, 5, 000115, 300, 0),
(000117, 000128, 1, 'Um pouco sobre a Grande Rota', 'Uma faixa de água que corta o planeta ao meio', 'O nosso planeta possui apenas uma faixa de Terra firme, a Red Line, que atravessa o planeta de norte a sul dando uma volta através dele, perpendicularmente a essa faixa de terra, passam-se 3 faixas de água muito importantes, os 2 Calm belts(Cinturão/Faixa Calma) e a Grande Rota.<br>\r\nOs Calm Belts são infestados por Reis dos mares, é impossível atravessa-lo sem ser atacado, e como o próprio nome diz, são tão calmos que lá não passa nem vento nem corrente marítima.', 'Então a única maneira de entrar pela Grande Rota é atravessando a Reverse Montain (montanha reversa/ao contrário).<br>\r\nEssa montanha tem uma característica especial, quatro rios, um vindo de cada oceano, o East Blue, North Blue, West Blue e South Blue correm ao contrário nesta montanha, esses rios sobem a montanha e desaguam na Grande Rota', 200, 100000, 5, 000116, 300, 0),
(000118, 000129, 1, 'Rumo a Reverse Mountain', 'Se você quer entrar na Grande Rota terá que subi-la', 'Após a explicação você ja tinha informações suficientes para chegar ao seu destino, se despediu do senhor e foi em direção ao navio onde deveria encontrar sua tripulação', 'No caminho você encontrou com um de seus tripulantes:<br>\r\n-Então, descobriu alguma coisa? - Você perguntou ao tripulante<br>\r\n-Só consegui descobrir o nome da próxima ilha<br>\r\n-E qual é?\r\n-Vamos para Ilha Toroa', 200, 100000, 5, 000117, 300, 0),
(000119, 000130, 1, 'Reencontrando a tripulação', 'Chegando ao navio todos estavam a sua espera', '-Por onde andou capitão, você demorou bastante.<br>\r\n-Consegui mantimentos e informações, ajudem a colocar esses sacos a bordo.', '-Quais informações você conseguiu?\r\n-Iremos subir uma montanha ao contrário para cair num oceano que é puramente caos.<br>\r\n^^', 200, 100000, 5, 000118, 300, 0),
(000120, 000131, 1, 'Partindo', 'Subir uma montanha ao contrário?', 'Sim, no caminho te explico, vamos!', 'Âncoras levantadas, tripulação preparada, é hora de partir!', 200, 100000, 5, 000119, 300, 0),
(000121, 000110, 0, 'Chegando a base da marinha', 'A ilha de Ohara parece ser pequena, foi fácil de achar a base da marinha', 'Atrás do balcão havia um marinheiro que perguntou o que você queria.<br>\r\n-Eu vim da ilha de Ilusia, trouxe essa recomendação do general de lá, quero me tornar um marinheiro!<br>\r\n-Ótimo, vou preparar seu material.', 'O marinheiro saiu da sala e pediu para você aguardar.', 250, 100000, 4, 000000, 300, 0),
(000122, 000111, 0, 'Primeira tarefa', 'O marinheiro traz um esfregão e um balde para você', '-Sua primeira tarefa é limpar o nosso quartel!<br>\r\n-O que? Eu quero virar um marinheiro, não um serviçal!<br>\r\nO marinheiro então olhou para você segurando um sorriso, e forçadamente falou:<br>\r\n-Você achou que você entraria aqui como um herói e já ia sair atrás de glória no primeiro dia? Você tem que mostrar seu valor, obedeça-nos e em breve conseguirá um cargo melhor.', 'Você se conformou e começou a limpar o chão', 250, 100000, 4, 000121, 300, 0),
(000123, 000112, 0, 'Segundo dia de trabalho', 'Os marinheiros conseguiram um quarto para você ficar, é melhor descansar bastante.', 'No segundo dia você já sabia o que fazer, tinha que obedece-los.<br>\r\n-Até quando eu irei ficar limpando as coisas? Preciso fazer algo grandioso para ser enxergado aqui', 'Os dias se passaram e nada acontecia naquela tranquila ilha', 250, 100000, 4, 000122, 300, 0),
(000124, 000113, 0, 'Rumores', 'Nos trabalhos rotineiros você ouviu rumores de que os arqueólogos da ilha estudavam algo que iria destruir o mundo.', 'Você então decidiu investigar para ver o que realmente estava acontecendo.<br>\r\n', 'Pelo que pude ver esses dias, as pessoas daqui são pacíficas, não acredito que elas estejam tramando algo deste tipo.', 250, 100000, 4, 000123, 300, 0),
(000125, 000114, 0, 'Investigação', 'Você então decide investigar a biblioteca para tentar descobrir algo', 'Você entra na biblioteca fingindo está a procura de algum livro e passa algumas horas ali ouvindo conversas e investigando', 'Todo esse tempo de investigação não resultou em nada, nenhuma pista do que realmente está acontecendo', 250, 100000, 4, 000124, 300, 0),
(000126, 000115, 0, 'A chegada da CP9', 'Os marinheiros da ilha foram convocados a se apresentar ao porto para escoltar a chegada dos membros da CP9 a ilha', '-CP9? quem são eles? Você pergunta a um marinheiro veterano que te deu a notícia.<br>\r\n-Eles são como uma força especial secreta da marinha, ouvi falar que são muito fortes.', 'Você comparece ao porto para assistira a chegada dos 3 senhores de preto e da sua frota de navios', 200, 100000, 5, 000125, 300, 0),
(000127, 000116, 0, 'Ouvindo conversas', 'Após a chegada do CP9 na ilha, você ficou atento aos passos deles para tentar descobrir algo', 'Eles falavam em algo como o século perdido, informações sigilosas, Buster call, nada lhe fazia sentido, era melhor esperar para ver onde aquilo ia chegar', 'Após muita conversa entre o CP9 e os marinheiros da ilha eles resolveram agir finalmente.', 200, 100000, 5, 000126, 300, 0),
(000128, 000117, 0, 'Primeiro comando do CP9', 'As ordens foram claras, levem todos os marinheiros até a biblioteca, inclusive os recrutas', 'Então todos armaram um cerco na biblioteca, e enquanto os membros da CP9 conversavam com os arqueólogos, você tentava ouvir alguma coisa de onde estava', 'De novo nada de informações, só resta esperar', 200, 100000, 5, 000127, 300, 0),
(000129, 000118, 0, 'Queimem a biblioteca', 'Não se soube porque, mas os planos dos arqueólogos estavam lá, pediram que a queimassem.', 'Você e os outros marinheiros entraram na biblioteca e atearam fogo em tudo, aquilo não lhe parecia certo, mas você precisava fazer.', 'Após isso vocês retornaram a base da marinha', 200, 100000, 5, 000128, 300, 0),
(000130, 000119, 0, 'Evacuem os habitantes', 'Agora as ordens são para tirar as pessoas da ilha', 'Você guiou as pessoas até os barcos da marinha para tira-las dali.<br>\r\nMas que confusão! O que será que vai acontecer?', 'Antes que todos evacuassem a área, começaram os disparos de canhão, o chamado Buster Call havia sido acionado, Centenas de navios da marinha começaram a disparar sem piedade sobre a ilha, nem os que estavam nos navios da marinha escaparam.<br>\r\nVocê precisa sair daqui!', 200, 100000, 5, 000129, 300, 0),
(000131, 000120, 0, 'Destruição da ilha', 'Você alcança os membros do CP9 e se mistura entre os marinheiros que estavam com eles', 'Vocês embarcam em um navio e deixam para trás todo aquele caos e destruição, você sem entender nada, só se passava uma coisa pela sua cabeça:<br>\r\n"Espero ter feito a coisa certa..."', 'Os membros do navio percebem que você não estava com eles quando chegaram a ilha então você diz ser apenas um novato que estava em Ohara, eles permitem que você vá com eles até a próxima ilha para continuar servindo a marinha.', 200, 100000, 5, 000130, 300, 0),
(000132, 000142, 1, 'Histórias sobre a cidade', 'Você chega em Orange Town um pouco ansioso para arrumar uma nova aventura. Explorando a cidade você nota que ela está destruída em algumas regiões, como se a tivessem explodido com bombas.', 'Você pergunta a alguém alguma informação sobre a cidade. O velho dá um sorriso e diz que seu nome é Boodle e que era o prefeito da cidade. Você pergunta o que aconteceu com a cidade, ele conta que o Pirata Buggy e sua tripulação atiraram com seus canhões sobre a cidade.<br>\r\n-E porque está sorrindo? Você pergunta. <br>Ele responde contando a história da cidade, que Orange Town é uma cidade muito antiga e que os moradores mesmo construíram e vê-los unidos reconstruindo tudo lhe trás boas lembranças de seu passado.', 'Depois de ouvir algumas histórias sobre a cidade, o Prefeito Boodle diz que está um pouco preocupado e pede sua ajuda.', 350, 100000, 6, 000000, 300, 0),
(000133, 000143, 1, 'Obtendo informações', 'O prefeito diz que depois que os piratas foram embora, a cidade voltou a ter paz, mas ele ouviu rumores que havia um navio ancorado na praia e está preocupado com a segurança da cidade e de seus moradores.', 'Depois de conversar com o prefeito você vai na direção que ele disse que estava o navio, você chega e encontra alguns piratas que estavam conversando, você se aproxima furtivamente e escuta eles planejando invadir a cidade e roubar o ouro que alguém chamado Luffy deixou pra trás quando fugiu. ', 'Agora você tem que voltar e avisar o prefeito.', 350, 100000, 6, 000132, 300, 0),
(000134, 000144, 1, 'Encarando os piratas', 'O prefeito fica muito assustado, porém não pensa em recuar, ele avisa todos os moradores que estavam trabalhando, não eram muitos, mas todos eles iriam enfrenta-los com coragem. Imediatamente se preparam para a investida pirata.', 'Todos continuam a trabalhar, mas bem atentos para não serem pegos de surpresa.  Você percebe que todos parecem estar um pouco tensos com essa situação. Os piratas chegaram, é hora de defender a vila.', 'Todos continuam com suas tarefas esperando que eles demonstrem suas intensões. Eles dizem que procuram pelo prefeito que os encaram com muita coragem.', 350, 100000, 6, 000133, 300, 0),
(000135, 000145, 1, 'A chegada do cachorrinho', 'Você fica bem atento para que não machuquem o prefeito, enquanto isso os moradores vão se agrupando em volta dos piratas, que não se intimidam.', 'Os piratas logo já anunciam o assalto dizendo pra o prefeito que entregue todo o ouro, ou eles iriam destruir a cidade. O prefeito muito confiante, diz que ele gostaria de vê-los tentar e que eles iriam se defender se fosse necessário.  O pirata fica furioso e se prepara para atacar o prefeito, antes que o punho do pirata o atinja, um cachorro aparece do nada e morde a mão do pirata.', 'E a luta começa, os piratas apanham feio, e logo saem correndo.  E a medida que eles fogem mais pessoas começam a correr atrás deles.', 350, 100000, 6, 000134, 300, 0),
(000136, 000146, 1, 'O pequeno cachorrinho', 'Depois de botar os piratas para correr, só resta uma pergunta para se fazer: De quem é aquele cachorro?', 'O Prefeito Boodle conta que aquele cachorro é Shushu, seu dono morreu a um tempo de uma grave doença, e deixou uma loja de comida pet para ele. Desde então ele a protege com a própria vida porque a loja é seu tesouro. Mas a loja foi destruída quando o pirata Buggy atacou essa cidade. Estávamos a reconstruindo quando aqueles piratas nos atacaram.', 'Você fica comovido com a história de Shushu e ajuda a reconstruir a loja.', 350, 100000, 7, 000135, 300, 0),
(000137, 000147, 1, 'Constuindo a nova loja', 'Vocês começam a carregar os materiais para construir uma nova loja para os animais da cidade', 'Você e mais alguns moradores dali trabalharam duro o dia todo para carregar os materiais necessários até o local onde iriam construir a loja', 'Vocês trouxeram madeira, cimento, tijolos e várias outra coisas', 400, 100000, 7, 000136, 300, 0),
(000138, 000148, 1, 'Trabalho duro', 'Então começou o multirão para construir a loja novamente', 'As pessoas se organizavam e dividiam o trabalho enquanto o cachorrinho observava.', 'Então sentindo-se animado, o cachorrinho foi ajudar também', 400, 100000, 7, 000137, 300, 0),
(000139, 000149, 1, 'Fim do primeiro dia', 'Terminando o trabalho por hoje, vamos descansar para continuar amanha\r\n', 'Então todos se foram para suas casas e o cachorrinho ficou lá, observando a construção.<br>\r\nVocê se sentou perto dele e ficou ali por um tempo.\r\n', 'Agora já está tarde! Você precisa ir dormir.<br>\r\n', 400, 100000, 7, 000138, 300, 0),
(000140, 000150, 1, 'Conclusão do trabalho', 'O segundo dia foi bastante produtivo e vocês conseguiram construir a loja.', 'Após o exaustivo término, vocês apenas observaram o resultado enquanto Shushu balançava freneticamente o rabinho.', 'Pronto! tarefa cumprida! Agora podemos ir em direção a próxima ilha', 300, 100000, 8, 000139, 300, 0),
(000141, 000151, 1, 'Despedida', 'Todos foram até o porto ver sua partida', 'Ancora levantada, tudo preparado!', 'Rumo à próxima ilha!', 300, 100000, 8, 000140, 300, 0),
(000142, 000132, 0, 'Histórias sobre a cidade', 'Você chega em Orange Town um pouco ansioso para arrumar uma nova aventura. Explorando a cidade você nota que ela está destruída em algumas regiões, como se a tivessem explodido com bombas.', 'Você pergunta a alguém alguma informação sobre a cidade. O velho dá um sorriso e diz que seu nome é Boodle e que era o prefeito da cidade. Você pergunta o que aconteceu com a cidade, ele conta que o Pirata Buggy e sua tripulação atiraram com seus canhões sobre a cidade.<br>\r\n-E porque está sorrindo? Você pergunta. <br>Ele responde contando a história da cidade, que Orange Town é uma cidade muito antiga e que os moradores mesmo construíram e vê-los unidos reconstruindo tudo lhe trás boas lembranças de seu passado.', 'Depois de ouvir algumas histórias sobre a cidade, o Prefeito Boodle diz que está um pouco preocupado e pede sua ajuda.', 350, 100000, 6, 000000, 300, 0),
(000143, 000133, 0, 'Obtendo informações', 'O prefeito diz que depois que os piratas foram embora, a cidade voltou a ter paz, mas ele ouviu rumores que havia um navio ancorado na praia e está preocupado com a segurança da cidade e de seus moradores.', 'Depois de conversar com o prefeito você vai na direção que ele disse que estava o navio, você chega e encontra alguns piratas que estavam conversando, você se aproxima furtivamente e escuta eles planejando invadir a cidade e roubar o ouro que alguém chamado Luffy deixou pra trás quando fugiu. ', 'Agora você tem que voltar e avisar o prefeito.', 350, 100000, 6, 000142, 300, 0),
(000144, 000134, 0, 'Encarando os piratas', 'O prefeito fica muito assustado, porém não pensa em recuar, ele avisa todos os moradores que estavam trabalhando, não eram muitos, mas todos eles iriam enfrenta-los com coragem. Imediatamente se preparam para a investida pirata.', 'Todos continuam a trabalhar, mas bem atentos para não serem pegos de surpresa.  Você percebe que todos parecem estar um pouco tensos com essa situação. Os piratas chegaram, é hora de defender a vila.', 'Todos continuam com suas tarefas esperando que eles demonstrem suas intensões. Eles dizem que procuram pelo prefeito que os encaram com muita coragem.', 350, 100000, 6, 000143, 300, 0),
(000145, 000135, 0, 'A chegada do cachorrinho', 'Você fica bem atento para que não machuquem o prefeito, enquanto isso os moradores vão se agrupando em volta dos piratas, que não se intimidam.', 'Os piratas logo já anunciam o assalto dizendo pra o prefeito que entregue todo o ouro, ou eles iriam destruir a cidade. O prefeito muito confiante, diz que ele gostaria de vê-los tentar e que eles iriam se defender se fosse necessário.  O pirata fica furioso e se prepara para atacar o prefeito, antes que o punho do pirata o atinja, um cachorro aparece do nada e morde a mão do pirata.', 'E a luta começa, os piratas apanham feio, e logo saem correndo.  E a medida que eles fogem mais pessoas começam a correr atrás deles.', 350, 100000, 6, 000144, 300, 0),
(000146, 000136, 0, 'O pequeno cachorrinho', 'Depois de botar os piratas para correr, só resta uma pergunta para se fazer: De quem é aquele cachorro?', 'O Prefeito Boodle conta que aquele cachorro é Shushu, seu dono morreu a um tempo de uma grave doença, e deixou uma loja de comida pet para ele. Desde então ele a protege com a própria vida porque a loja é seu tesouro. Mas a loja foi destruída quando o pirata Buggy atacou essa cidade. Estávamos a reconstruindo quando aqueles piratas nos atacaram.', 'Você fica comovido com a história de Shushu e ajuda a reconstruir a loja.', 350, 100000, 7, 000145, 300, 0),
(000147, 000137, 0, 'Constuindo a nova loja', 'Vocês começam a carregar os materiais para construir uma nova loja para os animais da cidade', 'Você e mais alguns moradores dali trabalharam duro o dia todo para carregar os materiais necessários até o local onde iriam construir a loja', 'Vocês trouxeram madeira, cimento, tijolos e várias outra coisas', 400, 100000, 7, 000146, 300, 0),
(000148, 000138, 0, 'Trabalho duro', 'Então começou o multirão para construir a loja novamente', 'As pessoas se organizavam e dividiam o trabalho enquanto o cachorrinho observava.', 'Então sentindo-se animado, o cachorrinho foi ajudar também', 400, 100000, 7, 000147, 300, 0),
(000149, 000139, 0, 'Fim do primeiro dia', 'Terminando o trabalho por hoje, vamos descansar para continuar amanha', 'Então todos se foram para suas casas e o cachorrinho ficou lá, observando a construção.<br>\r\nVocê se sentou perto dele e ficou ali por um tempo.', 'Agora já está tarde! Você precisa ir dormir.<br>\r\n', 400, 100000, 7, 000148, 300, 0),
(000150, 000140, 0, 'Conclusão do trabalho', 'O segundo dia foi bastante produtivo e vocês conseguiram construir a loja.', 'Após o exaustivo término, vocês apenas observaram o resultado enquanto Shushu balançava freneticamente o rabinho.', 'Pronto! tarefa cumprida! Agora podemos ir em direção a próxima ilha', 300, 100000, 8, 000149, 300, 0),
(000151, 000141, 0, 'Despedida', 'Todos foram até o porto ver sua partida', 'Ancora levantada, tudo preparado!', 'Rumo à próxima ilha!', 300, 100000, 8, 000150, 300, 0),
(000152, 000162, 1, 'GoldenRod Town', 'Após uma longa viajem vindo de Burlywood Town, finalmente um dos tripulantes vê uma nova ilha.', 'Chegando perto da ilha, vocês notam que o local é sombrio e parecia deserto, mas vocês iriam deixar de embarcar por esses motivos.', 'Saindo do navio, vocês pisavam na praia de GoldenRod Town.\r\n', 350, 100000, 6, 000000, 300, 0),
(000153, 000163, 1, 'Uma floresta de mistérios.', 'Cansados pela longa viagem mas não desanimados, muitos dos homens sentem um cheiro forte de\r\nfumaça vindo da floresta sombria.', 'Direcionando sua atenção para a fumaça,os piratas percebem que havia uma clareira no topo da\r\nmontanha.Impresionados com a quantidade de fumaça que saia do lugar, o capitão decide ir até o\r\npico da montanha.', 'Já que os piratas estavam indo para dentro da floresta, eles tinham que se preparar para enfrentar\r\na mata e os animais que poderiam encontrar no caminho.', 350, 100000, 6, 000152, 300, 0),
(000154, 000164, 1, 'O lindo e aterrorizante luar.', 'No final da tarde, os piratas começavam a subir a montanha atraves da mata.', 'Ao mesmo tempo, o sol estava sumindo no horizonte e a lua começava a ficar cada vez mais brilhante.\r\nPor isso o tempo ficava mais frio e o ambiente mais tenebroso.', 'Enquanto os piratas andavam, eles tambem estavam cantando para espantar o medo.\r\nAssim todos foram caminhando com suas lamparinas até encontrarem uma clareira com muito fogo vindo de lá.', 350, 100000, 6, 000153, 300, 0),
(000155, 000165, 1, 'O alívio bem vindo.', 'Chegando ainda mais perto do local, os foras da lei percebem que há muitas sombras de pessoas se mexendo como se estivessem dançando. ', 'Portanto, os piratas que estavam em um terreno mais elevado,olham para baixo e notam que há várias pessoas dançando em circulo.<br>\r\nEra muito confortante ver que não estavam sozinhos naquela ilha sombria.', 'Os piratas só estavam achando estranho, o fato das pessoas estarem usando roupas que não pareciam serem da mesma cultura.', 350, 100000, 6, 000154, 300, 0),
(000156, 000166, 1, 'A caverna iluminada.', 'Observando aqueles movimentos empolgate, os piratas tentam fazer contato com uma das pessoas do local.', 'Aos sons dos tambores que estavam sendo tocados os piratas tentavam falar alguma coisa, mas nada funcionava.\r\njá que não conseguiam nenhuma atenção, eles decidem descer de uma altura de uns 4 metros até o lugar onde os moradores da ilha estavam.', 'Enquanto estavam descendo a musica e a dança continuaram até que houve uma explosão na fogueira.\r\n', 350, 100000, 7, 000155, 300, 0),
(000157, 000167, 1, 'O fogo teletransportador.', 'Depois daquele enorme estrondo, sairam de uma caverna muitas mulheres que carregavam tochas.\r\nEntretanto quando elas saiam da caverna, o fogo apagava e quando chegavam perto da fogueira acendia.', 'Depois de mais explosões da fogueira, os piratas espantados viam que as pessoas que estavam chegando,desaparecia misteriosamente sendo queimada pelo fogo da tocha.\r\nFoi assim até a ultima pessoa que estava com a tocha desaparecer.', 'Depois de todos aqueles momentos, parecia que o ritual estava terminado.\r\n', 400, 100000, 7, 000156, 300, 0),
(000158, 000168, 1, 'O pirata Basil Hawkins! ', 'Depois de toda aquela confusão, um velho se aproxima da tripulação pirata e começa a conversar com eles, mesmo que muitas pessoas olhavam com uma cara feia para eles.', 'O senhor se apresentou falando o seu nome e que era o real nativo e mais velho da ilha.\r\nMuito curiosos,o capitão perguntou:<br>\r\n-Real nativo?!Essas outras pessoas não são da ilha?<br>\r\nImediatamente depois da pergunta,o velho respondeu que:<br>\r\n-Sim,só minha familia e uma outra,que somos realmente nascidos aqui.<br>\r\n-As outras pessoas são de fora e o motivo por elas estarem aqui, é o poder da Akuma No Mi de um homem.', '-O nome dessa pessoa é Basil Hawkins e as pessoas que vieram para nessa ilha me falaram que ele é um pirata.\r\n', 400, 100000, 7, 000157, 300, 0),
(000159, 000169, 1, 'As pessoas e as explosões.', 'Por esse pirata ser muito famoso no North Blue,o capitão também conhecia o Hawkins.', 'Obviamente,o pirata perguntou para o senhor,porque aquilo estava acontecendo.\r\nEntão,no mesmo momento,o velho senhor começou a falar:<br>\r\nNessa ilha, haviam somente duas familias, minha e uma outra. Havia tambem um tesouro enterrado em algum lugar da ilha!<br>\r\nEntão aquele pirata apareceu, falou que não iria fazer nada com nossas familias se nós os deixasse-mos eles procurarem!\r\nJá que não nos interessava-mos pelo tesouro, fizemos o acordo.<br>\r\nMas eu e meus amigos não sabia-mos onde estava o tesouro. Portanto eles tiveram que procurar.', 'Entretanto o solo dessa ilha não é muito comum, pois contem muito gases como o metano.<br>\r\nEntão cada vez que cavavam um buraco na terra, a luz do sol ou a luz de uma lamparina fazia com que o buraco explodisse.\r\nPor isso, usava seu poder da Akuma No Mi para trazer pessoas que ficassem no seu lugar na hora da explosão!', 400, 100000, 7, 000158, 300, 0),
(000160, 000170, 1, 'A ilha com poderes', 'Toda aquela história era inacreditável, mas o capitão pirata sabia que iria encontrar esses tipos de situação. Mas o velho ainda não tinha terminado de contar, portanto todos os ouvintes estavam prestando muita atenção no que o senhor falava.', 'Continuando a contar a história, o ancião da ilha explicou o que era aquele ritual que estavam fazendo momentos atrás.<br>\r\n-Pelo fato de que Basil Hawkins estava se aproveitando das pessoas que vieram de ilhas que ele já frequentou, GoldenRod Town começou a receber muitas pessoas feridas e algumas nem conseguiam sobreviver ás explosões.<br>\r\n-Hawkins e seu bando cavaram mais de 100.000 buracos, consequentemente muitas pessoas vieram parar nessa ilha, mas não se preocupem por serem piratas, os habitantes tem tanta raiva do Basil que não sobra para os outros piratas.<br>\r\n-No fim, eles conseguiram achar o tesouro. Entretanto por ter usado tanto seu poder, acho que os canais de gases que tem nesta ilha conseguiram um pouco do poder daquele pirata.\r\n\r\n', 'Tendo isso em mente, descobrimos uma forma de mandarmos as pessoas de volta, como vocês puderam ver assim os que forem vãos pedir ajuda e resgatar os que ficaram.', 300, 100000, 8, 000159, 300, 0);
INSERT INTO `tb_missoes` (`cod_missao`, `respectiva`, `faccao`, `nome`, `descricao`, `descricao_2`, `descricao_3`, `recompensa_xp`, `recompensa_berries`, `requisito_lvl`, `requisito_missao`, `duracao`, `img`) VALUES
(000161, 000171, 1, 'Coração de pirata', 'Completamente angustiados pelas feridas dos habitantes, os piratas tentam prestar alguma ajuda para qualquer um que tenha passado por aquilo.', 'Completamente angustiados pelas feridas dos habitantes, os piratas tentam prestar alguma ajuda para qualquer um que tenha passado por aquilo.\r\nmeio:\r\nCom um sorriso no rosto, o velho fala que a melhor coisa que eles poderiam fazer pelos habitantes temporários da ilha, era levar pelo menos alguns para a próxima ilha. Além disso, o senhor explica, que se os piratas ficassem, iria prejudicar a saúde deles, já que no local que eles moram, havia um excesso de oxigênio no lugar e isso causaria danos em suas células.\r\nNão entendendo bem o motivo, já que não tinha o menor conhecimento em ciência, o pirata resolve deixar de lado a explicação, mas decide sair o mais rápido da ilha para ajudar algumas pessoas.\r\n', 'Com o navio um pouco mais cheio do que o normal, os piratas se despedem do povo que tinha ficado na ilha e seguem, rumo a novas experiências.', 300, 100000, 8, 000160, 300, 0),
(000162, 000152, 0, 'GoldenRod Town', 'Rodeado pelas águas do North Blue, um marinheiro que estava descansando em cima do mastro, avista uma ilha.', 'Bem no meio daquele vasto horizonte de águas, havia uma ilha e você para que todos fiquem prontos para o desembarque.', 'Assim, descendo na praia, vocês percebem o quanto o lugar era sombrio, e ainda parecia ser inabitável.', 350, 100000, 6, 000000, 300, 0),
(000163, 000153, 0, 'A luz da ilha e da lua.', 'Já era noite quando os marinheiros acabavam de descer na ilha. A lua cheia brilhava mais do que o normal\r\ne sons de animais faziam qualquer um ficar acordado.\r\n', 'Logo que a sensação de inquietude passou, o marinheiro que tinha avistado a ilha, chegou perto do comandante\r\ne falou para ele que conseguiu ver a ilha por causa de uma luz parecida com a de fogo, estava em cima da montanha.', 'Animado com a notícia, o comandante fala para sua tripulação:<br>\r\n-Vamos nos preparar para subir a montanha amanhã bem cedo.', 350, 100000, 6, 000162, 300, 0),
(000164, 000154, 0, 'Saindo da escuridão', 'Por mais que tentavam, os marinheiros não conseguiam dormir por causa dos barulhos de animais vindo da floresta.', 'Depois de uma noite de sono que parecia interminável, os homens um pouco sonolentos, preparam os materiais para subir a montanha.<br>\r\nJá na parte da manha os guerreiros da marinha começam a subir entrando na mata,enquanto isso,eles percebem que não era tão assustador\r\nquanto parecia.', 'Pelo fato da luz do sol estar iluminando a ilha, os marinheiros não conseguiam enxergar aquela misteriosa luz da noite passada.', 350, 100000, 6, 000163, 300, 0),
(000165, 000155, 0, 'Caminhando durante a luz. ', 'Atravessando a floresta,dava para perceber uma trilha que já estava pronta, que não daria para ver se fosse noite.', 'Por ordens do marinheiro chefe,eles começam a andar seguindo o caminho.\r\nAssim, essa trilha os levara até a entrada de uma caverna.', 'Os marinheiros estavam realmente felizes por encontrarem essa caverna durante o dia.', 350, 100000, 6, 000164, 300, 0),
(000166, 000156, 0, 'A caverna iluminada.', 'Já dentro da caverna, os marinheiros conseguiam ver as paredes e o chão graças ás velas que estavam espalhadas pela parede.', 'Muito esperto, o comandante percebe que o ar de dentro da gruta, estava realmente muito seco.\r\nNão havia nenhuma corrente de vento vindo do lado de fora e quanto mais eles entravam mais quente ficava.\r\nPor ter muita luz dentro da caverna,havia muitos insetos ao redor do fogo das velas. ', 'Por medidas de prevenção do que podia vir pela frente, os marinheiros pegam algumas velas que estavam presas na rocha e levam com eles.', 350, 100000, 7, 000165, 300, 0),
(000167, 000157, 0, 'Colonia de formigas?', 'Os marinheiros andaram até encontrarem um buraco esférico realmente grande e que parecia ser uma colonia de formigas por dentro. ', 'O lugar funcionava como uma cidade e muitas pessoas fazendo cada uma delas seu dever e se vestiam com roupas completamente diferente uma das outras.\r\nAlguns dos habitantes perceberam que os marinheiros tinham chegado.\r\nMuito animados, essas pessoas falaram que se vocês os marinheiros quisessem saber sobre a ilha,eles deveriam ir falar com o mais antigo morador da ilha.', 'Os marinheiros pedem para os moradores os levar até lá.\r\nPortanto o grupo vai ao encontro do ancião usando o outro túneo da caverna que chegava até uma fogueira enorme do lado de fora da gruta.', 400, 100000, 7, 000166, 300, 0),
(000168, 000158, 0, 'A teoria sobre as velas', 'Observando atentamente o capitão do navio da marinha percebe que logo depois de sairem da caverna as luzes das velas se apagavam.', 'Como o capitão sempre foi inteligente, ele começa a elaborar uma teoria.<br>\r\n-Pelo clima ser muito seco e quente dentro da caverna,a energia de ativação para a reação de combustão é menor para ajudar á acender uma vela.<br>\r\n-Além disso, o material da vela é altamente inflamável e dentro da caverna o nível de oxigênio era mais alto do que o normal.', 'Com uma única e solitária salva de palmas,um velho chegava por tras do comandante dizendo:<br>\r\n-Parabéns, você está absolutamente certo.', 400, 100000, 7, 000167, 300, 0),
(000169, 000159, 0, 'Papo científico.', 'O ancião fala que ficou realmente surpreso pela dedução do marinheiro e que ninhem tinha pensado naquilo tão rápido.', 'Feliz pelos elogios, mas sem perder o foco, o comandante faz uma pergunta bem interessante para o senhor.<br>\r\n-As pessoas que estão nesta ilha não vieram do mesmo lugar, certo? Pois as roupas que estão vestindo e seus sotaques não se parecem em nada!<br>\r\nMais empolgado ainda,o velho confirma tudo o que o marinheiro tinha perguntado e complementa:<br>\r\n-Você não pode notar mas já que a caverna tem muito oxigênio, os habitantes que vieram parar nessa ilha tem problemas com a saude, pelo gas atuar como radical livre e destruir suas células.', 'Contudo minha familia e mais uma outra, somos daqui mesmo.\r\nEntão adquirimos mais resistência conseguindo células do nosso corpo que pruduzissem nossa própria vitamina C e E, que são antioxidante.', 400, 100000, 7, 000168, 300, 0),
(000170, 000160, 0, 'Basil Hawkins', 'Por todas aquelas explicações, o comandante faz somente mais uma pergunta.<br>\r\n-Por que as pessoas não são do mesmo lugar?\r\n', 'Já esperando a pergunta, o velho começa a falar que: GoldenRod Town tinha um tesouro enterrado em algum lugar da ilha. Portanto um pirata apareceu na ilha um dia com o objetivo de procurar pelo tesouro, o nome dele é Basil Hawkins!<br>\r\nQuando seu bando estava cavando, o capitão que não era nem um pouco bobo, viu que tinha muito gás inflamável por baixo da terra. Então, ele usava seu poder quando os gases explodiam e assim, trazia uma pessoa totalmente aleatória de uma ilha que ele já havia visitado. O indivíduo sofria queimadura graves e podia até morrer. Depois de varias escavações fracassadas, eles tinham finalmente achado o tesouro. Entretanto, a ilha já tinha acumulado muitas pessoas.\r\n', 'Contudo, os poderes do Basil, nos trouxeram pelo menos um benefício. Já que ele estava usando esse poder perto dos gases, os canais de gases interligados da ilha ganharam um pouco do mesmo poder! Então nós fizemos um ritual que invertesse o processo e mandamos algumas pessoas de volta para pedir socorro.', 300, 100000, 8, 000169, 300, 0),
(000171, 000161, 0, 'Deixando GoldenRod Town.', 'Cheio de fúria nos olhos e com a cabeça queimando, o comandante acusa todos os piratas de serem imprestáveis para a sociedade e covardes.', 'O senhor, pela primeira vez discordava do marinheiro balançando a cabeça de forma negativa e ao mesmo tempo afirmando que nem todos os piratas se comportavam assim.\r\nEntão, o marinheiro um pouco surpreso pergunta:<br>\r\n-Como você pode fala isso?!\r\nLogo em seguida veio a resposta:<br>\r\n-Bem! Você não ficou sabendo, mas ontem à noite, uns piratas vieram aqui e ajudaram umas pessoas a sair dessa ilha. Eles partiram hoje de manhã.<br>\r\nDesesperado por ouvir aquilo, o comandante fala para que seus homens preparassem para perseguir o navio pirata.\r\n', 'Um pouco desapontado com o velho, mas ainda o respeitando, o marinheiro chefe, se despede e vai para dentro do navio. Pouco tempo depois, a embarcação da marinha começa a velejar em busca dos piratas deixando para trás GoldenRod Town.', 300, 100000, 8, 000170, 300, 0),
(000172, 000182, 1, 'Chegada', 'Sua tripulação desembarca em Karaté Island, famosa ilha de lutadores no South Blue', 'Seu objetivo é aproveitar a fama do local e aprender um pouco de karaté nesse famoso lugar.', 'A ilha inteira possui solo rochoso,  você sai no meio das pedras em busca de um dojô.', 350, 100000, 6, 000000, 300, 0),
(000173, 000183, 1, 'Dojô', 'Você localiza o dojô, e tem um primeiro contato com seu futuro mestre', '-Olá mestre, venho a procura de seus ensinamentos em artes marciais para lutar poder proteger melhor minha tripulação', '-Você possui fibra, e aqui não desperdiçamos um bom aprendiz, venha....<br>\r\nIrei lhe dar um treinamento especial!', 350, 100000, 6, 000172, 300, 0),
(000174, 000184, 1, 'Treinamento', '-Você deve se concentrar em um só ponto na sua mente, dessa forma sua precisão aumentará, você terá um corpo mais leve e relaxado e seus inimigos não esquivarão de seus ataques', '-Agilidade aumenta sua esquiva! Use essas vendas, assim ficará melhor em menos tempo.', '-Você deve ser capaz de resistir melhor a impactos, após treinar resistência.', 350, 100000, 6, 000173, 300, 0),
(000175, 000185, 1, 'Desenvoltura', 'Seu mestre lhe desafia para um combate', 'Você é derrotado facilmente, ainda não está pronto para superar seu mestre com apenas um dia de treinamento', 'Agora descanse, teremos um longo dia amanhã', 350, 100000, 6, 000174, 300, 0),
(000176, 000186, 1, 'Disciplina e ordem', 'É passada algumas semanas e você se sente um pouco mais forte', 'Seu desafio: rachar uma pedra pequena ao meio.<br>\r\nSeu mestre montou os preparativos, é hora de mostrar do que você é capaz.<br>\r\n3...<br>\r\n2...<br>\r\n1...<br>\r\nHAAAAAAA!!!!<br>\r\nUm golpe certeiro e a pedra sai pelos ares', 'Você está ficando forte !!', 350, 100000, 7, 000175, 300, 0),
(000177, 000187, 1, 'Luta', 'Uma nova luta se inicia, dessa vez com um outro discípulo de seu mestre', 'Inicia-se a batalha<br>\r\nSoco pra cá, soco pra lá, você está levando uma surra feia!<br>\r\nQuando tudo parecia perdido, uma reviravolta e...<br>', 'Consegue mais uma derrota...<br>\r\nApós algumas semanas de treino você consegue sua revanche!<br>\r\nDessa vez você lutou bem, não deu chances, conseguiu uma bela vitória.<br>\r\nSeu mestre lhe parabeniza, lhe diz que agora é hora de você voltar para o mundo e continuar seu treinamento sozinho.', 400, 100000, 7, 000176, 300, 0),
(000178, 000188, 1, 'Despedida', 'Você agradece profundamente o seu mestre, e lhe diz que irá orgulhá-lo', 'Seu mestre lhe da ultimas dicas antes de te deixar partir.<br>\r\nEle fala sobre o ataque que derrota mais rapidamente os inimigos, a defesa que reduz o dano, e até da percepção, que te deixa apto a evitar golpes certeiros.', 'Você parte de volta para seu navio, sua tripulação o aguarda a vários dias.', 400, 100000, 7, 000177, 300, 0),
(000179, 000189, 1, 'Treinando duro', 'Você começa a ensinar tudo o que aprendeu a sua tripulação', 'Vocês ainda não são muito fortes, precisam melhorar para enfrentar os maiores piratas', 'Sua tripulação começa a ficar forte', 400, 100000, 7, 000178, 300, 0),
(000180, 000190, 1, 'Lenda', 'Você encontra um antigo mapa do tesouro preso em uma estaca de madeira próximo ao local onde você treinava com sua tripulação', '-Dessa vez irei conseguir chegar, com certeza irei ! - diz você olhando firmemente aquele mapa.<br>\r\nMas não consegue parar de pensar em como aquele mapa poderia ter chagado ali', 'A muito tempo atrás foi escondido um antigo tesouro no fundo de um perigoso pedaço do oceano, diz a lenda escrita no mapa', 400, 100000, 7, 000179, 300, 0),
(000181, 000191, 1, 'Partida', 'É chegada a hora de ir', 'Sua tripulação está otimista e se sentindo mais forte após este intenso treinamento', 'Vocês partem mundo afora em busca de tesouros', 400, 100000, 7, 000180, 300, 0),
(000182, 000172, 0, 'Chegada', 'Sua tripulação desembarca em Karatê Island, famosa ilha de lutadores no south blue', 'Aproveitando a passagem pela ilha, você resolve ir aprender a arte do karatê', 'A ilha inteira possui solo rochoso, você sai no meio das pedras em busca de um dojô.', 350, 100000, 6, 000000, 300, 0),
(000183, 000173, 0, 'Dojô', 'Você localiza o dojô, e tem um primeiro contato com seu futuro mestre', '-Ó grande mestre, procuro seu ensinamento em artes marciais para poder proteger melhor minha tripulação', '-Você possui fibra, venha ....\r\nIrei lhe dar um treinamento especial !', 350, 100000, 6, 000182, 300, 0),
(000184, 000174, 0, 'Treinamento', '-Você deve se concentrar em um só ponto na sua mente, dessa forma sua precisão aumentará, você terá um corpo mais leve e relaxado e seus inimigos não esquivarão de seus ataques', '-Agilidade aumenta sua esquiva! Use essas vendas, assim ficará melhor em menos tempo.', '-Você deve ser capaz de resistir melhor a impactos, após treinar resistência.', 350, 100000, 6, 000183, 300, 0),
(000185, 000175, 0, 'Desenvoltura', 'Seu mestre lhe desafia para um combate', 'Você é derrotado facilmente, ainda não está pronto para superar seu mestre com apenas um dia de treinamento', 'Agora descanse, teremos um longo dia amanhã', 350, 100000, 6, 000184, 300, 0),
(000186, 000176, 0, 'Disciplina e ordem', 'É passada algumas semanas e você se sente um pouco mais forte', 'Seu desafio: rachar uma pedra pequena ao meio.<br>\r\nSeu mestre montou os preparativos, é hora de mostrar do que você é capaz.<br>\r\n3...<br>\r\n2...<br>\r\n1...<br>\r\nHAAAAAAA!!!!<br>\r\nUm golpe certeiro e a pedra sai pelos ares', 'Você está ficando forte !!', 350, 100000, 7, 000185, 300, 0),
(000187, 000177, 0, 'Luta', 'Uma nova luta se inicia, dessa vez com um outro discípulo de seu mestre', 'Inicia-se a batalha<br>\r\nSoco pra cá, soco pra lá, você está levando uma surra feia!<br>\r\nQuando tudo parecia perdido, uma reviravolta e...<br>', 'Consegue mais uma derrota...<br>\r\nApós algumas semanas de treino você consegue sua revanche!<br>\r\nDessa vez você lutou bem, não deu chances, conseguiu uma bela vitória.<br>\r\nSeu mestre lhe parabeniza, lhe diz que agora é hora de você voltar para o mundo e continuar seu treinamento sozinho.', 400, 100000, 7, 000186, 300, 0),
(000188, 000178, 0, 'Despedida', 'Você agradece profundamente o seu mestre, e lhe diz que irá orgulhá-lo', 'Seu mestre lhe da ultimas dicas antes de te deixar partir.<br>\r\nEle fala sobre o ataque que derrota mais rapidamente os inimigos, a defesa que reduz o dano, e até da percepção, que te deixa apto a evitar golpes certeiros.', 'Você parte de volta para seu navio, sua tripulação o aguarda a vários dias.', 400, 100000, 7, 000187, 300, 0),
(000189, 000179, 0, 'Treinando duro', 'Você começa a ensinar tudo o que aprendeu a sua tripulação', 'Vocês ainda não são muito fortes, precisam melhorar para enfrentar os maiores piratas', 'Sua tripulação começa a ficar forte', 400, 100000, 7, 000188, 300, 0),
(000190, 000180, 0, 'Lenda', 'Você parte em meio ao oceano caçando piratas', '-Dessa vez irei conseguir chegar, com certeza irei ! (diz você)', 'A muito tempo atrás seu avô era um conceituado almirante, você sonha em conseguir tal cargo', 400, 100000, 7, 000189, 300, 0),
(000191, 000181, 0, 'Partida', 'É chegada a hora de ir', 'Sua tripulação está otimista', 'Vocês partem mundo afora em busca de se tornar um marinheiro melhor.', 400, 100000, 7, 000190, 300, 0),
(000192, 000202, 1, 'Em busca de aventuras', 'A ilha possui uma aparência antiga com casas espalhadas em setores quadrados.<br>\r\nMas algo mais nessa ilha não lhe cheirava bem.', 'Já próximos ao porto estavam barcos da marinha ancorados, por isso vocês precisaram dar a volta e ancorar na costa leste.<br>\r\nAinda tinham muita comida e bebida, então sua tripulação saiu em busca de aventuras ou tesouros pela ilha.', 'Você se separam e você chegou a uma vila.', 350, 100000, 6, 000000, 300, 0),
(000193, 000203, 1, 'Batedores de carteiras', 'Os habitantes da ilha lhe olhavam com um aspecto de desprezo e medo.', 'Você caminhava olhando as mercadorias a venda quando um vulto de uma pessoa correndo passou do seu lado, você levou rapidamente a mão na o bolso, ele roubou seu mapa.<br>', 'Você começa a correr atrás daquele sujeito com medo de gritar e atrair atenção da marinha.', 350, 100000, 6, 000192, 300, 0),
(000194, 000204, 1, 'Estão a nossa procura', 'Enquanto corria um de seus tripulantes ergueu o pé e derrubou o delinquente', 'Você o alcançou e já foi tomando o mapa da mão dele, aquele mapa continha informações importantes da Grande Rota que você consegui em Ohara, não podia abrir mão dele.<br>\r\nO jovem ladrão começou a implorar pela vida dele, disse que um senhor pediu que roubasse esse mapa e que iria dar muito dinheiro a ele.<br>\r\n-Qual senhor pediu que você fizesse isso?<br>\r\n-Um senhor usando um terno preto acompanhado de 2 capangas.', 'Você deixou o ladrão fugir e alertou sua tripulação sobre o ocorrido, daqui pra frente é melhor tomar muito cuidado', 350, 100000, 6, 000193, 300, 0),
(000195, 000205, 1, 'Indo na direção da armadilha', 'Vocês decidiram se reagruparem e começarem a caminhar juntos.', 'De repente um senhor apareceu oferecendo um baú cheio de ouro para sua tripulação se você cobrasse um dono de um bar para ela.<br>\r\nApós a oferta seu imediato lhe sussurrou: <br>\r\n-Isso pode ser uma armadilha<br>\r\n-Não temos escolha não é, o dinheiro iria cair bem, vamos ver até onde isso vai chegar', 'Então vocês caminharam rumo ao bar que o senhor havia informado', 350, 100000, 6, 000194, 300, 0),
(000196, 000206, 1, 'Confirmada a armadilha', 'Vocês entraram no bar, mas ele estava vazio, então se confirmou a suspeita de que se tratava de uma armadilha', 'Em um instante o lugar foi cercado por marinheiros e três senhores de terno entraram no bar querendo conversar com vocês', 'Parece que a conversa que eles queriam não seria nada amigável', 350, 100000, 7, 000195, 300, 0),
(000197, 000207, 1, 'Falsas acusações', 'Os homens de terno pareciam bem a vontade naquele lugar, um se sentou em uma cadeira enquanto os outros dois ficaram a sua volta', '-Bom, vamos ao que interessa... - disse o homem sentado que aparentava ser o lider - Vocês vieram de Ilusia e passaram por Ohara certo?<br>\r\nVocê não tinha por que negar, afinal não há nada de errado nisso.<br>\r\n-Além de passarem por Ohara vocês tiveram contato com os arqueólogos de lá certo?<br>\r\n-A onde você quer chegar?<br>\r\n-Ao fato de que vocês são cúmplices das pessoas que tentaram destruir o mundo!', '-Do que você está falando? Não sabemos nada sobre isso! Eles não pareciam fazer nada assim...<br>\r\n-Tentando bancar o inocente...<br>\r\nPrenda-os!!!', 400, 100000, 7, 000196, 300, 0),
(000198, 000208, 1, 'Informações importantes', 'Então os marinheiros algemaram vocês e os levaram até um navio da marinha que estava ali', 'No caminho, o marinheiro que estava te levando sussurrou em seu ouvido com cuidado para que ninguém o ouvisse:<br>\r\n-Faça o que eu digo  que irei deixar vocês escaparem, eu sei que vocês não fizeram nada.<br>\r\n-Será que você poderia me explicar o que está acontecendo? - Você perguntou disfarçadamente<br>\r\n-A ilha de Ohara foi acusada de estudar asuntos proibidos e por isso foi destruida.<br>\r\n-Destruída?<br>\r\n-Fale baixo! sim, existe algo por trás do governo e eu não vou sossegar enquanto não descobrir', 'Então vocês foram levados até o navio da marinha sob custódia', 400, 100000, 7, 000197, 300, 0),
(000199, 000209, 1, 'Ajuda para fuga', 'Chegando ao navio, os marinheiros amarraram vocês separadamente e os jogaram no convés', 'Os marinheiros iam voltar para onde o os homens de terno (Ouviu alguém os chamando de CP9) estavam e então deixaram apenas uns 5 marinheiros tomando conta de vocês<br>\r\n', 'Quando os outro marinheiros deixaram o navio, o marinheiro disposto a ajudar veio em sua direção, se abaixou na sua frente e disse...', 400, 100000, 7, 000198, 300, 0),
(000200, 000210, 1, 'A fuga', '-Quando eu te soltar, você me prende, solta seus amigos e sai correndo', 'E assim foi feito, ele cortou a corda que te segurava sem que ninguém percebesse e se levantou fingindo ter tido apenas uma conversa com você.<br>\r\nQuando ele virou as costas, num único movimento você sacou uma faca, cortou a corda dos seus companheiros e capturou o marinheiro como refém, neste mesmo instante o marinheiro gritou despistada mente:<br>\r\n-Quem foi o idiota que não sabe dar um nó numa corda?<br>\r\nSeus companheiros lutaram com os marinheiros e os amarraram no convés.<br>', 'Antes que os outros voltassem vocês saíram correndo dali sem nem poder agradecer ao marinheiro.', 400, 100000, 7, 000199, 300, 0),
(000201, 000211, 1, 'Partindo sem respostas', 'Rapidamente foram para o navio, arrumaram as coisas e partiram', '-Capitão, o que será que aconteceu em Ohara?<br>\r\n-Não sei...', '-Mas pretendo descobrir...', 400, 100000, 7, 000200, 300, 0),
(000202, 000192, 0, 'Desembarcando', 'Você chega na ilha no navio do CP9 e aguarda instruções', 'O CP9 parecia ter assuntos a tratar nesta ilha. Eles desembarcaram e pediram que um grupo de marinheiros que você fazia parte tomasse conta do navio', 'O tempo passou e nada de importante aconteceu', 350, 100000, 6, 000000, 300, 0),
(000203, 000193, 0, 'Procurando os suspeitos', 'Um tempo depois um mensageiro pediu que vocês se juntassem ao CP9 que estava ao norte da ilha', 'Chegando lá, você vê o CP9 conversando com um senhor, essa conversa você conseguiu ouvir:<br>\r\n-Fique sabendo que um grupo de piratas esteve em Ohara há alguns dias, não sei se você soube o que aconteceu em Ohara, mas não posso deixar esses homens soltos por ai. - Disse o líder do CP9 ao senhor<br>\r\n-Entendido, irei espalhar discretamente pela ilha uma recompensa por eles, em breve você os terá', 'Então o líder do CP9 virou para vocês e disse:<br>\r\n-Agora suas ordens, comecem a vasculhar a ilha em busca desses homens, eles saíram de Ohara a pouco tempo, devem estar nesta ilha com certeza.', 350, 100000, 6, 000202, 300, 0),
(000204, 000194, 0, 'Acompanhando os piratas', 'Você meio incomodado com essa história toda atende as ordens e começa a rondar a ilha', 'Passando por um pequeno mercado, você vê um tumulto e vai ver do que se trata.<br>\r\nO homem que você está procurando está correndo atrás de um ladrão, tentando descobrir alguma coisa, você apenas assiste a cena', 'Até onde eu saiba, piratas matam outras pessoas que os desafiam sem piedade, mas estes deixaram esse fugir depois que ele disse que sua família estava passando fome, o que será que está acontecendo?<br>\r\nVocê acompanha os piratas mais um pouco para ver onde isso vai dar.', 350, 100000, 6, 000203, 300, 0),
(000205, 000195, 0, 'Armando a emboscada', 'Os piratas agora vão em direção a um bar abandonado', 'Você recebe ordens para ir até o mesmo bar.<br>\r\nDeve ser uma armadilha do CP9', 'Você chega escondido na porta dos fundos do bar onde os outros marinheiros estavam e aguarda suas ordens', 350, 100000, 6, 000204, 300, 0),
(000206, 000196, 0, 'Vou começar a agir', '-Entrem, rápido! - Disse um dos marinheiros', 'Os piratas estavam lá, vocês o cercaram.<br>\r\nEntão o CP9 começou a conversar com os piratas:<br>\r\n-Bom, vamos ao que interessa... - disse o homem sentado que aparentava ser o lider - Vocês vieram de Ilusia e passaram por Ohara certo?<br>\r\nO pirata confirmou<br>\r\n-Além de passarem por Ohara vocês tiveram contato com os arqueólogos de lá certo?<br>\r\n-A onde você quer chegar? - Disse o capitão dos piratas<br>\r\n-Ao fato de que vocês são cúmplices das pessoas que tentaram destruir o mundo!', '-Do que você está falando? Não sabemos nada sobre isso! Eles não pareciam fazer nada assim... - Respondeu desesperadamente o capitão pirata<br>\r\n-Tentando bancar o inocente...<br>\r\nPrenda-os!!!<br>\r\n\r\nVocê achou aquela cena muito estranha, tomou um passo a frende e prendeu o capitão dos piratas', 350, 100000, 7, 000205, 300, 0),
(000207, 000197, 0, 'Vou libertar esses piratas', 'Então vocês algemaram os piratas e os levaram até o navio da marinha', 'No caminho, você sussurrou no ouvido do capitão com cuidado para que ninguém o ouvisse:<br>\r\n-Faça o que eu digo  que irei deixar vocês escaparem, eu sei que vocês não fizeram nada.<br>\r\n-Será que você poderia me explicar o que está acontecendo? - Perguntou o pirata disfarçadamente<br>\r\n-A ilha de Ohara foi acusada de estudar asuntos proibidos e por isso foi destruida.<br>\r\n-Destruída?<br>\r\n-Fale baixo! sim, existe algo por trás do governo e eu não vou sossegar enquanto não descobrir', 'Então vocês os levara, até o navio da marinha sob custódia', 400, 100000, 7, 000206, 300, 0),
(000208, 000198, 0, 'Armando a fuga', 'Chegando ao navio, vocês os amarraram separadamente e os jogaram no convés', 'Os marinheiros iam voltar para onde o CP9 estava e então deixaram apenas uns 5 marinheiros tomando conta dos piratas. Você estava entre eles<br>\r\n', 'Quando os outro marinheiros deixaram o navio, o você foi em direção ao capitão, se abaixou na frente dele e disse...', 400, 100000, 7, 000207, 300, 0),
(000209, 000199, 0, 'A fuga', '-Quando eu te soltar, você me prende, solta seus amigos e sai correndo', 'E assim foi feito, você cortou a corda que o segurava e sem que ninguém percebesse e se levantou fingindo ter tido apenas uma conversa com ele.<br>\r\nQuando você virou as costas, num único movimento ele sacou uma faca, cortou a corda dos seus companheiros e te capturou como refém, neste mesmo instante você gritou despistada mente:<br>\r\n-Quem foi o idiota que não sabe dar um nó numa corda?<br>\r\nOs piratas lutaram com os marinheiros e os amarraram no convés.<br>', 'Antes que os outros voltassem eles saíram correndo dali sem nem poder agradecer você.', 400, 100000, 7, 000000, 300, 0),
(000210, 000200, 0, 'Explicando a confusão', 'Então vocês ficaram ali amarrados esperando que os outros voltassem', 'Quando os marinheiros chegaram, se assustaram e foram correndo desamarrar vocês.<br>\r\n-Mas o que aconteceu aqui? seus imprestáveis! Não conseguem nem vigiar um bandinho de piratas. - disse o líder do grupo de marinheiros<br>\r\nLogo atrás deles veio o CP9.<br>\r\n-O que aconteceu aqui? - disse o líder do CP9<br>\r\n-Esses inúteis marinheiros que deixaram eles escaparem - se apressou o líder do grupo de marinheiros<br>\r\n-Você! - Aponto o líder do CP9 para você - O que aconteceu aqui?<br>', '-Algum idiota fez um nó muito mal feito, um pirata se desamarrou e libertou os outros.<br>\r\nEntão um outro marinheiro comentou:<br>\r\n-Mas foi você que prendeu o capitão!<br>\r\n-Eu o algemei, não o amarrei<br>\r\nAntes que as acusações se prolongassem o líder do CP9 perdeu a paciência', 400, 100000, 7, 000209, 300, 0),
(000211, 000201, 0, 'Ordem de partida', '-Não importa o que aconteceu aqui, o que importa é que eles fugiram.', '-O marinheiro que os prendeu, lidere um grupo de marinheiros até a próxima ilha atrás deles. Você aqui! Coloque uma recompensa pela cabeça deles. Por enquanto eles são o menor dos nossos problemas, mas pode ser que eles saibam de algo, não podemos arrisca. Rápido! Trabalhando!', 'Então você e um grupo de marinheiros partiu rumo a próxima ilha tentando encontrar novamente com aqueles piratas e talvez quem sabe esclarecer algumas coisas.', 400, 100000, 7, 000210, 300, 0),
(000212, 000217, 1, 'O capitão Ussop', 'Na entrada da ilha a sua espera estava um rapaz em pé segurando uma bandeira pirata aos pés de uma encosta.', 'Você e sua tripulação desembarcam e vão em direção ao jovem rapaz, antes que vocês chegassem a metado da distância ele gritou:<br>\r\n-Parados ai piratas! Eu sou o capitão Ussop e esta ilha está sob minha proteção!', '-Capitão Ussop? Nunca ouvi falar nesse nome...', 300, 100000, 8, 000000, 1200, 0),
(000213, 000218, 1, 'Mais de 8 mil seguidores', 'O rapaz respondeu:', '-Eu não sou muito famoso mesmo, vivo apenas protegendo esta ilha, meus seguidores me chamam de rei dos atiradores!<br>\r\n-Você tem muitos seguidores capitão Ussop?<br>\r\n-Sim, mais de 8 mil seguidores!<br>\r\nEntão milhares de bandeiras piratas surgiram por entre os arbustos da anciada logo a cima cercando vocês', 'Assustados com a quantidade de seguidores vocês começaram a pensar se realmente deveriam atacar a ilha', 300, 100000, 8, 000212, 1200, 0),
(000214, 000219, 1, 'Ele aparenta ser mais bondoso...', '-Então se tiverem más intenções é melhor sair logo daqui ou não teremos piedade', '-Capitão Ussop, nós precisamos apenas de um pouco de comida para viagem, o senhor é um capitão poderoso e generoso por estar protegendo esta ilha, poderia apenas nos ajudar com a viagem?', '-Ha, se é só isso que vocês querem, eu os deixo pegar e partir<br>', 300, 100000, 9, 000213, 1200, 0),
(000215, 000220, 1, 'Não confio em vocês', 'Quando vocês começaram a andar na direção dele ele gritou:<br>\r\n-Parados ai de novo!<br>', '-Ainda não confio em vocês, Ajudantes! Venham aqui!<br>\r\nEntão 3 garotos chegaram até ele de dispondo a ajudar<br>\r\n-vão até a ilha e tragam alguns sacos de comida para esses senhores, não podemos arriscar deixar eles entrarem na ilha', 'Vocês esperaram na costa enquanto os garotinhos foram buscar a comida.', 300, 100000, 9, 000214, 1200, 0),
(000216, 000221, 1, 'Esse mundo é cheio de histórias', 'Os garotos voltaram com um saco de comida e o entregaram para vocês', 'Vocês se despediram amigávelmente do grande capitão Ussop e sairam da ilha', 'Já no navio, seu companheiro comentou:<br>\r\n-Capitão ussop? mais de 8 mil seguidores? era só o que faltava...<br>\r\nEntão vocês sairam rindo daquela história pelo caminho\r\n', 300, 100000, 9, 000215, 1200, 0),
(000217, 000212, 0, 'Observando a ilha', 'Vocês aportaram na costa da ilha e foram até a vila atras de suprimentos', 'A vila era bem pequena e tinha apenas um mercado, vocês compraram alguns itens e retornaram para o navio', 'Enquanto voltavam para o navio um garoto passou correndo e gritando e aquilo lhes chamou muita atenção', 300, 100000, 8, 000000, 1200, 0),
(000218, 000213, 0, 'O estranho garoto', '-Os piratas estao chegando!<br>\r\n-Piratas!', '-Os piratas estão chegando!<br>\r\n-Piratas!<br>\r\n-fujam para as colinas!<br>\r\n-os piratas estão chegando<br><br>\r\n\r\nAqule garoto gritava desesperadamente enquanto corria, vocês se preocupam com aquilo e vão atras do garoto atras de explicaçoes', 'O garoto corria muito rápido, não dava para alcança-lo', 300, 100000, 8, 000217, 1200, 0),
(000219, 000214, 0, 'Ainda confuso', 'Você quase o alcançou, do nada ele parou de correr, se virou e gritou:', '-É Mentira!!!<br>\r\nVirou as costas e saiu correndo novamente.\r\nDe repente as pessoas da cidade começaram a sair de suas casas com pás e enxadas na mão e foram correndo atrás do garoto\r\n', 'Você sem entender nada para um morador e pergunta o que está acontecendo', 300, 100000, 9, 000218, 1200, 0),
(000220, 000215, 0, 'A história de um mentiroso', 'O morador começa a contar a história daquele garoto', '-Ele perdeu a mãe quando era pequeno e seu pai é um pirata que o abandonou ainda menino, não sei que influências ele teve, mas agora fica pregando essas peças na gente, haa, mas hoje ele não escapa!\r\n', 'Em seguida o senhor saiu correndo atrás do garoto', 300, 100000, 9, 000219, 1200, 0),
(000221, 000216, 0, 'Reflexões', 'Você não entendeu muito bem o que estava acontecendo, mas não lhe pareceu nada errado', 'Você retornou ao navio refletindo sobre aquilo', 'Aquele garoto deve ser importante para aquela ilha, uma ilha tão pequena sem muito o que fazer fica bem divertida com um mentiroso como aquele...', 300, 100000, 9, 000220, 1200, 0),
(000222, 000227, 1, 'Frota da marinha', 'Com o navio mais carregado e com pouco vento á favor das velas, você e seus tripulantes tentam avistar a ilha que procuravam.', 'Para a sua sorte, no navio tinha uma pessoa que veio com eles da ilha anterior e que sabia como chegar a varias ilhas do North Blue. Consequentemente não foi tão difícil chegar perto, além disso, já que o passageiro já havia visitado a ilha, sabia sobre as coisas que aconteciam lá.', 'Quando o indivíduo estava prestes a falar sobre a ilha, uma bala de canhão foi atirada e quase atinge o navio. Assim você nota uma frota da marinha perto da costa com seus navios virados para o mar aberto.', 300, 100000, 8, 000000, 1200, 0),
(000223, 000228, 1, 'Os revolucionários de Dragon', 'Com todo aquele nervosismo entre os seus tripulantes por serem atacados repentinamente, vocês tentam sair da frente dos marinheiros e ir para uma costa, onde poderiam desembarcar tranquilamente.', 'Por estarem preparados, os vocês conseguem fugir da frota. Enquanto o barco velejava, o homem que estava no navio começou a contar coisas curiosas sobre a ilha, como um esconderijo de marinheiros desertores em algum lugar. Esses mesmos são chamados também como revolucionários, já que estão trabalhando junto com Monkey D Dragon.', 'Finalizando sua história, o senhor fala que em Oubliette Town há batalhas constantes entre marinheiros e revolucionários aos arredores da ilha.\r\n', 300, 100000, 8, 000222, 1200, 0),
(000224, 000229, 1, 'Eterna gratidão', 'Cuidadosos, vocês tentam achar um bom lugar para desembarcarem, pouco tempo depois, um de seus tripulante encontra encontra uma costa perfeita para descerem a âncora do navio.\r\n', 'Já que os marinheiros da frota estavam procurando por vocês, é melhor não ficar por muito tempo na ilha. No máximo até encontrarem água e comida para abastecer o estoque de suprimentos, além disso, as pessoas que haviam sido ajudadas por você, podiam seguir para a cidade sozinhas.\r\nEntretanto, todos aqueles civis estavam realmente motivados a retribuir pelo menos uma parte do favor.\r\n', 'Não é hora de recusar essa ajuda, então todos vão para um belo lugar da ilha onde há muitas árvores com frutas, riacho e alguns animais menores.', 300, 100000, 9, 000223, 1200, 0),
(000225, 000230, 1, 'O super nova que veio do North Blue', 'Finalmente, quando os foras da lei chegam ao local apropriado para conseguir suprimentos, percebe-se que o campo tinha marcas bem nítidas, como se tivesse passado por uma batalha. ', 'Contudo, a marca mais interessante era uma que estava cravada na rocha, parecia que alguma fera marcou suas garras ali.\r\nOutra coisa curiosa era um Den Den Mushi usado para gravar e reproduzir vídeos, que vocês acharam jogado no chão.\r\nObviamente, você e sua tripulação, como um bando de piratas curiosos, começaram a assistir o vídeo.\r\n', 'No final, uma descoberta curiosa e ao mesmo tempo importante, um dos maiores capitães da marinha que virou pirata Drake, já tinha sido um marinheiro nessa mesma ilha. Além disso, parece que foi naquela ilha que ele tinha desertado e se tornou o pirata que é recentemente.\r\n', 300, 100000, 9, 000224, 1200, 0),
(000226, 000231, 1, 'Despedida entre amigos', 'Todo aquele clima calmo acabou quando vocês escutaram o som de vozes. Por isso, não poderiam mais continuar no local por muito tempo.', 'Mesmo passando pouco tempo juntos, você fez muitos amigos nessa viajem e por mais que fosse ruim a despedida, era necessário.<br>\r\nVocê e seus tripulantes se despedem das pessoas que tinham encontrado em GoldenRod Town, já é hora de partir!!\r\n', 'Muio felizes por fazer novos amigos, vocês voltam para o navio e partem para novas aventuras acinosos para ver o que vão encontrar. ', 300, 100000, 9, 000225, 1200, 0),
(000227, 000222, 0, 'Procurando por Oubliette Town', 'Vocês vão em busca daquele navio pirata preocupado com as pessoas que estavam à bordo. Já que os marinheiros tinham contado através de den den muchi com a ilha que estavam querendo chegar, não foi tão difícil achar o caminho correto.', 'Observando atentamente o mar, seus tripulantes avistam a ilha e imediatamente. Você usa uma luneta para obter informações visuais do local e percebe que parece ser bem tranquilo e estranho.', 'Consequentemente, você vê que há muitos navios da marinha perto do porto, entretanto as velas e bandeiras estavam com o símbolo da marinha riscado.', 300, 100000, 8, 000000, 1200, 0),
(000228, 000223, 0, 'Presos por amigos?! ', 'Não demorou muito para os navios da "marinha" começarem a atirar balas de canhão.', 'Você, que tinha ficado perplexo por alguns instantes, manda todos os seus tripulantes assumirem seus postos, eles são muitos e vocês tem que sair antes que seu navio seja destruído. \r\nNo mar, vocês tentam escapar, mas há muitos navios inimigos que logo cercam seu navio. Esses "marinheiros" rapidamente abordam seu navio e apontam pistolas e espadas para suas cabeças.\r\n', 'Depois dessa infelicidade, vocês são jogados em uma cela suja e escura.', 300, 100000, 8, 000227, 1200, 0),
(000229, 000224, 0, 'O telefonema e as explicações', 'Completamente revoltados, vocês tentam escapar e percebem estavam em uma cela que ficava perto de um Den Den Muchi.', 'Passado algum tempo, um dos farsantes foi atender o Den Den Muchi que começou a tocar.', 'Mas finalmente, as questões se esclarecem, sabendo que os revolucionários dessa ilha faziam parceria com o bandido mais procurado de todo mundo, Monkey D Dragon.\r\n \r\n', 300, 100000, 9, 000228, 1200, 0),
(000230, 000225, 0, 'Incrível descoberta', 'Mesmo que vocês estivessem presos, já era animador saber que provavelmente haveria um acordo entre a marinha e os revolucionários para trocar prisioneiros.', 'Logo em seguida, foi confirmado o que era esperado, assim eles abrem a porta da cela e vocês começam a se levantar levantar para sair daquele inferno.\r\nQuando vocês estavam saindo, a ultima coisa que você vê dentro do prédio da prisão foi um cartaz de procurado do pirata Drake, podia ser até um cartaz de procurado, mas estava sendo tratado pelos revolucionários como uma fotografia muito importante.\r\n', 'Pensando um pouco, o você logo nota, que esse pirata foi um marinheiro dessa ilha e que foi aqui mesmo que ele virou um pirata.', 300, 100000, 9, 000229, 1200, 0),
(000231, 000226, 0, 'O acordo bem sucedido', 'Ao se encontrarem na frente da base da marinha, os revolucionários e os Marinheiros se preparam para o acordo. Os revolucionários fazem muitas exigências e a Marinha não discute.', 'Depois de vários minutos de tensão no ar, os revolucionários tomam a iniciativa e começam ir em direção ao ponto onde haverá a troca.\r\n    Os marinheiros por estarem mais perto do local, também começam a se mover, entretanto mais lentamente.\r\n    Já que todos naquela costa já haviam sido companheiros na marinha, os dois grupos honram a promessa e conseguem voltar para seus respectivos lugares com o que era quisto.\r\n', 'Para finalizar a sua estadia naquela ilha, os homens da base disponibilizam uma escolta até seu  navio. Assim, poderão seguir viagem.', 300, 100000, 9, 000230, 1200, 0),
(000232, 000237, 1, 'Ansiedade', '\r\nSeu navio aporta dessa vez em Avalien Town, cidade em que dizem os mitos, que se encontra o melhor espadachim do mundo.\r\n', 'Sua tripulação possui um fanático por espadas, seu único desejo é enfrentar a lenda.', 'Sua tripulação irá passar uns dias na cidade, seu melhor espadachim precisa sair em busca de respostas.', 300, 100000, 8, 000000, 1200, 0),
(000233, 000238, 1, 'Em busca de respostas', '-Foi então que eu sai em busca de respostas sobre a minha ambição de enfrentar um mito.<br>\r\n-Seria ele real??\r\n', 'Você vê um velho suspeito encostado em uma árvore próxima a você.', '-Meu senhor, procuro por um homem que dizem ser o melhor espadachim do mundo.<br>\r\n-Esse mito é real??\r\n', 300, 100000, 8, 000232, 1200, 0),
(000234, 000239, 1, ' É revelado a verdade', 'O velho te encara, dá um sorriso mas não diz nada.', '- Responda! Esse mito é real? Se for, eu preciso enfrenta-lo!<br>\r\nO velho responde:<br>\r\n -Jovem fariseu, o homem que procuras é meu filho, mas ele foi treinado por um espadachim chamado Mihawk este sim é o melhor espadachim do mundo, se quer se tornar o melhor, seu primeiro passo será derrotar meu filho, se assim o conseguir, vá a procura dele!<br>\r\n-Siga reto pelo caminho, passe através de uma fonte termal, após isso você verá seu local de batalha.\r\n', '-Obrigado Oji San.<br>\r\n-Irei seguir meu rumo para me tornar o melhor.<br>\r\n', 300, 100000, 9, 000233, 1200, 0),
(000235, 000240, 1, 'Conhecendo seu adversário', 'Você passa pela escada do templo, o local é grande e possui estatuas de samurais na entrada.', '\r\nDe repente, você escuta uma voz sem saber de onde ela vem:<br>\r\n- Então você encontrou o vovô em?!<br>\r\n- ...<br>\r\n- Vamos, me enfrente e mostre do que é capaz !<br>\r\nE então o rapaz aparece.\r\n', 'Você saca sua espada e começa um duelo mortal com seu adversário.', 300, 100000, 9, 000234, 1200, 0),
(000236, 000241, 1, 'Final de glória', 'Você sangra muito, pois possui cortes por todo o corpo..<br>\r\n-Com esse nível de poder você nunca irá me derrotar, muito menos o meu mestre.\r\n', 'Você se enfurece e usa seu melhor golpe em uma velocidade incrível. <br>\r\n-Fantástico! Você tem muito potencial.-diz seu oponente.<br>\r\n-Ploc, este então se ajoelha e diz, vá atrás de meu mestre e veja o real poder do melhor espadachim do mundo, você pode ser capaz de derrotá-lo se lutar com honra e vigor.<br>\r\n', 'Você se vira de costas, guarda sua espada e sai caminhando em meio de seu objetivo.<br>\r\n-OJi chan, meu rumo agora será outro ... Não sei se ficarei vivo no próximo desafio.<br>\r\n-...\r\n', 300, 100000, 9, 000235, 1200, 0),
(000237, 000232, 0, 'Ansiedade', 'Seu navio aporta dessa vez em Avalien Town,  cidade em que dizem os mitos, que se encontra o melhor espadachim do mundo.', 'Sua tripução possui um fanático por espadas, seu único desejo é enfrentar a lenda.', 'Sua tripulação irá passar uns dias na cidade, seu melhor espadachim sai em busca de uma luta.', 300, 100000, 8, 000000, 1200, 0),
(000238, 000233, 0, 'Em busca de respostas', '-Foi então que eu sai em busca de respostas sobre a minha ambição de enfrentar um mito.<br>\r\n-Seria ele real??', 'Você vê um velho suspeito encostado em uma árvore próxima a você', '-Meu senhor, procuro por um homem que dizem ser o melhor espadachim do mundo.<br>\r\n-Esse mito é real?', 300, 100000, 8, 000237, 1200, 0),
(000239, 000234, 0, 'É revelado a verdade', 'O velho te encara, dá um sorriso mas não diz nada.', '- Responda! Esse mito é real? Se for, eu preciso enfrenta-lo!<br>\r\nO velho responde:<br>\r\n -Jovem fariseu, o homem que procuras é meu filho, mas ele foi treinado por um espadachim chamado Mihawk este sim é o melhor espadachim do mundo, se quer se tornar o melhor, seu primeiro passo será derrotar meu filho, se assim o conseguir, vá a procura dele!<br>\r\n-Siga reto pelo caminho, passe através de uma fonte termal, após isso você verá seu local de batalha.\r\n', '-Obrigado Oji San, irei seguir meu rumo para me tornar o melhor', 300, 100000, 9, 000238, 1200, 0),
(000240, 000235, 0, 'Conhecendo seu adversário', 'Você passa pela escada do templo, o local é grande e possui estatuas de samurais na entrada', 'De repente, você escuta uma voz sem saber de onde ela vem:<br>\r\n- Então você encontrou o vovô em?!<br>\r\n- ...<br>\r\n- Vamos, me enfrente e mostre do que é capaz !<br>\r\nE então o rapaz aparece.', 'Você saca sua espada e começa um duelo mortal com seu adversário', 300, 100000, 9, 000239, 1200, 0),
(000241, 000236, 0, 'Final de glória', 'Você  sangra muito,pois possui cortes por todo o corpo.<br>\r\n-Com esse nível de poder você nunca irá me derrotar, muito menos o meu mestre.', 'Você se enfurece e usa seu melhor golpe em uma velocidade incrível.<br>\r\n-Fantástico! Você tem muito potencial.- diz seu oponente<br>\r\n-Ploc, este então se ajoelha e diz, vá atrás de meu mestre e veja o real poder do melhor espadachim do mundo, você pode ser capaz de derrotá-lo se lutar com honra e vigor.', 'Você se vira de costas, guarda sua espada e sai caminhando<br>\r\n-Oji chan, meu rumo agora será outro...<br> não sei se ficarei vivo após o próximo desafio', 300, 100000, 9, 000240, 1200, 0),
(000242, 000247, 1, 'Chegada tranquila', 'Sua chegada em Las Camp foi tranquila, dessa vez vocês já estavam quase sem comida.', 'Desembarcando ao leste da ilha, longe dos marinheiros, vocês foram a vila em busca de suprimentos.<br>\r\nEra uma vila pequena e bem quente, mas ainda havia muitas pessoas andando pela ilha.<br>', 'Chegando ao mercado você comprou o que precisava e retornou para o navio, sempre com a pressa para chegar na Grande Rota', 300, 100000, 8, 000000, 1200, 0),
(000243, 000248, 1, 'Encontrando o estranho amigo', 'Enquanto voltava para o navio, um de seus homens avistou um grupo da marinha rondando a vila', '-Nós nunca nos livraremos deles - Você resmungou.<br>\r\nUma olhada melhor para onde eles estavam por trás de umas caixas de verduras, você percebeu que entre eles estava o marinheiro que lhes ajudou em Torino', 'Você decide se disfarçar e chegar até ele para obter mais informações sobre o incidente em Ohara', 300, 100000, 8, 000242, 1200, 0),
(000244, 000249, 1, 'Encontrando o marinheiro', 'Você vestiu uma capa comprida que tampava o rosto e foi atrás dele.', '-Meu jovem, poderia me ajudar com essas frutas? - Disse você ao marinheiro despistando a voz<br>\r\nO marinheiro veio até você e quando ele se aproximou você levantou despistada mente o capuz da capa revelando seu rosto.<br>\r\nPor um instante o marinheiro se assustou, e em seguida disse:<br>\r\n-Agora me diga se o que eu fiz foi certo!', '-A marinha esconde muitas coisas, isso ficou claro, mas ainda preciso de detalhes sobre o incidente em Ohara - Disse você ao marinheiro.', 300, 100000, 9, 000243, 1200, 0),
(000245, 000250, 1, 'O incidente de Ohara', 'Então o marinheiro lhe contou como ele havia entrado para marinha e já nos primeiros dias, o CP9 já destruiu uma ilha baseado em suspeitas e medo de que informações escapassem', '-A ilha foi acusada de estudar conteúdos proibidos para tentar destruir o mundo, e para evitar que qualquer informação escapasse da ilha, o CP9 a destruiu. E você? O que fazia em Ohara? - Perguntou o marinheiro<br>\r\nEntao você contou sobre sua viagem e o que havia acontecido em Ohara. O marinheiro parecia mais tranquilo ao saber que não tinha feito uma má escolha.<br>\r\nAinda intrigado com aquilo, você decide seguir seu caminho, então surge-lhe uma dúvida:', '-Você parece ser um bom homem, como consegue se manter na marinha mesmo com essa situação?', 300, 100000, 9, 000244, 1200, 0),
(000246, 000251, 1, 'Entendendo motivos ', '-Pretendo Mudar esse lugar! - Respondeu o marinheiro', 'Em seguida vocês de despediram e você voltou ao barco com aquele pensamento:\r\n-Ainda existem pessoas boas neste mundo...<br>', 'Sua tripulação se preparou para partida, e vocês se foram.', 300, 100000, 9, 000245, 1200, 0),
(000247, 000242, 0, 'Iniciando a procura', 'Chegando a ilha, os marinheiros começaram a vistoria do navio como é de costume, enquanto isso você já instruiu os marinheiros para averiguarem a ilha', 'Algumas horas de procura e nenhum sinal deles', 'Você já começa a pensar na possibilidade deles já terem saído da ilha e vai a te a costa leste a procura de informações', 300, 100000, 8, 000000, 1200, 0),
(000248, 000243, 0, 'Quase sem esperanças', 'Você pergunta a alguns moradores se viram o pirata', 'As pessoas daqui são bem confusas, pelo visto os problemas deles com piratas constantemente dificulta diferenciar os piratas que eles vêem', 'Então quase sem esperanças, um senhor encapuçado pede que você o ajude com algumas verduras, e você vai ajuda-lo', 300, 100000, 8, 000247, 1200, 0),
(000249, 000244, 0, 'Encontrando o fugitivo', '-Meu jovem, poderia me ajudar com essas frutas? - Disse o senhor encapuçado<br>', 'Você foi até ele e quando ele levantou despistada mente o capuz da capa revelando seu rosto por um instante você se assustou, era o homem que você procurava, e em seguida você disse:<br>\r\n-Agora me diga se o que eu fiz foi certo!', '-A marinha esconde muitas coisas, isso ficou claro, mas ainda preciso de detalhes sobre o incidente em Ohara - Disse o pirata a você.', 300, 100000, 9, 000248, 1200, 0);
INSERT INTO `tb_missoes` (`cod_missao`, `respectiva`, `faccao`, `nome`, `descricao`, `descricao_2`, `descricao_3`, `recompensa_xp`, `recompensa_berries`, `requisito_lvl`, `requisito_missao`, `duracao`, `img`) VALUES
(000250, 000245, 0, 'Posso respirar tranquilo', 'Então você o contou como ele havia entrado para marinha e como conheceu o CP9', 'Contou também sobre o que tinha acontecido em Ohara e o motivo de terem o prendido.<br>\r\n-E você? O que fazia em Ohara? - Você perguntou ao pirata<br>\r\nEntao o pirata contou sobre sua viagem e que havia passado apenas em busca de suprimentos e Ohara, e que os arqueólogos de lá apenas falaram algumas informações sobre a Grade Rota.<br>\r\nVocê ficou mais tranquilo ao saber que não tinha feito uma má escolha.<br>\r\nEntão após um segundo de silêncio o pirata lhe faz uma pergunta:', '-Você parece ser um bom homem, como consegue se manter na marinha mesmo com essa situação?', 300, 100000, 9, 000249, 1200, 0),
(000251, 000246, 0, 'Explicando seus motivos', '-Pretendo Mudar esse lugar! - Você respondeu', 'Após se despedir do pirata, você retomou seu posto e ordenou que os marinheiros se preparassem para partir, os piratas estavam mortos!<br>\r\nUm de seus homens perguntou como você descobriu isso e quem era aquela pessoa com quem você estava conversando.<br>', '-Era um de meus informantes, tenho vários por ai. Agora vamos!<br>\r\n', 300, 100000, 9, 000250, 1200, 0),
(000252, 000257, 1, 'Baratie', 'Você navegando muito cansado e faminto, seus suprimentos estão acabando. No horizonte você vê um imenso navio que parece ter a forma de um peixe. Será uma miragem?', 'Alguém da sua tripulação diz que é Baratie, um restaurante do Mar. Ao se aproximar você percebe que é um tem a imenso peixe. Era o que você precisava! Vamos ancorar e comer!!!', 'Você entra no navio e percebe que é um restaurante comum e logo arruma um lugar para se sentar com sua tripulação.', 300, 100000, 10, 000000, 1800, 0),
(000253, 000258, 1, 'Famintos!', 'Você não vê a hora de comer, você chama o garçom que vem até você e diz:', '-Oh! Bem vindo, seu ordinário. O que vocês querem comer? Diz o cozinheiro muito feliz e sorridente. \r\n<br>-Meu nome é Patty.\r\n<br>\r\n-Bem traga qualquer coisa para mim e minha tripulação, estamos famintos!!\r\n\r\n', 'A refeição chegou vamos comer!!!! Você nunca provou nada igual, é delicioso!!', 300, 100000, 10, 000252, 1800, 0),
(000254, 000259, 1, 'O corajoso cozinheiro', 'No meio de sua refeição, uma confusão começa a acontecer, você não sabe como começou mas parecia ser bem sério.', 'A confusão parece envolver um cliente e um rapaz de terno chamado Sanji.\r\n\r\nSanji parece estar furioso depois que esse cliente insultou injustamente o chefe do navio e jogou seu prato de comida no chão.  Ele agarra o cliente pelo pescoço e diz:<br>\r\n\r\n-Não desperdice nossa comida!!! Esse é o tesouro mais importante que tem por aqui.<br>\r\n\r\n-Mexer com um cozinheiro do mar é uma boa forma de ser morto!!! Lembre-se disso.', 'Você fica muito surpreso com a atitude de Sanji e de como ele valoriza sua comida. O cliente pede desculpas e sai muito assustado.', 300, 100000, 10, 000253, 1800, 0),
(000255, 000260, 1, 'Terminando a refeição', 'Você termina sua refeição e vai conversar com Sanji para pergunta-lo por que ele foi tão severo com aquele cliente. ', 'Sanji responde que sabe o que é sentir fome e sede, e que comida é o tesouro mais importante quando se está navegando, desperdiçar sua comida é como insultá-lo. \r\n\r\n', '-Não há nada pior que deixar comida ser desperdiçada e ao mesmo tempo deixar pessoas passarem fome!', 300, 100000, 11, 000254, 1800, 0),
(000256, 000261, 1, 'Saindo', 'Você queria fica mais um pouco, mas já está na hora de partir!', 'Você se despede de Sanji que e pede a ele que lhe dê suprimentos para a viajem, Sanji abre um sorriso e diz que vai ser um prazer preparar algo pra você.', 'Vocês retornam ao barco e partem novamente', 300, 100000, 11, 000255, 1800, 0),
(000257, 000252, 0, 'Baratie', 'Você navegando muito cansado e faminto, seus suprimentos estão acabando. No horizonte você vê um imenso navio que parece ter a forma de um peixe. Será uma miragem?', 'Alguém da sua tripulação diz que é Baratie, um restaurante do Mar. Ao se aproximar você percebe que é um tem a imenso peixe. Era o que você precisava! Vamos ancorar e comer!!!', 'Você entra no navio e percebe que é um restaurante comum e logo arruma um lugar para se sentar com sua tripulação.', 300, 100000, 10, 000000, 1800, 0),
(000258, 000253, 0, 'Famintos!', 'Você não vê a hora de comer, você chama o garçom que vem até você e diz:', '-Oh! Bem vindo, seu ordinário. O que vocês querem comer? Diz o cozinheiro muito feliz e sorridente. \r\n<br>-Meu nome é Patty.\r\n<br>\r\n-Bem traga qualquer coisa para mim e minha tripulação, estamos famintos!!\r\n\r\n\r\n\r\n', 'A refeição chegou vamos comer!!!! Você nunca provou nada igual, é delicioso!!', 300, 100000, 10, 000257, 1800, 0),
(000259, 000254, 0, 'O corajoso cozinheiro', 'No meio de sua refeição, uma confusão começa a acontecer, você não sabe como começou mas parecia ser bem sério.', 'A confusão parece envolver um cliente e um rapaz de terno chamado Sanji.\r\n\r\nSanji parece estar furioso depois que esse cliente insultou injustamente o chefe do navio e jogou seu prato de comida no chão.  Ele agarra o cliente pelo pescoço e diz:<br>\r\n\r\n-Não desperdice nossa comida!!! Esse é o tesouro mais importante que tem por aqui.<br>\r\n\r\n-Mexer com um cozinheiro do mar é uma boa forma de ser morto!!! Lembre-se disso.', 'Você fica muito surpreso com a atitude de Sanji e de como ele valoriza sua comida. O cliente pede desculpas e sai muito assustado.', 300, 100000, 10, 000258, 1800, 0),
(000260, 000255, 0, 'Terminando a refeição', 'Você termina sua refeição e vai conversar com Sanji para pergunta-lo por que ele foi tão severo com aquele cliente. ', 'Sanji responde que sabe o que é sentir fome e sede, e que comida é o tesouro mais importante quando se está navegando, desperdiçar sua comida é como insultá-lo. \r\n\r\n', '-Não há nada pior que deixar comida ser desperdiçada e ao mesmo tempo deixar pessoas passarem fome!', 300, 100000, 11, 000259, 1800, 0),
(000261, 000256, 0, 'Saindo', 'Você queria fica mais um pouco, mas já está na hora de partir!', 'Você se despede de Sanji que e pede a ele que lhe dê suprimentos para a viajem, Sanji abre um sorriso e diz que vai ser um prazer preparar algo pra você.', 'Vocês retornam ao barco e partem novamente', 300, 100000, 11, 000260, 1800, 0),
(000262, 000267, 1, 'O cemitério de navios', 'Ansioso para chegar à próxima ilha você ordena a todos da tripulação que fiquem atentos para avistar alguma ilha.', 'Com o clima ficando mais estável, seus tripulantes já esperavam que houvesse uma ilha por perto. Contudo, não foi só o clima que mudava, a paisagem que era a de um oceano azul, se tornava um cemitério de navios. A medida que avançavam, o número de navios naufragados aumentava. Era realmente incrível e assustador.', 'Aquela situação era muito estranha, dava pra ver partes dos navios para fora da água. Você nunca havia visto algo parecido antes, a quantidade de navios era imensa, não era possível haver uma ilha ou nada que permitisse que pessoas vivessem por ali.<br> Pouco tempo depois, todos no barco conseguiam ver uma estranha ilha ao longe por trás da nevoa.', 300, 100000, 10, 000000, 1800, 0),
(000263, 000268, 1, 'Aqui é realmente a Vila Whitewood?', 'Quando sua tripulação desce do navio, ficam impressionados com o formato da ilha, que parece ser completamente plana.', 'Depois de explorarem a ilha, vocês percebem que não havia nenhuma vila ou civilização.\r\nMesmo que houvesse nenhuma coisa interessante lá, você e sua tripulação, por estarem muito cansados, decidem acampar na ilha, além disso, a noite já estava por vir.\r\n', 'O que o incomodava na ilha era o fato de não haver nenhuma vila e mesmo assim essa ilha se chamar Vila e não ilha Whitewood. Vocês até chegaram a pensar que estavam no lugar errado.', 300, 100000, 10, 000262, 1800, 0),
(000264, 000269, 1, 'Descanso Merecido', 'Com o céu sem estrelas, os piratas só podiam admirar o brilho da lua.', 'Vocês planejavam passar somente uma noite no local, então todos querem festejar. Um delicioso Banquete é preparado e todos se divertem até a exaustão!<br>\r\nA noite foi muito divertida, mas é hora de descansar, pois vocês vão partir assim que todos estirem acordados e descansados de manhã, além disso, não tinham motivos para ficarem na ilha.\r\n', 'Logo após seus homens terem arrumado as barracas e irem dormir, um fenômeno estranho começou...', 300, 100000, 10, 000263, 1800, 0),
(000265, 000270, 1, 'A noite dos navios fantasmas', 'Quando vocês estavam tentando dormir, um brilho estranho dificultava. Você levanta irritado e percebe alguns efeitos de luz aparecendo e desaparecendo em intervalos pequenos de tempo.', 'Você decide investigar o que estava acontecendo, e do nada surgem navios no céu, mas não eram embarcações normais, eram brilhantes e estavam voando, pareciam ser navios fantasmas.<br> Entre os navios, havia um bem conhecido chamado de Flying Dutchman.<br>\r\nDava para notar que os navios estavam vindo em direção dessa ilha.\r\n', 'De repente, vocês são rodeados por uma vila com aparência totalmente diferente.\r\n- Então essa Vila Whitewood é uma vila fantasma? (você diz espantado).\r\n', 300, 100000, 11, 000264, 1800, 0),
(000266, 000271, 1, 'Lembrança inesquecível', 'Chegando à vila, os navios fantasma param a alguns metros acima do solo e varias almas começam a sair deles.', 'Se lembrando de uma história passada de geração após geração pelos tripulantes de navios, aquelas almas eram de marinheiros, piratas ou qualquer um que morreu no mar. Assim, o Flying Dutchman e outros navios eram encarregados de guiar os espíritos. Uma História que parecia ser de criança estava acontecendo diante seus olhos.\r\n<br>\r\nSeus tripulantes tentavam sem muito sucesso fazer algum tipo de contato, mas a única coisa que podiam fazer era apreciar o momento até que o sol levasse os espíritos.', 'Vocês ficam acordados até de manhã e depois vão embora ansiosos pra saber o que mais vão encontrar em sua jornada.', 300, 100000, 11, 000265, 1800, 0),
(000267, 000262, 0, 'O cemitério de navios', 'Navegando ao lado de muitas gaivotas, você vai em direção à próxima ilha ansioso para ver o que vai encontrar.', 'Usando informação que tinham conseguido na ilha anterior, não vai ser difícil de navegar pelo caminho certo.<br>\r\nNavegando por aquelas aguas calmas, você não podia nem imaginar o que veria a seguir. De repente tudo a sua volta começa a mudar, dezenas de navios antigos destruídos aparecem presos nas águas rasas. Aquele lugar era definitivamente o famoso cemitério de navios do North Blue.\r\n', 'Aquela situação era muito estranha, podia-se ver partes dos navios para fora da água.\r\nVocê nunca havia visto algo parecido antes, a quantidade de navios era imensa, não era possível haver uma ilha ou nada que permitisse que pessoas vivessem por ali. Pouco tempo depois, todos no barco conseguiam ver uma estranha ilha ao longe por trás da nevoa.\r\n', 300, 100000, 10, 000000, 1800, 0),
(000268, 000263, 0, 'Céu sem estrelas', 'Desconfiado do que vai encontrar você dá a ordem à sua tripulação para que contornassem toda a costa antes de desembarcarem.', 'Depois de um estudo da ilha enquanto estavam navegando, você decide desembarcar para conhecer a ilha.\r\nDepois de explorar, vocês notam que não havia absolutamente nada naquela ilha. Era realmente estranho ao julgar pelo nome da ilha ”Vila Whitewood”, mas não havia vila nenhuma. Sabendo que a ilha não oferece perigo algum, você decida passar a noite no lugar, vai ser bom passar uma noite em terra firme.\r\n', 'Apesar de a ilha estar completamente vazia, o que lhe incomodava era o fato de mesmo não tendo nuvens no céu a noite era muito escura e não havia estrelas, todos os navegantes devem evitar a escuridão, ainda mais se não houver estrelas no céu para guiar.', 300, 100000, 10, 000267, 1800, 0),
(000269, 000264, 0, 'Noite agitada', 'Com todos os equipamentos necessários já preparados, vocês montam acampamento.', 'Enquanto alguns preferiam dormir em barracas, outros preferiam dormir perto da fogueira e aproveitar o ar puro. Quando vocês estavam tentando dormir, um brilho estranho dificultava. Você levanta irritado e percebe alguns efeitos de luz aparecendo e desaparecendo em intervalos pequenos de tempo.<br>\r\nVocê decide investigar o que estava acontecendo, e do nada surgem navios no céu, mas não eram embarcações normais, eram brilhantes e estavam voando, pareciam ser navios fantasmas.<br> Entre os navios, havia um bem conhecido chamado de Flying Dutchman.<br>\r\nDava para notar que os navios estavam vindo em direção dessa ilha.\r\n', 'De repente, vocês são rodeados por uma vila com aparência totalmente diferente.\r\n- Então essa Vila Whitewood é uma vila fantasma? (você diz espantado).\r\n', 300, 100000, 10, 000268, 1800, 0),
(000270, 000265, 0, 'Lembrança inesquecível', 'O luar era muito bonito e ficou ainda mais quando alguns navios começaram a aparecer do nada, voando pelo céu.', 'Através de uma luneta, você identifica um dos navios. Esse era uma lendária embarcação chamada de Flying Dutchman. Seus tripulantes espantados assistiam ao espetáculo que os navios fantasma proporcionavam.', 'Chegando à vila, os navios fantasma param a alguns metros acima do solo e varias almas começam a sair deles.', 300, 100000, 11, 000269, 1800, 0),
(000271, 000266, 0, 'Saindo de Whitewood', 'Vocês não esperavam que os navios fantasmas fossem em direção da ilha, mas foi realmente isso que tinha acontecido.', 'Todas as pessoas que já navegaram, seja pirata, marinheiro ou até civis, sabem da história que fala:\r\nAs pessoas que morrerem em alto mar vão ter seus espíritos guiados por Flying Dutchman e outros navios, até alcançar as vilas fantasmas espalhadas pelo mundo.\r\nE era exatamente isso que estava ocorrendo no lugar em que eles estavam.\r\nE vocês só conseguiam vê-los por ser uma noite completamente escura, só com o brilho dos navios e da lua.\r\nEntretanto não havia nenhum outro tipo de contato.\r\n', 'Vocês ficam acordados até de manhã e depois vão embora ansiosos pra saber o que mais vão encontrar em sua jornada.', 300, 100000, 11, 000270, 1800, 0),
(000272, 000277, 1, 'História', 'Terra a vista! Um de seus tripulantes conhece este lugar, aqui é um pequeno reino onde pássaros pré-históricos possuem moradia, a ilha é coberta por raras plantas medicinais', 'Aproveitando a oportunidade, você e o médico do navio saem a procura de plantas medicinais', 'O local tem um clima sinistro, por todos os lugares onde você passa parece haver olhos lhe observando', 300, 100000, 10, 000000, 1800, 0),
(000273, 000278, 1, 'Confusão', 'Você se sente extremamente desconfortável e desconfiado, algo parece estar lhe cercando aos poucos.', 'Você escuta um barulho semelhante ao cortar do vento vindo por trás de você.<br>\r\nVocê se vira rapidamente e vê um pássaro enorme vindo em sua direção<br>\r\nNum surto de reflexo você se abaixa apressado e desajeitadamente.', 'O pássaro passa reto por você, dá a volta e já se prepara para um novo ataque.', 300, 100000, 10, 000272, 1800, 0),
(000274, 000279, 1, 'Decisão', 'Você por um instante pensa em virar as costas e voltar para seu navio, sua vida está em sério risco.', 'Você pensa um pouco melhor e desisti da idéia, as ervas daqui podem ser muito úteis em caso de algum doente na tripulação.<br>\r\nVocê sai correndo totalmente sem rumo para o meio das montanhas que se segue por um caminho enorme pela ilha', 'Seu médico avista uma raríssima planta que poderá lhe servir muito bem!', 300, 100000, 10, 000273, 1800, 0),
(000275, 000280, 1, 'Desafio', 'Você recolhe rapidamente um rampo da planta e logo sai correndo em busca de escapatória', 'De repente, você encontra uma saída !\r\nEm sua frente existem duas montanhas altíssimas porém com uma proximidade curta entre elas.', 'O pássaro continua lhe seguindo quando de repente bata suas gigantescas asas entre as duas montanhas e cai agonizado no chão.', 300, 100000, 11, 000274, 1800, 0),
(000276, 000281, 1, 'Vitória', 'Você saca sua arma e acerta vários tiros no pássaro gigante<br>', 'Você remove suas incríveis presas com uma faca, com certeza dará uma boa arma.<br>\r\nAgora que o lugar está mais tranquilo você pode pegar mais algumas plantas.', 'È hora de retornar ao navio e levar os remédios adquiridos', 300, 100000, 11, 000275, 1800, 0),
(000277, 000272, 0, 'História', 'Terra a vista! Um de seus tripulantes conhece este lugar, aqui é um pequeno reino onde pássaros pré-históricos possuem moradia, a ilha é coberta por raras plantas medicinais', 'Aproveitando a oportunidade, você e o médico do navio saem a procura de plantas medicinais', 'O local tem um clima sinistro, por todos os lugares onde você passa parece haver olhos lhe observando', 300, 100000, 10, 000000, 1800, 0),
(000278, 000273, 0, 'Confusão', 'Você se sente extremamente desconfortável e desconfiado, algo parece estar lhe cercando aos poucos.', 'Você escuta um barulho semelhante ao cortar do vento vindo por trás de você.<br>\r\nVocê se vira rapidamente e vê um pássaro enorme vindo em sua direção<br>\r\nNum surto de reflexo você se abaixa apressado e desajeitadamente.', 'O pássaro passa reto por você, dá a volta e já se prepara para um novo ataque.', 300, 100000, 10, 000277, 1800, 0),
(000279, 000274, 0, 'Decisão', 'Você por um instante pensa em virar as costas e voltar para seu navio, sua vida está em sério risco.', 'Você pensa um pouco melhor e desisti da idéia, as ervas daqui podem ser muito úteis em caso de algum doente na tripulação.<br>\r\nVocê sai correndo totalmente sem rumo para o meio das montanhas que se segue por um caminho enorme pela ilha', 'Seu médico avista uma raríssima planta que poderá lhe servir muito bem!', 300, 100000, 10, 000278, 1800, 0),
(000280, 000275, 0, 'Desafio', 'Você recolhe rapidamente um rampo da planta e logo sai correndo em busca de escapatória', 'De repente, você encontra uma saída !\r\nEm sua frente existem duas montanhas altíssimas porém com uma proximidade curta entre elas.', 'O pássaro continua lhe seguindo quando de repente bata suas gigantescas asas entre as duas montanhas e cai agonizado no chão.', 300, 100000, 11, 000279, 1800, 0),
(000281, 000276, 0, 'Vitória', 'Você saca sua arma e acerta vários tiros no pássaro gigante<br>', 'Você remove suas incríveis presas com uma faca, com certeza dará uma boa arma.<br>\r\nAgora que o lugar está mais tranquilo você pode pegar mais algumas plantas.', 'È hora de retornar ao navio e levar os remédios adquiridos', 300, 100000, 11, 000280, 1800, 0),
(000282, 000287, 1, 'Chegando em Kima Town', '-Estamos chegando em outra ilha! - gritou o cara com a luneta', '-É Kima Town - comentou seu atirador com um ar de empolgação.<br>\r\n-Porquê esse entusiasmo todo? - você perguntou a ele <br>\r\n-Essa é a ilha onde viveu o maior atirador do mundo! Eu quero ver o lugar onde ele viveu.', 'Então vocês ancoraram e desembarcaram para explorar a ilha', 300, 100000, 10, 000000, 1800, 0),
(000283, 000288, 1, 'A ilha deserta', 'Antes que você pudesse marcar um ponto de reencontro, seu atirador saiu correndo para conhecer a ilha', 'A ilha parecia um daqueles oásis que os viajantes vêem quando estão a muito tempo viajando por desertos.<br>\r\nHaviam poucas casas, poucas pessoas e areia por toda parte.<br>\r\nEle avistou um homem e foi correndo para perto dele.<br>', '-É aqui que viveu o maior atirador do mundo? - Perguntou o atirador ao estranho senhor', 300, 100000, 10, 000282, 1800, 0),
(000284, 000289, 1, 'Sentindo subestimado', '-Qual o seu interesso no maior atirador do mundo meu jovem?', '-Eu irei supera-lo, irei me tornar o maior no lugar dele, mas por hora quero conhecer o lugar em que ele viveu e que tipo de vida ele teve.<br>\r\n-HAHA, você se tornar o melhor? Não me faça rir garoto! Duvido que você consiga acertar o número 8 daquela casa logo ali.<br>', 'A casa parecia estar a pelo menos uns 200 metros de distância do lugar onde eles estavam', 300, 100000, 10, 000283, 1800, 0),
(000285, 000290, 1, 'Desafio aceito', '-Você duvida é? Então assista!', 'O senhor se afastou alguns passos, o atirador sacou sua arma, apontou para aquele 8 distante, mirou por uns 5 segundos, acompanhou o vento e puxou o gatilho!<br>\r\nA bala subiu alguns centímetros e depois desceu formando um arco perfeito, e entrou perfeitamente no buraco de cima daquele 8 de metal.<br>\r\n-Eu disse que era para você acerta o número 8, e você o errou...<br>\r\nVocê olhou com um olhar de indignação para ele, e depois os dois começaram a rir.', '-Venha comigo, vou te mostrar o lugar.', 300, 100000, 11, 000284, 1800, 0),
(000286, 000291, 1, 'Histórias', 'O atirador o acompanhou até chegarem em uma casa de madeira velha meio abandonada', 'A madeira era escura e desgastada, havia uma cadeira de balanço quebrada no alpendre da casa, pouco a frente da porta principal.<br>\r\n-Chegamos! - resmungou o senhor - Esta é a minha casa!<br>\r\nO atirador se assustou e perguntou:\r\n-O senhor é o melhor atirador do mundo?<br>\r\n-Não não, sou apenas um velho amigo que resolveu não acompanhar os sonhos dele e decidiu ficar aqui tomando conta dessa velha casa.<br>', 'O atirador olhou a casa por mais uns 5 minutos e então ouviu um grito, estavam o chamando, ele se despediu rapidamente do senhor, agradeceu por ter te mostrado o lugar e saiu correndo rumo ao navio', 300, 100000, 11, 000285, 1800, 0),
(000287, 000282, 0, 'Vamos passar rápido por aqui', 'A ilha de Kima não possui vigilância da marinha.', 'Alguns barcos da marinha passam por aqui algumas poucas vezes, mas essa ilha não possui muito o que se fazer ou roubar, as pessoas são em sua maioria pobres que apenas vivem por suas contas', 'Nós devemos chegar em Kagero logo para podermos assumir nosso trabalho na marinha', 300, 100000, 10, 000000, 1800, 0),
(000288, 000283, 0, 'Chegando no mercado', 'Ancoraram no porto da ilha e desceram rapidamente em busca de suprimentos para viagem', 'Você foi até o mercado comprar comida, bebida e alguns remédios.', 'O mercado era pequeno mas parecia ter o que você precisava', 300, 100000, 10, 000000, 1800, 0),
(000289, 000284, 0, 'Agora faltam remédios', '-Boa tarde meu senhor, em que posso ajuda-lo? - Perguntou o dono do mercado', 'Você listou para ele o que você precisava e ele foi buscarApós algum tempo ele retornou com uma notícia:<br>\r\n-Esses remédios que o senhor pediu eu não tenho.<br>\r\n', '-O senhor sabe de algum lugar onde poderei acha-los?<br>\r\n-Tem um curandeiro na ilha perto de um pequeno lago ao norte, talvez ele tenha o que você precisa', 300, 100000, 10, 000288, 1800, 0),
(000290, 000285, 0, 'Encontrando o curandeiro', 'Você foi para onde o mercador lhe informou buscar os remédios.', 'O lugar onde o curandeiro atendia era bem iluminado com um aroma de incenso por toda parte.<br>\r\n-Boa tarde senhor, eu estou precisando destes remédios.<br>\r\nO curandeiro pegou sua lista, pegou em uma instante o que você precisava e colocou sobre uma mesa que estava no centro do balcão.', '-10 milhões de berries por tudo!', 300, 100000, 11, 000289, 1800, 0),
(000291, 000286, 0, 'Perdendo dinheiro', '-Isso é um roubo meu senhor!', 'O velho curandeiro olhou para você e disse:<br>\r\n-Sinto muito mas é o preço a se pagar para que uma tripulação grande como a sua se mantenha saudável.', 'Sem mais questionamentos e com muita insatisfação você pagou ao curandeiro<br>\r\nSaiu rapidamente daquele lugar e voltou ao navio.<br>\r\n-Vamos partir! ', 300, 100000, 11, 000290, 1800, 0),
(000292, 000297, 1, 'Esta é Cocoyashi?', 'Você chega na ilha cocoyashi, você fica assustado depois de perceber que parte da cidade está destruída.', 'Ao desembarcar na cidade você não vê uma alma viva. Você e sua tripulação se separam para procurar sobreviventes, continua a procurar até que você ouve uma garota gritando.', 'Você corre para ver o que está acontecendo e vê um homem bem grande perseguindo uma mulher. Você corre para salva-la e ao se aproximar você percebe que ele parece ser humano.', 300, 100000, 11, 000000, 3600, 0),
(000293, 000298, 1, 'Arlong?', 'Você grita ferozmente e quando ele se vira você o acerta com toda a força no rosto. Ele cai imediatamente. Enquanto ele está caído você agarra o braço da moça e corre com o objetivo de coloca-la em segurança.', 'A moça te leva até a casa dela. Ela lhe conta que Arlong invadiu esta ilha há muito tempo impondo a todos da ilha que lhe pagasse impostos altíssimos e matava todos que não pudessem pagar. Então a moça baixa a cabeça quase chorando e fala que sua mãe morreu assim.', 'Então você diz que quer ajudar a deter Arlong, mas ela diz para você não se intrometer nos problemas da vila. Arlong é muito forte e tem muitos capangas.', 300, 100000, 12, 000292, 3600, 0),
(000294, 000299, 1, 'Os tritões de Arlong', 'Estou curioso quanto à aparência daquele homem estranho, aquele era Arlong?', '-Quem ou o quê era aquilo que te atacou?<br>\r\n-Ele era um tritão. Um dos capangas de Arlong, todos são. Eles são racistas que não se importam em matar ou brincar com vidas humanas, nos julgam inferiores. Se eles não fossem tão fortes nós já teríamos resolvido isso.<br>\r\n', '-E a marinha? Não vem ajudar?<br>\r\n-A marinha... Arlong já destruiu muitos navios da marinha, eles não vão enviar mais nenhum, os únicos que podem fazer frente a eles são as pessoas do Quartel General da Marinha, mas eles estão muito ocupados com a Grande Rota. Mas não se preocupe, nós vamos ficar bem! Temos um plano.\r\n', 300, 100000, 12, 000293, 3600, 0),
(000295, 000300, 1, 'O acordo de 100 milhões de beries', '-Não posso aceitar isso!! Tenho que fazer alguma coisa para ajudar você e essas pessoas.', 'A moça disse que está tudo sobre controle, uma garota da ilha fez um acordo com Arlong, ela compraria a vila por 100 milhões de berries. Ela está quase conseguindo o todo o dinheiro para isso e se você se intrometesse esse trato poderia ser desfeito. ', '-Ninguém tem que morrer, se comprarmos a vila estaremos livres.<br>\r\n-Mas eu não poss..<br>\r\n-Estou dizendo para não interferir! Se você atrapalhar todo o tudo o que fizemos até hoje vai ser em vão. Não deixe tudo mais difícil do que está.<br>\r\n', 300, 100000, 12, 000294, 3600, 0),
(000296, 000301, 1, 'Difícil despedida ', 'Você sai inconformado em não poder ajudar, indo até a cidade reunir sua tripulação.', '-Vamos pessoal! Não há mais nada para se fazer aqui. Essa gente já tem muitos problemas. Vamos comprar suprimentos e partir.<br>\r\n-Senhorita, eu queria muito ajudar vocês derrotando Arlong, mas não posso arriscar a vida de todos. Além disso, vejo que vocês confiam suas vidas a essa garota corajosa. Espero vê-la de novo só que em melhor situação. Boa sorte!!\r\n', 'Você dá parte de seu ouro para a moça dizendo:<br>\r\n- Tome, não é muito, com ele vocês não vão precisar se preocupar com os impostos de Arlong. <br>\r\nVocê reúne sua tripulação e sai da ilha decidido a voltar e derrotar Arlong. \r\n', 300, 100000, 13, 000295, 3600, 0),
(000297, 000292, 0, 'Esta é Cocoyashi?', 'Você chega na ilha cocoyashi, você fica assustado depois de perceber que parte da cidade está destruída.', 'Ao desembarcar na cidade você não vê uma alma viva. Você e sua tripulação se separam para procurar sobreviventes, continua a procurar até que você ouve uma garota gritando.', 'Você corre para ver o que está acontecendo e vê um homem bem grande perseguindo uma mulher. Você corre para salva-la e ao se aproximar você percebe que ele parece ser humano.', 300, 100000, 11, 000000, 3600, 0),
(000298, 000293, 0, 'Arlong?', 'Você grita ferozmente e quando ele se vira você o acerta com toda a força no rosto. Ele cai imediatamente. Enquanto ele está caído você agarra o braço da moça e corre com o objetivo de coloca-la em segurança.', 'A moça te leva até a casa dela. Ela lhe conta que Arlong invadiu esta ilha há muito tempo impondo a todos da ilha que lhe pagasse impostos altíssimos e matava todos que não pudessem pagar. Então a moça baixa a cabeça quase chorando e fala que sua mãe morreu assim.', 'Então você diz que quer ajudar a deter Arlong, mas ela diz para você não se intrometer nos problemas da vila. Arlong é muito forte e tem muitos capangas.', 300, 100000, 12, 000297, 3600, 0),
(000299, 000294, 0, 'Os tritões de Arlong', 'Estou curioso quanto à aparência daquele homem estranho, aquele era Arlong?', '-Quem ou o quê era aquilo que te atacou?<br>\r\n-Ele era um tritão, um dos capangas de Arlong, todos eles são. Eles são racistas e não se importam em matar ou brincar com vidas humanas, nos julgam inferiores. Se eles não fossem tão fortes nós já teríamos resolvido isso.<br>\r\n', '-E a marinha? Não vem ajudar?<br>\r\n-A marinha... Arlong já destruiu muitos navios da marinha, eles não vão enviar mais nenhum, os únicos que podem fazer frente a eles são as pessoas do Quartel General da Marinha, mas eles estão muito ocupados com a Grande Rota. Mas não se preocupe, nós vamos ficar bem! Temos um plano.\r\n', 300, 100000, 12, 000298, 3600, 0),
(000300, 000295, 0, 'O acordo de 100 milhões de beries', '-Não posso aceitar isso!! Tenho que fazer alguma coisa para ajudar você e essas pessoas.', 'A moça disse que está tudo sobre controle, uma garota da ilha fez um acordo com Arlong, ela compraria a vila por 100 milhões de berries. Ela está quase conseguindo o todo o dinheiro para isso e se você se intrometesse esse trato poderia ser desfeito. ', '-Ninguém tem que morrer, se comprarmos a vila estaremos livres.<br>\r\n-Mas eu não poss..<br>\r\n-Estou dizendo para não interferir! Se você atrapalhar todo o tudo o que fizemos até hoje vai ser em vão. Não deixe tudo mais difícil do que está.<br>\r\n', 300, 100000, 12, 000299, 3600, 0),
(000301, 000296, 0, 'Difícil despedida', 'Você sai inconformado em não poder ajudar, indo até a cidade reunir sua tripulação.', '-Vamos pessoal! Não há mais nada para se fazer aqui. Essa gente já tem muitos problemas. Vamos comprar suprimentos e partir.<br>\r\n-Senhorita, eu queria muito ajudar vocês derrotando Arlong, mas não posso arriscar a vida de todos. Além disso, vejo que vocês confiam suas vidas a essa garota corajosa. Espero vê-la de novo só que em melhor situação. Boa sorte!!', 'Você dá parte de seu ouro para a moça dizendo:<br>\r\n- Tome, não é muito, com ele vocês não vão precisar se preocupar com os impostos de Arlong. <br>\r\nVocê reúne sua tripulação e sai da ilha decidido a voltar e derrotar Arlong. \r\n', 300, 100000, 13, 000300, 3600, 0),
(000302, 000307, 1, 'A super viajem', 'Depois de terem passado por uma experiência incrível, você e seus piratas vão em busca de suprimentos na Ilha North Coral.', 'O mar como sempre muito agitado, mas nada que pudesse gerar uma séria preocupação. Então, vocês conseguem seguir viagem até a ilha sem problema nenhum para encontra-la. Depois de horas navegando sem nada pra fazer você avista a ilha, \r\n', 'Esta ilha apareceu em boa hora, todos estão doidos para desembarcar e conhecer a ilha.', 300, 100000, 11, 000000, 3600, 0),
(000303, 000308, 1, 'Ilha North Coral', 'Essa ilha é de fato muito bonita e todos os habitantes parecem ser muito felizes. É hora de comprar suprimentos e equipamentos novos.', 'Olhando a paisagem da ilha, você ordena a seus tripulantes que façam o inventário de seus suprimentos para ter ideia do que precisam comprar. Seus tripulantes sem demora começam a cumprir a ordem dada.<br>\r\nDepois de cumprir suas ordens, sua tripulação pede permissão para andar pela ilha, mas por que recusar? Você esta há muito tempo com eles já é hora de dar um descanso pra eles. \r\n', 'E já que todos estão de saída, você não quer ficar ali sozinho, além disso, esta é uma cidade bem grande e deve ter muita coisa que pode ajudar você. ', 300, 100000, 12, 000302, 3600, 0),
(000304, 000309, 1, 'A loja estranha', 'Caminhando pela cidade uma loja bem grande lhe chama a atenção. Ela parece ter à venda vários produtos estranhos, mas como ela está lotada de clientes, ela deve ser bem popular.', 'Você fica curioso e entra para conhecer a loja, ela tem muitos aparelhos esquisitos e engenhosos. De repente um pirata estra na loja e logo já anuncia o assalto dizendo pra o dono que entregue todo o ouro, ou sua tripulação iria destruir a loja e também a cidade. O dono da loja muito confiante, diz que gostaria de vê-los tentar e que ele iria se defender se fosse necessário.  O pirata fica furioso e se prepara para ataca-lo,  e antes que o punho do pirata o atinja, você segura a  mão do pirata.', 'Você golpeia aquele pirata que foge jurando voltar com toda sua tripulação para destruir a cidade.', 300, 100000, 12, 000303, 3600, 0),
(000305, 000310, 1, 'Akuma no mi?', 'O dono da loja fica muito agradecido pelo que você fez por ele, mas se sente assustado com o que o pirata disse, a respeito de voltar para destruir a cidade. ', 'Ele diz que não teme os piratas, mas seu capitão era muito forte. <br>\r\n-Ele não é normal, dizem que é um monstro! Falam até que ele tem o poder da akuma no mi. (diz o dono da loja). <br>\r\n- Akuma no mi? O que é isso?(você responde)<br>\r\nO vendedor sorri e começa a lhe contar um pouco sobre a elas. <br>\r\n-Akuma no mi pouco se sabe sobre elas, mas quem as comer ganha poderes especiais.<br>\r\n-Nossa! Como eu faço para conseguir uma? Você tem alguma aí?<br>\r\n-Há!Ha!Ha! Elas são frutas muito raras, é quase impossível de conseguir.<br>\r\n-Nossa! Eu preciso de uma dessa!<br>\r\n-Nem tudo é tão bom assim, quem comer uma Akuma no mi, é expulso do mar!<br>\r\n-O que!?<br>\r\n-Ninguém sabe o porquê, mas que comer uma dessa e cair no mar é rapidamente puxado para o fundo do oceano.<br>\r\nFim\r\nVocê compra tudo o que precisa e sai da loja pensando se vale a pena comer uma Akuma .\r\n', 'Você compra tudo o que precisa e sai da loja pensando se vale a pena comer uma Akuma .', 300, 100000, 12, 000304, 3600, 0),
(000306, 000311, 1, 'O Poder da Akuma no mi', 'Você continua a explorar a ilha, mas até que aquele pirata chega com seu capitão que diz:<br>\r\n-É esse o cara que te fez de tapete? Há! Há! Há! Não faz mal, eu queria mesmo mostrar aos habitantes desta ilha com quem estão mexendo. Você vai servir de exemplo para todos que entrarem em meu caminho.\r\n', '-Tá, tá! Dá pra andar logo! Quero descobrir qual é a diferença de um oponente com um poder de uma akuma no mi! (você diz muito confiante). <br>\r\n-Há! Há! Há! Quanta vontade de morrer! Vamos fazer um trato, se me vencer deixo essa ilha em paz, caso contrario... Bom, não vai faz diferença, vou te matar mesmo!!<br>\r\n-Isso não vai demorar um minuto!!<br>\r\nEntão você começa a lutar com aquele bandido...<br>\r\n', 'O líder dos bandidos vem pra cima de você furioso, e você logo vê que esse não vai ser tão fácil quanto aquele capanga. Além disso,  ele tem o poder de uma akuma no mi o que torna tudo mais difícil, mas logo você percebe que ele não controla sua força, então você ataca com tudo o que tem e com muito custo você vence a luta. <br>\r\nOs habitantes da ilha fazem uma festa para lhe agradece pelo que você fez por eles. Você e sua tripulação festejam com eles e partem no dia seguinte.\r\n', 300, 100000, 13, 000305, 3600, 0),
