(000312, 000317, 1, 'Introdução', 'A ilha Caucasia junto à Telfion forma o Cinturão das Luas, Caucasia tem o formato de uma foice. A oeste da ilha Caucasia existe uma ilha chamada Telfion. A ilha Caucasia é controlada pelo bando Shijen e a Telfion é controlada pelo Baster Kaizokudan.', 'Existem três portos na ilha, um na parte sul que é mais usado para comércio e descarregamentos,o norte que é usado por viajantes que vêm da Grande Rota e o Oeste, construído para os piratas "Shijen".', 'Foram esses piratas que a um tempo atrás atacaram a vila de um do seus tripulantes, eles os deixaram sem comida por um bom tempo, ele esta com muita raiva e pede sua ajuda para uma vingança', 300, 100000, 11, 000000, 3600, 0),
(000313, 000318, 1, 'Centro', 'Você segue com sua tripulação para o centro da cidade em busca de informações  sobre a localização de seu inimigo', 'Ao caminhar, vocês reparam que esta ilha está meio caótica, parece que os piratas não a deixa em paz.<br>\r\nLogo a frente uma mulher vem correndo em sua direção, até que de repente ele para de correr e se vira presa a alguma coisa.<br>\r\nUm homem segurou o braço dela e começou a espanca-la.<br>\r\nVocê corre desesperadamente e soca o homem libertando a mulher<br>\r\n-Tudo bem com você? - Você pergunta<br>\r\n-Sim, esse pirata pertence ao bando Shijen, é melhor vocês não se intrometerem, a coisa vai complicar para vocês.<br>\r\nEntão o homem vem andando em sua direção, e assim que a mulher disse que ele pertencia ao bando Shijen, seu atirador acertou um tiro nele.', '-Vocês tem certeza de que sabem o que estão fazendo? - A moça retrucou<br>\r\n-Sim, Pode nos dizer onde fica o esconderijo deles?<br>\r\n-Não sei ao certo, mas dizem que fica numa aldeia nos limites da ilha.', 300, 100000, 12, 000312, 3600, 0),
(000314, 000319, 1, 'Em direção a batalha', 'Você segue rumo a informação passada em busca do seu inimigo', 'Caminhando pela vila vocês avistam o rival, os olhos do seu tripulante se enchem de raiva e ele ataca sem pensar', 'Inicia-se a batalha.', 300, 100000, 12, 000313, 3600, 0),
(000315, 000320, 1, 'O Sangue começa a ser derramado!', 'De repente começam a disparar balas de todos os lados.<br>\r\nVocê leva um tiro em seu ombro e começa a sangrar.', 'O líder inimigo vai na direção de seu companheiro querendo retribuir o ataque, você manda os outros tripulantes darem cobertura a ele.<br>\r\nCom seu ombro machucado você se esquiva de alguns ataques e consegue acertar alguns inimigos.<br>\r\nO líder inimigo mira um golpe na cabeça de seu companheiro, ele esquiva por baixo e contra ataca acertando um soco na barriga. Em seguida o inimigo recua dois passos e fere um golpe vertical, seu companheiro desvia para direita, mas tem seu ombro levemente cortado, então uma bala perdida em meio ao tumulto acerta a perna do seu inimigo.', 'Ambas as tripulações já estão completamente desestabilizadas, você está perdendo a luta, mas encontra uma brecha para vitória.', 300, 100000, 12, 000314, 3600, 0),
(000316, 000321, 1, 'Reviravolta', 'Seu inimigo se abaixa por culpa do tiro e você se levanta pensando que iria dar o golpe final, quando de repente ele pula em sua direção te jogando no chão e apontando a espada na sua cabeça', 'Você coloca suas mãos no bolso e tira uma pequena faca.<br>\r\nSem que ele percebesse você atravessa o joelho de seu oponente e ele cai ferido no chão<br>\r\nVocê toma a espada dele e uma cabeça rola no chão.<br>\r\nVendo que seu lider foi derrotado, os outros piratas começam a fugir.<br>\r\nQuando a poeira tinha abaixado, os habitantes vieram batendo palmas e agradecendo a vocês.', 'Antes que pudessem se agradecer direito, vocês já estavam a caminho do navio.<br>\r\n-Mais alguma coisa para tratar aqui capitão?<br>\r\n-Não, vamos logo, precisamos chegar logo na grande Rota', 300, 100000, 13, 000315, 3600, 0),
(000317, 000312, 0, 'Introdução', 'A ilha Caucasia junto à Telfion forma o Cinturão das Luas,Caucasia tem o formato de uma foice.A oeste da ilha Caucasia existe uma ilha chamada Telfion.A ilha Caucasia é controlada pelo bando Shijen e a Telfion é controlada pelo Baster Kaizokudan.', 'Existem três portos na ilha,um na parte sul que é mais usado para comércio e descarregamentos,o norte que é usado por viajantes que vêm da Grande Rota e o Oeste ,construido para os piratas "Shijen".', '... Finalmente é chegado o momento de captura contra o bando Shijen !', 300, 100000, 11, 000000, 3600, 0),
(000318, 000313, 0, 'Centro', 'Você segue com sua tripulação para o centro da cidade em busca de informações  sobre a localização de seu inimigo', 'Ao caminhar, vocês reparam que esta ilha está meio caótica, parece que os piratas não a deixa em paz.<br>\r\nLogo a frente uma mulher vem correndo em sua direção, até que de repente ele para de correr e se vira presa a alguma coisa.<br>\r\nUm homem segurou o braço dela e começou a espanca-la.<br>\r\nVocê corre desesperadamente e soca o homem libertando a mulher<br>\r\n-Tudo bem com você? - Você pergunta<br>\r\n-Sim, esse pirata pertence ao bando Shijen, precisamos de ajuda!<br>\r\nEntão o homem vem andando em sua direção, e assim que a mulher disse que ele pertencia ao bando Shijen, seu atirador acertou um tiro nele.', '-Pode nos dizer onde fica o esconderijo deles?<br>\r\n-Não sei ao certo, mas dizem que fica numa aldeia nos limites da ilha.', 300, 100000, 12, 000317, 3600, 0),
