(000322, 000327, 1, 'Atacados pela gripe', 'Após uma tempestade, uma gripe terrível atingiu os membros da sua tripulação, alguns tiveram sintomas de pneumonia grave, vocês foram obrigados a parar nesta ilha', 'Os únicos que conseguiam andar na tripulação eram você e o médico, então vocês saíram em busca de ajuda.<br>', 'Já estava de noite e um calor insuportável, vocês pararam a primeira pessoa que viram e pediram ajuda', 300, 100000, 11, 000000, 3600, 0),
(000323, 000328, 1, 'As fontes termais', '-Minha tripulação ficou doente, preciso de ajuda', '-Qual o problema deles? - perguntou o homem que vocês tinham parado.<br>\r\n-Gripe e sintomas de pneumonia - Respondeu o médico.<br>\r\n-Apesar disso vocês foram muito sortudos, Jumbo Town é famosa por suas fontes termais com poderes curativos! Tragam eles aqui que vou ajuda-los', 'Então você e o médico se revezaram para levar a todos até a fonte termal, mas surgiu um problema para levar o ultimo tripulante', 300, 100000, 12, 000322, 3600, 0),
(000324, 000329, 1, 'Quem irá despir a mulher?', 'Como levar a única mulher do navio para as fontes?', '-Você a leva, se ela descobrir que eu a vi nua ela vai me matar - Comentou o médico.<br>\r\n-Nem sonhando, eu é que vou morrer se ela souber que eu a vi nua.<br>\r\nE vocês começaram uma discussão para decidir quem iria leva-la', 'Até que uma enfermeira que trabalha nas fontes termais se ofereceu para ajudar.<br>\r\n-Estamos salvos!\r\n-Estamos salvos!', 300, 100000, 12, 000323, 3600, 0);
INSERT INTO `tb_missoes` (`cod_missao`, `respectiva`, `faccao`, `nome`, `descricao`, `descricao_2`, `descricao_3`, `recompensa_xp`, `recompensa_berries`, `requisito_lvl`, `requisito_missao`, `duracao`, `img`) VALUES
(000325, 000330, 1, 'Recuperação', 'Então eles ficaram ali por algumas horas e começaram a se sentir melhor', '-Essas águas são realmente milagrosas.<br>\r\n-Nunca me senti tão bem<br>\r\n-Estou ficando cada vez melhor<br>\r\nToda sua tripulação estava se recuperando.', 'Após o confortante banho, vocês agradeceram ao senhor que informou sobre as fontes termais e aproveitaram para fazer reparos no navio e comprar alguns suprimentos', 300, 100000, 12, 000324, 3600, 0),
(000326, 000331, 1, 'Partida', 'Após afiar as armas, comprar algumas coisas e reparar o navio, todos estão prontos para partir.', 'Todos entram no navio e começam os preparativos para a viagem', '-Tudo pronto! Qual é mesmo o nome da próxima ilha? - Você perguntou ao navegador.<br>\r\n-Kagero capitão.<br>\r\n-Já??? Ok, Rumo a Kagero!!!', 300, 100000, 13, 000325, 3600, 0),
(000327, 000322, 0, 'Atacados pela gripe', 'Após uma tempestade, uma gripe terrível atingiu os membros da sua tripulação, alguns tiveram sintomas de pneumonia grave, vocês foram obrigados a parar nesta ilha', 'Os únicos que conseguiam andar na tripulação eram você e o médico, então vocês saíram em busca de ajuda.<br>', 'Já estava de noite e um calor insuportável, vocês pararam a primeira pessoa que viram e pediram ajuda', 300, 100000, 11, 000000, 3600, 0),
(000328, 000323, 0, 'As fontes termais', '-Minha tripulação ficou doente, preciso de ajuda', '-Qual o problema deles? - perguntou o homem que vocês tinham parado.<br>\r\n-Gripe e sintomas de pneumonia - Respondeu o médico.<br>\r\n-Apesar disso vocês foram muito sortudos, Jumbo Town é famosa por suas fontes termais com poderes curativos! Tragam eles aqui que vou ajuda-los', 'Então você e o médico se revezaram para levar a todos até a fonte termal, mas surgiu um problema para levar o ultimo tripulante', 300, 100000, 12, 000327, 3600, 0),
