(000330, 000325, 0, 'Recuperação', 'Então eles ficaram ali por algumas horas e começaram a se sentir melhor', '-Essas águas são realmente milagrosas.<br>\r\n-Nunca me senti tão bem<br>\r\n-Estou ficando cada vez melhor<br>\r\nToda sua tripulação estava se recuperando.', 'Após o confortante banho, vocês agradeceram ao senhor que informou sobre as fontes termais e aproveitaram para fazer reparos no navio e comprar alguns suprimentos', 300, 100000, 12, 000329, 3600, 0),
(000331, 000326, 0, 'Partida', 'Após afiar as armas, comprar algumas coisas e reparar o navio, todos estão prontos para partir.', 'Todos entram no navio e começam os preparativos para a viagem', '-Tudo pronto! Qual é mesmo o nome da próxima ilha? - Você perguntou ao navegador.<br>\r\n-Kagero capitão.<br>\r\n-Já??? Ok, Rumo a Kagero!!!', 300, 100000, 13, 000330, 3600, 0),
(000332, 000337, 1, 'Loguetown a cidade lendária', 'Essa é uma bela cidade, onde nasceu e morreu o Gol D. Roger, rei dos piratas, você está muito feliz em chegar aqui.', 'Vamos explorar a ilha, Logue Town é uma cidade bem grande deve ter muita coisa que pode ajudar você.  Sua tripulação pede permissão para andar pela ilha, mas por que recusar? Você esta há muito tempo com eles já é hora de uma folga.', 'Parece estar havendo um evento importante aqui perto, você se aproxima e lê o letreiro “Campeonato de Culinária”. Que bom, o melhor jeito de conhecer uma ilha é com sua comida.', 300, 100000, 13, 000000, 3600, 0),
(000333, 000338, 1, 'A competição de culinária', 'Parece que a competição já começou você se aproxima para ver melhor o que está acontecendo. Ao se aproximar você vê uma bela mulher chamada Carmen e Sanji, aquele cozinheiro de Baratie. ', 'Mas que pena, já é rodada final. Todos ali estão ansiosos para ver quem é o melhor.<br>\r\nE a disputa começa! Carmem é bem extravagante quando cozinha sem falar em seu charme. Mas Sanji é bem habilidoso. Sanji faz coisas inacreditáveis para conseguir o efeito esperado em suas criações, Carmen também não deixa a desejar e faz uma exibição incrível. Os dois fazem pratos incríveis que parecem estar deliciosos. E agora?! Quem receberá o prêmio?!\r\n', '-E o vencedor é... San...\r\nE quando iriam anunciar o resultado, a cozinheira Carmem se levanta e diz que perdeu a disputa e dá a vitória a Sanji dizendo que ele é o melhor cozinheiro de East blue.\r\n', 300, 100000, 13, 000332, 3600, 0),
(000334, 000339, 1, 'O Capitão Smoker', 'Essa cidade parece ser um bom lugar para se viver. É hora de comprar suprimentos e equipamentos novos.', 'Entrando em uma loja de suprimentos você conversa com o vendedor:<br>\r\n-Essa é uma cidade muito tranquila não é?<br>\r\n-Sim, quando o Capitão Smoker entrou para a marinha essa cidade ficou muito mais tranquila.<br>\r\n-Capitão smoker?<br>\r\n-Sim! Ele é um dos principais soldados do quartel general da marinha. Esta cidade costumava estar cheia de piratas indo para a grande rota, mas desde que o capitão chegou aqui todo pirata que chega na cidade acaba na prisão. <br>\r\n-Ele não é normal, dizem que é um monstro! Falam até que ele tem o poder da akuma no mi.<br>\r\n', 'Akuma no mi? O que é isso?', 300, 100000, 14, 000333, 3600, 0),
(000335, 000340, 1, 'Akuma no mi? ', 'O vendedor sorri e começa a lhe contar um pouco sobre a akuma no mi. ', '-Akuma no mi pouco se sabe sobre elas, mas quem as comer ganha poderes especiais.<br>\r\n-Nossa! Como eu faço para conseguir uma? Você tem alguma aí?<br>\r\n-Há!Ha!Ha! Elas são frutas muito raras, é quase impossível de conseguir.<br>\r\n-Nossa! Eu preciso de uma dessa!<br>\r\n-Nem tudo é tão bom assim, quem comer uma Akuma no mi, é expulso do mar!<br>\r\n-O que!?<br>\r\n-Não se sabe o motivo, mas eu acho que essas frutas são tem poder maligno e que o mar que o mar é tão puro que se recusa a abrigar esses poderes.  É o que eu acho!<br>\r\n', 'Você compra tudo o que precisa e sai da loja pensando se vale a pena comer uma Akuma .', 300, 100000, 14, 000334, 3600, 0),
(000336, 000341, 1, 'O que está havendo? Uma execução?', 'Você vai até a plataforma onde o Rei dos Piratas, Gol D. Roger, foi executado.', 'Você percebe que o céu está muito escuro, como se fosse cair uma tempestade e de longe avista duas pessoas no topo da plataforma. Um rapaz estava para ser executado. <br>\r\nO carrasco era Buggy, o palhaço, que diz para o rapaz:<br>\r\n-Tem alguma palavra final? Estamos com uma bela multidão aqui. He!He!He!<br>\r\nO rapaz então grita com muita certeza em suas palavras:<br>\r\n-Eu sou o homem que vai se tornar o rei dos piratas!<br>\r\nToda a multidão fica surpresa com as palavras do rapaz. E então Buggy diz:<br>\r\n-Está na hora de acabar com isso não acha? Borrachudo.<br>\r\nE no que o rapaz pensava que seriam seus últimos segundos, ele abre um sorriso e diz:<br>\r\n-Zoro, Sanji, Ussop, Nami... Me desculpem...Eu vou morrer! =]<br>\r\nNo momento em que a espada iria tocar o pescoço do rapaz, um raio acerta Buggy. Parece que alguma coisa não queria que ele morresse. A plataforma desaba e o rapaz não sofre nenhum arranhão. De repente centenas de marinheiros aparecem e cercam todo mundo. Bem acho que é hora de ir!!\r\n', 'Você tem que se livrar de muitos marinheiros para abrir caminho, e quando você chega em seu percebe que sua tripulação toda estava te esperando por você. Eles dizem:<br>\r\n- Marinheiros tentaram destruir nosso navio, mas os impedimos a tempo.<br>\r\n-É hora de partir, vamos aproveitar os ventos dessa tempestade para ganharmos velocidade.<br>\r\n', 300, 100000, 14, 000340, 3600, 0),
(000337, 000332, 0, 'Chegada em Loguetown', 'Você chega em loguetown, a cidade onde nasceu e morreu Gol D Roger, o Rei dos piratas. Vamos para a base da marinha você está ansioso para conhecer o Capitão Smoker, ele é muito forte e dizem que ele tem o poder de uma akuma no mi. ', 'Você conversa com o Capitão Smoker e oferecendo sua ajuda percebe que ele é muito confiante, e diz que desde que chegou a esse posto, nenhum pirata deixou esta cidade depois de entrar.', 'Smoker finaliza dizendo que não há muito para você fazer, ele diz pra você só fazer uma patrulha na cidade e se avistar algum pirata você deveria comunica-lo imediatamente.', 300, 100000, 13, 000000, 3600, 0),
(000338, 000333, 0, 'Comunicando ataques', 'Você explora a cidade atrás de aventuras e percebe uma confusão de longe. Você corre para ver o que está acontecendo.', 'Você ouve falar que um pirata está na ilha. Você investiga e descobre que é Gary, da lua crescente quem está saqueando a cidade.  Você decide enfrenta-lo, mas se lembra da ordem de Smoker de avisá-lo da presença de piratas e volta para cumprir sua missão.', 'Você volta e vai direto para a sala de smoker, você entra e percebe que a sala está cheia de fumaça mal dá pra ver o quem está nela. Você se anuncia e diz que têm piratas saqueando a ilha. Smoker se levanta calmamente, abre a janela e a fumaça rapidamente se dissipa.', 300, 100000, 13, 000337, 3600, 0),
(000339, 000334, 0, 'Vendo Smoker em ação', 'Você diz que poderia resolver isso rapidamente, mas não queria desobedece-lo. Você pede permissão para cuidar do assunto porque e se fosse depressa poderia alcança-los.', 'Smoker muito calmo, diz:<br>\r\n\r\n-Esqueça, tenho meu próprio jeito de fazer as coisas, trabalho no meu ritmo. Se quiser pode vir comigo, mas eu vou cuidar disso. Do meu jeito.<br>\r\n\r\nVocês caminham calmamente pela cidade e vão até o lugar onde estavam os piratas. Chegando Smoker diz pra você não se intrometer, ele iria cuidar disso sozinho.', 'Você está muito ansioso para vê-lo em ação, ele chama a atenção dos piratas que rapidamente correm para ataca-lo. Os punhos dele se transformam em fumaça e ele ataca todos os piratas.<br>\r\n\r\nA luta não demora muito e você fica surpreso com o que aconteceu.\r\n\r\n-Mas o como ele fez aquilo com as mãos?', 300, 100000, 14, 000338, 3600, 0),
(000340, 000335, 0, 'Akuma no Mi', 'Você fica muito curioso com o que aconteceu naquela luta e decide perguntar para o Capitão Smoker o que aconteceu com suas mãos naquele momento.', 'Ele diz que tem o poder de uma akuma no mi, a Muku Muku no mi, que o permite controlar a fumaça e também se transformar em fumaça, mas essas frutas tem uma fraqueza. Aqueles que comem uma akuma no mi são expulsos do mar, ou seja, não podem nadar e se caírem no mar terá morte certa. ', 'Você sai da sala pensando que seria muito bom ter o poder de uma akuma no mi, mas vale a pena ser um marinheiro que tem medo do mar?', 300, 100000, 14, 000339, 3600, 0),
(000341, 000336, 0, 'Rumo a Grande Rota', 'Você já fez tudo o que tinha de ser feito nessa ilha, compre suprimentos e pergunte ao Capitão Smoker qual a próxima ilha que deve ir.', 'Chegando na sala de Smoker você pergunta a ele sobre a próxima ilha que deveria ir. Ele diz que procurou saber mais sobre você, e disse que está fazendo um belo trabalho como marinheiro.  Ele disse que está precisando de marinheiros como você para entrar na Grande Rota, mas para isso você tem que ficar mais forte e completar sua tripulação. ', 'Você ouviu o capitão Smoker, fortaleça sua tripulação e se dirija a Grande Rota', 300, 100000, 14, 000340, 3600, 0),
