(000352, 000357, 1, 'Kimotsu Town', 'Na entrada da ilha uma grande placa pendurada entre dois postes:<br>\r\nAqui é a grande Kimotsu Town, você pode encontrar de tudo aqui, desde uma arma até um bar, mercados, oficinas, oficinas de barco e pousadas também.\r\n', 'Você acaba de  aportar junto com sua tripulação, você precisa ir atrás de ferramentas para seu mecânico<br>\r\nA cidade é grande, possui um enorme mercado cercando os dois lados da cidade, os moradores vivem em meio as montanhas após o mercado.', 'Seu barco está com sérias avarias após seu último combate, você precisa encontrar um novo kit de ferramentas a um bom preço.', 300, 100000, 13, 000000, 3600, 0),
(000353, 000358, 1, 'Busca', 'Existem muitas pessoas gananciosas onde você está, cuidado!', 'Você se aproxima de um antiga oficina e pergunta sobre ferramentas para concertar navio<br>\r\n-Preciso de ferramentas para meu mecânico\r\n-Venha, tenho o que você precisa por apenas 100 milhoes de berries.<br>\r\n-O que? Mas eu não tenho tanto dinheiro assim, desculpe. vou pra outro lugar.\r\n', 'Ao sair da oficina um jovem lhe pede uma moeda em troca de informações<br>\r\n-Eu sei onde você pode encontrar peças para seu barco a um preço acessível.<br>\r\n-Vá através das montanhas e procure a cabana de um homem chamado Ben, ele irá lhe ajudar.', 300, 100000, 13, 000352, 3600, 0),
(000354, 000359, 1, 'Caminho entre as montanhas', 'Você segue adiante entre as montanhas, você está em uma região perigosa onde acontecem possíveis assaltos', 'Subitamente, atrás de uma enorme roxa surgem dois bandidos armados que lhe pedem todo o seu ouro, se você entregar não terá dinheiro para as ferramentas e não poderá mais sair da ilha.', 'O combate se inicia, você leva um ferimento no braço mas consegue afugentar os bandidos, você pega uma pequena bolsa de pano que eles deixaram cair. Você abre e percebe que existe um anel de ouro dentro.', 300, 100000, 14, 000353, 3600, 0),
(000355, 000360, 1, 'Ferramentas', 'Você já consegue avistar a cabana, muito vistosa e em um formato engraçado de cogumelo.<br>Você bate na porta, mas ninguém aparece, continua insistindo na batida até que a porta se abre e aparece um velho', '-Está querendo me deixar maluco??? Eu podia ter matado você. \r\nAté alguns minutos atrás eu fui pego desprevenido por dois bandidos e tive meu importante anel de ouro roubado, quem é você??<br>\r\n\r\n-Me desculpe, minha intenção não foi essa.\r\nPreciso de ferramentas para  meu mecânico, meu navio se encontra em sérias condições.<br>\r\n\r\n-Não preciso de seu ouro e muito menos tenho a intenção de ajudá-lo, suma daqui !!<br>\r\n\r\n-É ? Nem mesmo em troca disso?<br>\r\nvocê mostra o anel de ouro recuperado', '-Como conseguiu isso?? Vamos passe para cá logo!<br>\r\n-Não não, apenas se me arrumar o que preciso.<br>\r\n-Ok, você venceu ! Venha comigo.<br>\r\n\r\nVocês entram na pequena casa em formato de cogumelo, o velho homem retira um caixote debaixo de sua cama.<br>\r\n-Vamos, pode levar isso, isso irá ajudar a reparar seu navio.<br>\r\n-Obrigado, aqui está seu anel.', 300, 100000, 14, 000354, 3600, 0),
(000356, 000361, 1, 'Concerto', 'Você segue de volta para seu navio , indo embora dessa  cidade da ganância.', '-Consegui as ferramentas ! Agora podemos dar o fora daqui.<br>\r\nSua tripulação comemora e seu mecânico começa a fazer os reparos.', 'Tudo pronto.<br>\r\nHora da partida!<br>\r\nRumo à Grande Rota!', 300, 100000, 14, 000355, 3600, 0),
