(000361, 000356, 0, 'Concerto', 'Você segue de volta para seu navio , indo embora dessa  cidade da ganância.', '-Consegui as ferramentas ! Agora podemos dar o fora daqui.<br>\r\nSua tripulação comemora e seu mecânico começa a fazer os reparos.', 'Tudo pronto.<br>\r\nHora da partida!<br>\r\nRumo à Grande Rota!', 300, 100000, 14, 000360, 3600, 0),
(000362, 000367, 1, 'A cidade dentro do vulcão', 'Enfim desembarcaram em Kagero, mas... Só vejo um vulcão adormecido, onde está a entrada da ilha?', 'Vocês contornam o vulcão em busca de pessoas, e quando encontram um porto, atrás dele só tem uma caverna, então vocês decidem entrar na caverna.', 'Ao dar os primeiros passos lá dentro vocês ficam maravilhados ao ver o tamanho da cidade que se escondia dentro do vulcão', 300, 100000, 13, 000000, 3600, 0),
(000363, 000368, 1, 'A história da ilha', 'Andando lá dentro vocês não conseguiam parar de pensar em como uma cidade ficaria bem dentro de um vulcão e perguntaram a um morador', 'Então o morador lhes contou a história:<br>\r\n-A Milhares de anos atrás, essa cidade ficava ao pé do vulcão, que atormentava muito os moradores daqui com suas erupções imprevisíveis e com toda a fumaça que ele gerava. Um dia um sábio homem teve uma ideia "Vamos construir nossa cidade dentro do vulcão, assim não seremos mais incomodados", como era de se esperar, todos riram dele, mas ele explicou melhor sua ideia e assim todos concordaram em fazer. O que acontece é que Kagero não fica dentro do vulcão, ela fica em uma caverna construída ao lado do vulcão pelos moradores, como os anos se passaram, a erosão das chuvas fez com que a caverna ficasse parecendo cada vez mais, parte deste vulcão.', '-Mas as erupções não danificaram em nada a caverna?<br>\r\n-Esse era um medo nosso a princípio, mas pelo contrário, quanto mais larva se acumulava em volta da caverna, mais grossas as paredes iam ficando e assim mais resistentes também', 300, 100000, 13, 000362, 3600, 0),
(000364, 000369, 1, 'Explorando a cidade', 'Incrivel!', 'Agora sua tripulação andou pela cidade conhecendo o lugar e comprando alguns artefactos.', 'Essa já era uma cidade bem grande, e por isso haviam muitos marinheiros, é melhor tomar cuidado por onde anda.', 300, 100000, 14, 000363, 3600, 0),
(000365, 000370, 1, 'Informações sobre a Reverse Mountain', 'Antes de partir, você decidiu confirmar em uma loja que vendia mapas a direção para a grande Rota', 'O senhor da loja disse que basta seguirem alguns quadros para o nordeste que vocês conseguiram achar a entrada para a Reverse Mountain.<br>\r\nE contou-lhes também um detalhe que até então vocês não sabiam...', 'É necessário estar no nível 15 para subir a Reverse Mountain!', 300, 100000, 14, 000364, 3600, 0),
(000366, 000371, 1, 'Partindo com peixes', 'Já com tudo preparado, é hora de partir', 'Seu navio estava passando por uma vistoria da marinha e você logo se assustou e saiu correndo para ver o que estava acontecendo.<br>\r\n-O senhor é o dono deste navio? - perguntou o marinheiro<br>\r\n-Sim, algum problema? - você respondeu ja suspeitando que algo estava errado<br>\r\n-Não, nenhum, obrigado pela visita, volte sempre!', 'Você fingiu ter entendido e sua tripulação subiu no navio, após alguns minutos da sua partida, você descobre que um companheiro que ficou tomando conta do navio recolheu a bandeira pirata e se disfarçou de um navio pesqueiro.<br>\r\nO lado bom foi que vocês escaparam da marinha sem problemas, mas o lado ruim, era que tinha peixe em todos os quartos do navio...', 300, 100000, 14, 000365, 3600, 0),
(000367, 000362, 0, 'A cidade dentro do vulcão', 'Enfim desembarcaram em Kagero, mas... Só vejo um vulcão adormecido, onde está a entrada da ilha?', 'Vocês contornam o vulcão em busca de pessoas, e quando encontram um porto, atrás dele só tem uma caverna, então vocês decidem entrar na caverna.', 'Ao dar os primeiros passos lá dentro vocês ficam maravilhados ao ver o tamanho da cidade que se escondia dentro do vulcão', 300, 100000, 13, 000000, 3600, 0),
(000368, 000363, 0, 'A história da ilha', 'Andando lá dentro vocês não conseguiam parar de pensar em como uma cidade ficaria bem dentro de um vulcão e perguntaram a um morador', 'Então o morador lhes contou a história:<br>\r\n-A Milhares de anos atrás, essa cidade ficava ao pé do vulcão, que atormentava muito os moradores daqui com suas erupções imprevisíveis e com toda a fumaça que ele gerava. Um dia um sábio homem teve uma ideia "Vamos construir nossa cidade dentro do vulcão, assim não seremos mais incomodados", como era de se esperar, todos riram dele, mas ele explicou melhor sua ideia e assim todos concordaram em fazer. O que acontece é que Kagero não fica dentro do vulcão, ela fica em uma caverna construída ao lado do vulcão pelos moradores, como os anos se passaram, a erosão das chuvas fez com que a caverna ficasse parecendo cada vez mais, parte deste vulcão.', '-Mas as erupções não danificaram em nada a caverna?<br>\r\n-Esse era um medo nosso a princípio, mas pelo contrário, quanto mais larva se acumulava em volta da caverna, mais grossas as paredes iam ficando e assim mais resistentes também', 300, 100000, 13, 000367, 3600, 0),
(000369, 000364, 0, 'Explorando a cidade', 'Incrivel!', 'Agora sua tripulação foi até a base da marinha.', 'Essa já era uma cidade bem grande, e por isso haviam muitos marinheiros, sua primeira missão aqui foi a de inspeccionar alguns barcos recém-chegados', 300, 100000, 14, 000368, 3600, 0),
(000370, 000365, 0, 'Inspeccionando barcos', 'Havia apenas um barco não inspeccionado no porto, ele aparentava ser um navio pesqueiro ', 'Não tinha velas piratas e apenas 2 homens tomando conta, ao subir vocês perceberam apenas peixes por toda parte.<br>', 'Então o verdadeiro dono do navio chegou, e vocês o dispensaram', 300, 100000, 14, 000369, 3600, 0),
(000371, 000366, 0, 'Subindo de cargo', 'Retornando ao quartel vocês aguardam as novas ordens.', 'Sua tripulação veio fazendo um belo trabalho recentemente, por causa disso os oficiais da marinha querem te promover.<br>\r\nAgora você precisa ir para a Grande Rota assumir seu novo posto de trabalho!', 'O primeiro passo para entrar na Grande Rota é alcançar o nível 15, após isso, basta subir alguns quadros a nordeste daqui que você encontrará a entrada para a Reverse Mountain que permitirá que vocês entrem na Grande Rota.', 300, 100000, 14, 000370, 3600, 0),
(000372, 000000, 3, 'Entrando na Grande Rota', 'Agora que você alcançou o nível 15, seu novo objetivo é entrar na grande rota para continuar sua aventura.', 'O nosso planeta possui apenas uma faixa de Terra firme, a Red Line, que atravessa o planeta de norte a sul dando uma volta através dele, perpendicularmente a essa faixa de terra, passam-se 3 faixas de água muito importantes, os 2 Calm belts(Cinturão/Faixa Calma) e a Grande Rota.<br>\r\nOs Calm Belts são infestados por Reis dos mares, é impossível atravessa-lo sem ser atacado, e como o próprio nome diz, são tão calmos que lá não passa nem vento nem corrente marítima.', 'Então a única maneira de entrar pela Grande Rota é atravessando a Reverse Montain (montanha reversa/ao contrário).<br>\r\nEssa montanha tem uma característica especial, quatro rios, um vindo de cada oceano, o East Blue, North Blue, West Blue e South Blue correm ao contrário nesta montanha, esses rios sobem a montanha e se encontram Grande Rota.', 300, 100000, 15, 000000, 600, 0),
(000373, 000378, 0, 'Introdução à Grande Rota', 'A Grand Line (Grande Rota), é o mar mais cobiçado por piratas de todo o mundo. Suas águas tenebrosas e ondas assustadoras atraem piratas de todo o mundo, de modo a quem conseguir navegar naquelas águas se torna logo um grande pirata, que geralmente possuirá uma recompensa alta. É também o lugar mais provável que Gol D. Roger escondeu o One Piece e onde o All Blue deve estar situado.', 'A Grande Rota divide mundo ao meio, sendo uma espécie de paralela. Através dela, e da Red Line (Linha Vermelha), são extraídas as divisões do mar em: North Blue, South Blue, East Blue e West Blue.\r\n', 'No meio desse mar, o Log pose (Bússola da Grande Rota) não funciona de modo a que, em vez de apontar para o Norte, a bússola aponta para o campo magnético da próxima ilha. Então, não é possível navegar na Grande Rota, sem que passe pelas ilhas existentes nelas.', 300, 100000, 15, 000000, 3600, 0),
(000374, 000379, 0, ' Chegada', 'Você e sua tripulação acabam de chegar na Red Line, vocês “voam” em direção ao topo da linha que se segue através do fluxo da cachoeira, vocês se aproximam das nuvens e depois caem no oceano, cada um possui um sonho a ser realizado diante de seus olhos.', 'Vocês observam o gigante oceano diante de seus olhos,  é praticamente impossível conter o desejo por aventura. O que será que espera por vocês? Quem será seus novos inimigos? Será que vocês conseguirão chegar até o fim?', 'Você então começa a navegar, o mar está calmo. Atrás vocês podem observar alguns faróis e pela frente uma imensa sombra começa a se formar.\r\n', 300, 100000, 15, 000373, 3600, 0),
(000375, 000380, 0, 'A Baleia Gigante', 'Vocês mal podem acreditar no que estão vendo.\r\nAquela imensa sombra que antes parecia ser uma montanha é na verdade uma gigantesca baleia com cicatrizes na cabeça!! Vocês começam a dar a volta pela baleia para tentar passar despercebidos.\r\n', 'Vocês navegam e a baleia parece não notar a sua presença, ou não se importa. Mesmo assim é bom não mexer com ela. De repente a baleia olha para o céu com olhar pensativo e faz um barulho altíssimo, como se estivesse chorando.  Ao passar pela gigantesca baleia, você vê um farol. <br>\r\n-Bom, vamos até lá pegarmos alguma informação e suprimentos. (você diz à sua tripulação).<br>\r\nA baleia que estava parada começa a nadar a toda a velocidade em direção a Red Line e bate a cabeça na Reverse Mountain. Todo o mar se agita e o navio balança fortemente, vocês se seguram para não caírem no mar. \r\n\r\n', 'Vocês não entendem muito o que aconteceu ou qual o objetivo da baleia, mas  agito do mar leva seu navio rapidamente em direção ao farol. ', 300, 100000, 16, 000374, 3600, 0),
(000376, 000381, 0, 'O velho estranho', 'Depois de se chocar contra a montanha, você vê que a baleia parece perder as forças devagar, então um estranho senhor surge das costas da baleia.', 'Espantado, você observa o velho descer das costas da baleia e ir em direção ao farol, curioso para saber o que ele estava fazendo ali você o segue até uma pequena lojinha que estava ao lado do farol.<br>\r\n\r\n\r\nVocê se aproxima do velho e cuidadosamente pergunta:<br>\r\n\r\n-Meu senhor, que estranha baleia é aquela?<br>\r\n\r\n-Não é da sua conta! Diga logo o que precisa e saia logo daqui.\r\n', '-Me desculpe, eu achei estranho ver a baleia se chocar tão desesperadamente contra a Red Line, só queria saber se poderia ajudar em alguma coisa...', 300, 100000, 16, 000375, 3600, 0),
(000377, 000382, 0, 'O Log Pose', '-Meu senhor, você sabe onde fica a próxima ilha ou como chegar até ela?<br>\r\n-Vocês são mais corajosos que pensei, ou idiotas, navegando por lugares desconhecidos sem saber o que os esperava.\r\n', 'As ilhas da Grande rota são abundantes em minérios, criando campos magnéticos anormais por toda a rota, além disso, as correntes aqui são totalmente instáveis o que torna quase impossível de se navegar por aqui.  Navegar pela Grande Rota vai ser impossível se não tiverem um Log Pose.<br>\r\n-O que é um Log Pose? <br>\r\nÉ uma bussola especial que memoriza um determinado campo magnético. Assim, para viajar de ilha em ilha, seu Log Pose deve se adaptar ao campo da ilha e então te mostrar a direção certa.<br>\r\n-Vai ser o nosso fim se não pudermos definir nossa direção. (você diz desesperado).<br>\r\n', '-Não se preocupe! Eu ainda tenho um que posso vede-lo a você, com a condição de deixarem a baleia em paz.<br>\r\n-Tudo bem! Vamos logo seguir viagem, só precisamos de suprimentos.<br>\r\n-Peguem o que quiserem e partam!<br>\r\n', 300, 100000, 17, 000376, 3600, 0),
